INSERT INTO `catalog_product_entity_text` VALUES (15,85,0,8,'Áo sơ mi phối viền màu'),(16,76,0,8,'<div class=\"tab-content active showContent\">\r\n<p>- Áo sơ mi cổ đức, dáng suông, độ dài thường, có xẻ nhẹ hai bên sườn. </p>\r\n<p>- Viền áo được thêu chỉ khác màu, cổ tay áo xếp ly và đính khuy bạc. </p>\r\n<p>- Áo lựa chọn chất liệu Tuysi dày dặn, bề mặt mịn, thoáng mát.</p>\r\n<p>- Nàng có thể mix cùng quần âu, zuýp bút chì đều rất phù hợp. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(17,85,0,9,'Áo lụa cổ thuyền'),(18,76,0,9,'<div class=\"tab-content active showContent\">\r\n<p>Sang trọng, thời thượng qua mẫu sơ mi lụa được Quý cô yêu thích từ nhà IVY moda. </p>\r\n<p>Áo cổ thuyền, dáng thường, thiết kế vai chờm độc đáo cùng điểm nhấn rút vai mới lạ. Để từ đó tạo bên tay lệch bắt mắt. </p>\r\n<p>Cùng với đó, thiết kế lựa chọn chất liệu lụa mềm mại, mang đến cảm giác mặc nhẹ nhàng và vô cùng thoải mái. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(19,85,0,10,'Áo sơ mi croptop'),(20,76,0,10,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi croptop trẻ trung, năng động, thích hợp với nàng yêu thích sự cá tính.</p>\r\n<p>Thiết kế áo dáng croptop với cổ đức cùng tay dài. </p>\r\n<p>Áo được tạo kiểu 2 lớp: 1 lớp cổ V bên trong và  1 lớp áo giả khoác bên ngoài. </p>\r\n<p>Nàng có thể lựa chọn mix áo cùng chân váy, quần dài, quần short đều rất phù hợp. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(21,85,0,11,'Áo sơ mi xếp tà Peplum'),(22,76,0,11,'<div class=\"tab-content active showContent\">\r\n<p>Nàng công sở yêu thích một chút điệu đà, nữ tính chắc chắn không nên bỏ lỡ thiết kế sơ mi Peplum cách điệu lần này.</p>\r\n<p>Áo được lên dáng xếp tà tạo cổ chữ V quyến rũ, phần tay chờm có điểm rút dây điều chỉnh độ co. Thân dưới áo tạo tà Peplum độc đáo, nhẹ nhàng, mềm mại nhưng vẫn thật  sang trọng và thời thượng.</p>\r\n<p>Gợi ý nàng mix áo cùng chân váy hoặc quần đều phù hợp, thêm các phụ kiện như túi sách, vòng cổ... để hoàn thiện cho Outfit của  mình. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(23,85,0,12,'Áo sơ mi đính hoa'),(24,76,0,12,'<div class=\"tab-content active showContent\">\r\n<p>Thời tiết sang Thu rất thích hợp để diện những key items sơ mi dài tay. Đến với thiết kế sơ mi lần này, IVY moda giữ nguyên dáng cơ bản, được cách điệu thêm chi tiết đính hoa ở cổ áo và xếp ly ở cổ tay. Áo có khuy cài nhỏ đồng màu. Chất liệu là lụa trơn cao cấp, mềm  mại, tạo cảm giác mặc thoải mái. </p>\r\n<p>Môt chiếc áo sơ mi với gam màu tươi tắn sẽ hoàn thành bất cứ outfit nào của nàng. Thiết kế cơ bản nhưng không hề nhàm chán luôn sẵn sàng để tôn lên vẻ đẹp của người mặc.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(25,85,0,13,'Áo sơ mi cổ nơ'),(26,76,0,13,'<div class=\"tab-content active showContent\">\r\n<p>Thể hiện trọn vẻ đẹp nhẹ nhàng, thanh lịch chuẩn phong cách thời trang công sở qua thiết kế sơ mi tạo kiểu mới nhất. Áo tạo ấn tượng qua chi tiết cổ tạo kiểu hình nơ phía trước cùng chiếc khuy đính kèm. Áo dáng suông, có tay dài, phù hợp với các nơi bạn cần mặc trang trọng.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(27,85,0,14,'Áo sơ mi lụa cổ đổ'),(28,76,0,14,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế tôn vinh vẻ đẹp nhẹ nhàng, trang nhã những vẫn đủ để tạo ấn tượng quyến rũ giúp nàng tỏa sáng, mẫu áo sơ mi cổ đổ là một lựa chọn cho các sự kiện quan trọng hay các dịp đặc biệt. </p>\r\n<p>Áo sơ mi được làm từ chất liệu lụa, mềm mịn và tạo nên sự sang trọng. Dáng cổ đổ đặc biệt, tăng điểm nhấn thời trang, khoe trọn phần xương quai xanh quyến rũ. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(29,85,0,15,'Áo sơ mi lụa cổ đức'),(30,76,0,15,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế sơ mi lụa cổ đức, lựa chọn thời trang cao cấp giúp nàng nổi bật trong những dịp quan trọng hay các sự kiện đặc biệt. Các nghệ nhân IVY moda đã chọn lọc loại vải lụa cao cấp, mềm mịn, mang đến cảm giác vô cùng thoải mái khi diện lên. Áo sơ mi dáng ôm, tự tin khoe trọn vẻ đẹp cơ thể. </p>\r\n<p>Áo cổ đức truyền thống nhưng được xếp ly tạo kiểu ở phần thân trước của áo, làm nên điểm nhấn và kiểu dáng độc đáo. Đặc biệt, áo còn được đính hàng khuy kim loại sang trọng. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(31,85,0,16,'Áo sơ mi lụa cổ trụ phối bèo'),(32,76,0,16,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi cổ trụ, thiết kế phối bèo tiểu thư phù hợp cho các nàng công sở yêu thích kiểu nữ tính dịu dàng. </p>\r\n<p>Tay áo dài, có xếp ly nhỏ tạo độ bồng nhẹ. Viền cổ tay nhỏ, đính khuy kim loại cố định, mang đến sự thanh thoát, khá tinh tế.</p>\r\n<p>Áo lựa chọn chất liệu lụa mềm mại, mặc nhẹ và thoải mái. Bạn hãy mix áo cùng quần Tây, chân váy...để có ngay một Outfit thời thượng khi đi làm hay đi gặp mặt bạn bè. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M <br />Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(33,85,0,17,'Áo sơ mi phối bèo'),(34,76,0,17,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế sơ mi lụa phối bèo cổ dành tặng nàng công sở yêu thích một chút điệu đà nhưng vẫn đảm bảo sự thanh lịch, tinh tế. Sơ mi dáng suông, tay dài, cổ tay có xếp ly và đính khuy cài điều chỉnh. Áo dễ dàng mix với nhiều kiểu chân váy, quần khác nhau. Đặc biệt, áo sơ mi rất thích hợp diện ở tiết trời sang Thu se lạnh. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M <br />Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(35,85,0,18,'Áo sơ mi cổ thêu hoa'),(36,76,0,18,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế sơ mi dáng suông cơ bản, cổ đức, tay dài, thân trước và tay áo có đính khuy cài kim loại điều chỉnh. </p>\r\n<p>Áo tạo điểm nhấn qua chi tiết cổ được thêu hoa tỉ mí, đính đá tạo nên hoa văn nhã nhặn, bắt mắt. </p>\r\n<p>Chất liệu lụa cao cấp, thích hợp với mọi thời tiết, đặc biệt mềm mại và mang đến cảm giác mặc vô cùng thoải mái. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(37,85,0,19,'Sơ mi lụa cổ V'),(38,76,0,19,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi cổ chữ V, tay dài. Gấu tay áo được thiết kế bo xếp ly điệu đà. Áo được tạo điểm nhấn thêu hoa chìm trước ngực, nhẹ nhàng và tinh tế. </p>\r\n<p>Sử dụng vải lụa mềm mại tạo cảm giác dễ chịu cho người mặc. Nàng có thể mix cùng quần âu công sở, quần jeans hay zuýp các loại</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(39,85,0,20,'Áo sơ mi cổ xếp'),(40,76,0,20,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi dáng suông, cổ xếp, đính khuy cài độc đáo. Tay áo dài, ống tay có xếp ly cách điệu tạo cảm giác mềm mại, nhẹ nhàng. Áo sử dụng chất liệu vải lụa cao cấp, thoải mái, không nhăn, mang lại sự thanh lịch cho người mặc.</p>\r\n<p>Một thiết kế sơ mi thời thượng, đặc biệt hứa hẹn sẽ nâng tầm phong cách thời trang của cô nàng công sở.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(41,85,0,21,'Áo sơ mi lụa cổ kiểu'),(42,76,0,21,'<div class=\"tab-content active showContent\">\r\n<p>Thêm một thiết kế sơ mi thời thượng vào tủ đồ của quý cô công sở hiện đại. Thiết kế áo sơ mi dáng cơ bản, được cách điệu xếp chồng phần cổ áo và xếp ly ở cổ tay. Áo có khuy cài nhỏ đồng màu. Chất liệu là lụa trơn cao cấp, mềm  mại, tạo cảm giác mặc thoải mái. </p>\r\n<p>Môt chiếc áo sơ mi với gam màu tươi tắn sẽ hoàn thành bất cứ outfit nào của nàng. Thiết kế cơ bản nhưng không hề nhàm chán luôn sẵn sàng để tôn lên vẻ đẹp của người mặc.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 163 cm</p>\r\n<p><strong>Cân nặng: </strong> 47 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-61-90 cm</p>\r\n<p>Mẫu mặc size S Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(43,85,0,22,'Áo gile dạ Tweed'),(44,76,0,22,'<div class=\"tab-content active showContent\">\r\n<p>Áo gile croptop là một phiên bản ngắn gọn của áo gile, thường để mix tạo điểm nhấn với áo, chân váy hay nhiều thiết kế khác.</p>\r\n<p>Áo dáng ngắn, cổ chữ V, tay sát nách tạo nên vẻ đẹp quyến rũ và hiện đại.</p>\r\n<p>Trong thời tiết lạnh, bạn có thể mặc một áo thun dài tay hoặc áo len dưới áo gile vừa để giữ ấm cơ thể vừa biến tấu thành Outfit thời thượng. </p>\r\n<p>Thông tin mẫu:</p>\r\n<p>Chiều cao: 167 cm</p>\r\n<p>Cân nặng: 50 kg</p>\r\n<p>Số đo 3 vòng: 83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(45,85,0,23,'Set bộ họa tiết chấm bi'),(46,76,0,23,'<div class=\"tab-content active showContent\">\r\n<p>Thêm điểm chạm hiện đại, trẻ trung, năng động trong thiết kế Set bộ dành tặng nàng. Bản phối được kết  hợp từ áo croptop bên cạnh dáng chân váy dài, qua gối cực kì tôn dáng. </p>\r\n<p>Áo croptop cổ thuyền, có bo nhẹ ở gấu. Thiết kế tay ngắn tựa dáng vai chờm và thêm dây rút để  điều chỉnh độ dài. Chân váy midi chiều dài qua gối, lưng cao, vừa che được các khuyết điểm mà còn rất tôn dáng. </p>\r\n<p>Để thêm phần hoàn chỉnh cho set bộ, gợi ý nàng mix thêm các phụ kiện như giày cao gót, túi sách, vòng tay, vòng cổ...</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size</p>\r\n<p>M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(47,85,0,24,'Áo sơ mi lụa đính hoa ngực'),(48,76,0,24,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi tay lỡ mix giữa hai chất liệu lụa, tơ cao cấp. Thiết kế áo cổ tròn, độ dài thương, dáng suông nhẹ dễ dàng phối đồ theo nhiều cách khác nhau và phù hợp với sự thay đổi của thời tiết.</p>\r\n<p>Chi tiết đính hoa to nổi bật tạo điểm nhấn bên ngực trái giúp thiết kế áo thêm ấn tượng, thu hút hơn. </p>\r\n<p>Nàng có thể kết hợp áo sơ mi thêu hoa cùng chân váy thanh lịch hoặc quần Tây thời thượng, diện đi làm hay đi chơi đều phù hợp.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(49,85,0,25,'Áo sơ mi lụa khóa kiểu'),(50,76,0,25,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế áo trên nền chất liệu lụa nhưng không kém phần hiện đại với kiểu dáng tay trẻ trung. Thân áo được cách điệu xếp ly khá bắt mắt.</p>\r\n<p>Chất liệu lụa mát với độ rủ tự nhiên giúp nàng sở hữu vẻ ngoài thanh nhã và dịu dàng. Chi tiết khóa kéo phần vai tạo điểm nhấn góp phần khiến thiết kế trở nên thu hút hơn. Đây chính là sự lựa chọn hoàn hảo cho các cô nàng trong thời tiết  này.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(51,85,0,26,'Áo sơ mi bo gấu'),(52,76,0,26,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi cổ cổ 2 ve thời thượng, tay dài tạo kiểu. Dáng áo croptop, phần xoắn dưới eo tạo điểm nhấn thu hút, thân sau bo nhún co giãn. Chất liệu vải lụa mềm mịn, mặc trong nhiều thời tiết khác nhau.</p>\r\n<p>Thiết kế giúp làm tôn lên đường nét tinh tế, mềm mại và quyến rũ của phái đẹp. Kết hợp áo với chân váy ngắn hoặc jeans là nàng đã có 1 outfit đi chơi cực trẻ trung và nữ tính.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(53,85,0,27,'Áo công sở cổ tròn'),(54,76,0,27,'<div class=\"tab-content active showContent\">\r\n<p>Áo công sở dáng croptop ngắn tay trẻ trung. Cổ áo bo tròn mềm mại. Phía trước có 2 túi kết hợp cùng hàng khuy vân bản lớn mang lại cho người mặc vẻ ngoài lịch sự, tiểu thư sang trọng. </p>\r\n<p>Một thiết kế mang nét đẹp hiện đại nhưng không kém phần chỉn chu, lịch sự dành cho những cô nàng công sở. Chất liệu Tuysi và nền vải trơn tạo cảm giác mềm mại, nhẹ nhàng, thanh nhã. Nàng có thể tự tin mix-match cho phong cách công sở mùa hè của mình cùng chân váy, quần jeans và quần âu đều phù hợp. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(55,85,0,28,'Áo hai dây chiffron xếp tầng'),(56,76,0,28,'<div class=\"tab-content active showContent\">\r\n<p>Áo hai dây xếp tầng là một kiểu áo phổ biến trong thời trang hiện đại. Với thiết kế hai dây cùng thân áo là ba tầng xếp chồng lên nhau tạo nên vẻ ngoài đầy trẻ trung và nữ tính. Kiểu áo này thường được may với phần trên là dáng áo hai dây, mang vẻ đẹp gợi cảm và khoe trọn bờ vai người mặc. Phần dưới áo được xếp từng tầng xen lần tạo sự bồng bềnh, thướt tha nhưng không kém phần năng động, thoải mái.</p>\r\n<p>Với thiết kế đa năng, áo phù hợp mặc cho nhiều dịp khác nhau, từ dạo phố, đi chơi, đi làm cho đến dự tiệc, hẹn hò. Ngoài ra, khi kết hợp với quần Jeans, quần short, quần culottes hoặc chân váy ngắn sẽ tạo nên phong cách thời trang cá tính và phong cách.</p>\r\n</div>'),(57,85,0,29,'Áo lụa thêu chữ dáng suông'),(58,76,0,29,'<div class=\"tab-content active showContent\">\r\n<p>Áo lụa dáng suông, cổ tròn, tay ngắn gấp gấu cách điệu. Mẫu áo sơ mi phù hợp đi làm, đi chơi hằng ngày. Ống tay áo ngắn cách điệu phù hợp cho những ngày hè nắng nóng. Thiết kế đơn giản với màu sắc nhẹ nhàng góp phần tôn lên nét sang trọng. Chất liệu lụa với bề mặt mỏng mịn mang lại cảm giác thoải mái, thoáng mát.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(59,85,0,30,'Áo voan kẻ phối dây buộc nơ'),(60,76,0,30,'<div class=\"tab-content active showContent\">\r\n<p>Áo kiểu dài tay, dáng suông, cổ tròn xếp ly nhúm phối dây buộc nơ. Cổ tay áo bo. Chất liệu vải voan cao cấp, mềm mát, ít nhăn và có độ xuyên thấu nhẹ. Họa tiết kẻ và màu sắc tươi sáng trẻ trung thời thượng.</p>\r\n<p>Thiết kế áo có tính ứng dụng cao. Với chiếc áo này, nàng có thể phối cùng chân váy hay quần công sở đều rất phù hợp.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(61,85,0,31,'Áo thun tay nhúm đính khuy'),(62,76,0,31,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ vuông, tay ngắn may nhúm phồng tạo kiểu, đính thêm hàng khuy kim loại tạo điểm nhấn. Dáng áo ôm nhẹ tôn dáng nàng. </p>\r\n<p>Chất liệu vải thun mềm mại, không nhăn, có độ co giãn nhẹ phù hợp với tiết trời mùa thu.</p>\r\n<p>Dáng cách điệu cùng chất liệu thun mềm mại. Không yêu cầu phải cầu kỳ thêm thắt quá nhiều chi tiết hay họa tiết cầu kỳ vẫn khiến nàng xinh đẹp rạng ngời và ghi điểm trong mắt mọi người.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(63,85,0,32,'Áo lụa Bo chun cổ kiểu'),(64,76,0,32,'<div class=\"tab-content active showContent\">\r\n<p>Áo lụa dập nổi nhẹ, cổ dáng chữ V. Độ dài áo vừa phải. Dáng áo suông. Tay áo lửng, phần vai và ống tay được bo chun. </p>\r\n<p>Những chiếc áo suông luôn được ưu ái bởi form dáng rộng rãi, dễ dàng fit với mọi dáng người. Thiết kế áo cổ V này đem đến vẻ sang trọng và nữ tính cho những quý cô hiện đại. Chất liệu lụa cao cấp mang đến một chút độ bóng tự nhiên, góp phần khiến diện mạo nàng sáng bừng dù ở bất cứ không gian nào. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(65,85,0,33,'Áo sơ mi tencel dây rút eo'),(66,76,0,33,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi tay ngắn. Eo chiết dáng peplum có dây kéo rút dễ dàng điều chỉnh. </p>\r\n<p>Chất liệu lụa mang lại cảm giác thoáng mát, thoải mái cho người mặc bởi khả năng hút ẩm cao, thấm hút tốt. Nàng có thể mix&amp;match mẫu áo này với quần dài, quần short, chân váy để tạo ra các outfit khác nhau một cách dễ dàng.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n</div>'),(67,85,0,34,'Áo sơ mi lụa thắt nơ'),(68,76,0,34,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi lụa mềm mại, cổ tạo kiểu thắt nơ nhẹ nhàng. Phía trước đính khuy cài kim loại sang trọng. Tay áo dài, bo gấu, có khuy điều chỉnh. </p>\r\n<p>Áo sơ mi mang đến sự sang trọng, thanh lịch nhưng vẫn hiện đại, thích hợp để nàng công sở bắt đầu ngày làm việc mới. Thiết kế tối giản và thời thượng với chất liệu lụa cao cấp. giúp giấu đi khuyết điểm của bạn. Là item công sở cần thiết trong tủ đồ của nàng, chiếc áo này phù hợp với rất nhiều kiểu phối đồ khác nhau, mix-match cùng quần dài hay chân váy đều có thể.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 163 cm</p>\r\n<p><strong>Cân nặng: </strong> 47 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-61-90 cm</p>\r\n<p>Mẫu mặc size S Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(69,85,0,35,'Áo sơ mi cổ V đắp chéo'),(70,76,0,35,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi thiết kế cổ V đắp chéo, có độ ôm vừa phải là lựa chọn phổ biến và an toàn cho cô nàng công sở.</p>\r\n<p>Áo tay dài, dáng ngắn, gấu tạo kiểu bản to kèm đính khuy cố định.</p>\r\n<p>Thiết kế sử dụng chất liệu lụa giúp dáng sơ mi có độ mềm mại, người mặc tăng sự nữ tính, nhẹ nhàng. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(71,85,0,36,'Áo sơ mi croptop xếp chéo'),(72,76,0,36,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế áo sơ mi tay dài, cổ kiểu, đính khuy bạc trang trí. Áo dáng croptop, thân được xếp chéo cách điệu,vừa mang đến sự cá tính vừa thể hiện gu thẩm mỹ thời thượng của nàng công sở đam mê thời trang. </p>\r\n<p>Nàng chỉ cần mix áo cùng chân váy hoặc quần Tây là đã có ngay sự lựa chọn hoàn hảo đón chào ngày mới. Với thiết kế trẻ trung, màu sắc trendy, áo sơmi không những giúp tôn lên vóc dáng mà còn giúp nàng tiết kiệm thời gian khi chọn đồ.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(73,85,0,37,'Áo thun Croptop bo gấu'),(74,76,0,37,'<div class=\"tab-content active showContent\">\r\n<p>Hoàn thành phiên bản áo thun Croptop trẻ trung, năng động dành tặng bạn mùa FW2023 này. Thiết kế cổ tròn, tay dài, kiểu dáng Croptop, bo co giãn nhẹ ở  gấu và cổ tay. Áo được thiết kế viền cổ khác màu kết hợp hai dây điều chỉnh tạo điểm nhấn. </p>\r\n<p>Áo sử dụng chất liệu thun giữ ấm tốt, diện thoải mái và an toàn cho da. Áo trẻ trung, hiện đại có thể mix cùng nhiều items khác nhau. Và chắc chắn ở mỗi bản phối, thiết kế đều sẽ giúp bạn nổi bật cá tính của mình. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(75,85,0,38,'Áo corset dáng croptop'),(76,76,0,38,'<p>Cách điệu từ chiếc áo Corset thắt eo cổ điển, thiết kế áo Corset ngày nay đã trở thành món đồ thời trang mà mọi cô nàng nên sở hữu. Áo có thiết kế xương eo đặc trung mang lại nét quyến rũ cho phái đẹp. Phần vai cách điệu cùng chi tiết dây nơ buộc thêm phần nữ tính, trẻ trung cùng chất vải tapta bóng nhẹ, mềm mại mang đến sự sang trọng. Áo dáng croptop ôm sát giúp nàng dễ dàng mix &amp; match với nhiều items khác nhau, phù hợp với mọi phong cách nàng theo đuổi. </p>'),(77,85,0,39,'Áo croptop lụa họa tiết kẻ ngang'),(78,76,0,39,'<div class=\"tab-content active showContent\">\r\n<p>Áo kiểu nữ cổ V tay lửng, cổ tay bo chun phồng, áo cài bằng hàng khuy phía trước. Dáng áo croptop, eo may chun nhúm bản to trẻ trung, tôn vòng eo nàng. Chất liệu vải lụa mềm mịn, thoáng mát cùng họa tiết kẻ ngang và viền lông nổi độc đáo.</p>\r\n<p>Thiết kế giúp làm tôn lên đường nét tinh tế, mềm mại và quyến rũ của phái đẹp. Kết hợp áo với chân vấy ngắn hoặc jeans là nàng đã có 1 outfit đi chơi cực trẻ trung và nữ tính.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại. </p>\r\n</div>'),(79,85,0,40,'Áo thun Croptop cổ vuông'),(80,76,0,40,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun dáng croptop, thiết kế cổ vuông, ôm body. Chiếc áo mang phong cách trẻ trung và thời thượng.</p>\r\n<p>Chất liệu thun ôm nhẹ, co dãn sẽ giúp nàng cảm thấy thoải mái và dễ chịu khi diện. Có thể thoải mái mix match mẫu áo kiểu này với nhiều món đồ thời trang khác nhau mà vẫn đẹp, sành điệu khi xuống phố.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(81,85,0,41,'Áo croptop tay phồng phối tweed'),(82,76,0,41,'<div class=\"tab-content active showContent\">\r\n<p>Áo croptop dáng suông, cổ tròn, phía trước là hàng khuy đá đậm chất tiểu thư. Áo dài tay vai phồng nữ tính. Chất vải tweed mỏng, mềm thoáng mát phối cùng tay áo chất vải thô mang lại vẻ trẻ trung, độc đáo. Phối cùng quần jeans hoặc chân váy xòe là nàng đã có 1 outfit đi chơi, đi làm đầy nữ tính!</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(83,85,0,42,'Áo thun ôm dáng croptop'),(84,76,0,42,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế áo croptop trẻ trung năng động, dáng áo ôm body và cổ cao giúp giữ ấm cơ thể. Điểm nhấn là chi tiết in chữ kiểu November. Chất liệu vải thun co giãn nhẹ, mềm mịn, mang lại sự thoải mái cho người mặc.</p>\r\n<p>Màu sắc trung tính cùng kiểu dáng hiện đại, đây chính là item mà mọi cô gái nên có trong tủ đồ Thu Đông của mình. Áo phù hợp diện đi chơi, dễ dàng mix&amp;match với nhiều kiểu áo khoác khác nhau, phù hợp với mọi phong cách nàng theo đuổi.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(85,85,0,43,'Set áo Blazer và quần suông dài'),(86,76,0,43,'<div class=\"tab-content active showContent\">\r\n<p>Áo blazer dáng croptop, tay ngắn. Vai có độn mút. Có khuy cài kim loại tạo kiểu. Chất liệu vải thô mềm mại.</p>\r\n<p>Quần dài ống rộng cạp cao có khóa kéo phía sau, có túi 2 bên.</p>\r\n<p>Set đồ là lựa chọn hoàn hảo cho nàng công sở hiện đại. Với thiết kế trẻ trung, màu sắc trendy, không những giúp tôn lên vóc dáng mà còn giúp nàng tiết kiệm thời gian khi chọn đồ.</p>\r\n</div>'),(87,85,0,44,'Set áo croptop tay bồng và zuýp bút chì'),(88,76,0,44,'<div class=\"tab-content active showContent\">\r\n<p>Set đồ bao gồm áo croptop và zuýp bút chì. Áo dáng crop xếp ly dưới, tay xếp ly phồng. Áo cái bằng hàng khuy trắng thanh lịch. Chân váy cạp cao, cạp may tạo kiểu, độ dài qua đầu gối. Set đồ được làm từ chất liệu tuysi cao cấp giúp giữ form dáng luôn chỉn chu.</p>\r\n<p>Chẳng cần phải đau đầu khi phối đồ, hãy lựa chọn một outfit theo set khi đi làm hoặc xuống phố. Bộ đôi áo croptop và zuýp sẽ giúp tôn lên dáng xinh của nàng.</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m66</li>\r\n<li><em><strong>Cân nặng:</strong></em> 48kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-61-88</li>\r\n</ul>\r\n</div>'),(89,85,0,45,'Áo thun mongtoghi'),(90,76,0,45,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun dáng croptop, cổ V, tay ngắn, phong cách mongtoghi. Dáng áo ôm, phía trước có khuy vân mini.</p>\r\n<p>Mẫu áo thun trẻ trung này sẽ là item không thể thiếu trong tủ đồ mùa hè của nàng. Dáng áo ôm nhẹ cùng chất liệu co dãn tôn lên triệt để vẻ đẹp hình thể của nàng. Để diện được mẫu áo này đẹp nhất, nàng hãy phối cùng các item cạp cao nhé.</p>\r\n<p>Màu sắc: Xanh lime - Cam đào</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<p><strong>Chiều cao: </strong>1m68<br /><strong>Cân nặng:</strong> 52kg<br /><strong>Số đo 3 vòng:</strong> 83-62-95cm</p>\r\n</div>'),(91,85,0,46,'Áo croptop nhấn dây'),(92,76,0,46,'<div class=\"tab-content active showContent\">\r\n<p>Áo dáng croptop cạp ngắn, ống tay dài, cổ tròn. Thân áo được thiết kế dựa trên các đường xếp ly nhỏ cố định. Tay áo phồng và được bo chun ở đầu ống. Phần eo có dây dài cùng màu để buộc, thắt theo ý thích. Cổ áo phía sau có khuy cài kim loại. Thân áo được may 2 lớp, tay áo được may 1 lớp có độ xuyên thấu nhẹ.</p>\r\n<p>Màu sắc: Đỏ mận</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<p><strong>Chiều cao:</strong> 1m69</p>\r\n<p><strong>Cân nặng:</strong> 48kg</p>\r\n<p><strong>Số đo:</strong> 80-60-90cm</p>\r\n</div>'),(93,85,0,47,'Elegant Blazer - Áo blazer phối đai'),(94,76,0,47,'<div class=\"tab-content active showContent\">\r\n<p>Áo blazer với chi tiết cổ V cách tân, tay áo dài, đệm vai. 2 bên may xếp ly tạo điểm nhấn. Áo kèm đai rời thắt nơ đem lại vẻ thanh lịch và tôn dáng người mặc. </p>\r\n<p>Chất liệu được sử dụng là chất vải tuysi cao cấp. Đây là sự lựa chọn hàng đầu của các nhà mốt dành cho các thiết kế đòi hỏi sự thanh lịch, sang trọng mà vẫn đảm bảo tính thoải mái. Chân váy 2 lớp chất liệu vải tuysi mềm nhẹ, thoáng mát, ít nhăn và giữ form dáng tốt. </p>\r\n<p>Mix áo Blazer cùng chân váy dập ly là hoàn thiện outfit đi làm, đi chơi hay đi sự kiện.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(95,85,0,48,'Elegant Pleated'),(96,76,0,48,'<div class=\"tab-content active showContent\">\r\n<p>Áo vest cổ bẻ 2 ve cách điệu, khoét chữ K độc đáo. Tay áo dài. Đệm vai. Tà đáp chéo có 1 khuy cài. Xẻ phía trước. 2 viền túi 2 bên. Có thể mix cùng chân zuýp đồng bộ MS 31B8778.</p>\r\n<p>Dập ly trở thành xu hướng kéo dài suốt 3 mùa mốt vừa qua. Với IVY moda chi tiết dập ly kết hợp cùng áo vest thắt nơ eo tạo nên sự uyển chuyển trong từng cử động</p>\r\n<p>Màu sắc: Xanh - Đen</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<p>Chiều cao: 1m68<br />Cân nặng: 52kg<br />Số đo 3 vòng: 83-62-95cm</p>\r\n</div>'),(97,85,0,49,'Skirt Suit'),(98,76,0,49,'<div class=\"tab-content active showContent\">\r\n<p>Áo vest 2 lớp cổ 2 ve cách điệu. Vạt trước đắp chéo cài bằng 2 khuy hình tròn. Tay áo lỡ. Eo chiết có đỉa và kèm đai cùng màu. Có 2 túi viền đôi 2 bên.</p>\r\n<p>Kết hợp cùng zuýp MS 30M6046 đồng bộ để có bộ trang phục thời thượng và phong cách. Được coi là chuẩn mực của trang phục trang trọng, skirt suit mang vẻ lịch thiệp được yêu thích bởi nhiều nữ doanh nhân. Đây cũng là trang phục quen thuộc của Nữ hoàng Anh Elizabeth II như thông điệp ngầm về cá nhân.</p>\r\n<p>Màu sắc: Cam - Tím Lavender - Hồng san hô</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<p>Chiều cao: 1m68<br />Cân nặng: 52kg<br />Số đo 3 vòng: 83-62-95cm</p>\r\n</div>'),(99,85,0,50,'Sand Vest - Áo Vest phối khuy kiểu'),(100,76,0,50,'<div class=\"tab-content active showContent\">\r\n<p>Cho dù thời trang có bất kỳ biến số nào xuất hiện, kiểu dáng Vest quyền lực vẫn luôn giữ vững ngôi vương trong hàng trăm thiết kế, mang đến các quý cô vẻ ngoài sang trọng. </p>\r\n<p>Thiết kế nằm trong BST EXPRESS tham gia trình diễn tại show thời trang FALL/WINTER 2023, nơi những giá trị đích thực được đánh thức và tỏ bày thông qua các thiết kế cao cấp nhất! </p>\r\n<p>Được biến tấu từ dáng Vest cổ điển, Sand Vest nay được bổ sung thêm các chi tiết xếp ly kết hợp kiểu dáng hình thoi ở thân dưới, giúp thể hiện tính thời trang cũng như gu thẩm mỹ thời thượng. Quý cô chỉ cần mix thêm item Gile bên trong là đã có một trang phục xu hướng. </p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(101,85,0,51,'Single Breasted Set'),(102,76,0,51,'<div class=\"tab-content active showContent\">\r\n<p>Set bộ vest với áo vest 2 khuy chiết eo kết hợp quần suông dáng lửng thể hiện sự thời trang, sành điệu của người phụ nữ, phù hợp cho nhiều dịp khác nhau như công sở, dự tiệc, hay các sự kiện quan trọng.</p>\r\n<p>Áo vest 2 khuy chiết eo tạo nét thanh lịch và chuyên nghiệp. Đảm bảo áo vest vừa vặn, tôn lên vóc dáng người mặc. </p>\r\n<p>Quần suông dáng lửng thoải mái, mang lại sự năng động lại phù hợp với áo vest.</p>\r\n<p>Nàng có thể mix bộ vest với giày cao gót hoặc giày oxford để tăng thêm vẻ lịch lãm. Bổ sung thêm phụ kiện như dây chuyền, đồng hồ, và túi xách phù hợp để hoàn thiện ensemble cho mình. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(103,85,0,52,'Calista Set - Bộ vest đai eo'),(104,76,0,52,'<div class=\"tab-content active showContent\">\r\n<p>Tiết trời sang Thu rất thích hợp để diện những bộ Vest thanh lịch, tinh tế. Đến với thiết kế lần này, IVY Moda đã biến tấu set bộ Vest thông thường thành bản cách điệu độc đáo, phô diễn hoàn hảo nét đẹp nàng công sở. </p>\r\n<p>Áo Vest cổ hai ve, đơm hàng khuy bạc thời thượng. Áo được tạo tà peplum nhẹ bên cạnh phần eo kèm đai cách điệu. Chân váy bút chì hai lớp, ôm nhẹ, vừa che khuyết điểm tốt vừa tạo cảm giác thon gon. </p>\r\n<p>Set đồ là lựa chọn hoàn hảo cho nàng công sở hiện đại. Với thiết kế trẻ trung, màu sắc trendy, không những giúp tôn lên vóc dáng mà còn giúp nàng tiết kiệm thời gian khi chọn đồ.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(105,85,0,53,'Set bộ công sở Adela'),(106,76,0,53,'<div class=\"tab-content active showContent\">\r\n<p>Set đồ bao gồm một áo blazer ôm, kết hợp chân váy xếp ly nhẹ nhàng, tạo nên một bộ trang phục hoàn hảo cho nàng công sở bắt đầu ngày làm việc mới hay đến những buổi gặp mặt sang trọng. </p>\r\n<p>Dáng áo blazer cổ 2 ve thời thượng, thiết kế đơn giản nhưng không kém phần tinh tế, với đường triết eo cách điệu, tôn lên vẻ ngoài gọn gàng và thời trang. Chân váy xếp li bồng nhẹ, mang đến hình ảnh thanh lịch và cáo sang. Cùng với đó, chất liệu vải Tuysi mềm mại và thoáng mát giúp bạn cảm thấy thoải mái trong suốt ngày dài.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 163 cm</p>\r\n<p><strong>Cân nặng: </strong> 47 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-61-90 cm</p>\r\n<p>Mẫu mặc size S Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(107,85,0,54,'Set Áo Vest Peplum và Chân Váy Bút Chì'),(108,76,0,54,'<div class=\"tab-content active showContent\">\r\n<p>Áo Vest dáng croptop, tay ngắn, được tạo kiểu ôm eo kết hợp phần tà  Peplum điệu đài. Thiết kế áo có khuy cài kim loại thời thượng cùng chất liệu vải thoáng mát. </p>\r\n<p>Chân váy bút chì hai lớp, ôm nhẹ, vừa che khuyết điểm tốt vừa tạo cảm giác thon gon. </p>\r\n<p>Set đồ là lựa chọn hoàn hảo cho nàng công sở hiện đại. Với thiết kế trẻ trung, màu sắc trendy, không những giúp tôn lên vóc dáng mà còn giúp nàng tiết kiệm thời gian khi chọn đồ.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(109,85,0,55,'Áo peplum xẻ tà'),(110,76,0,55,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế áo hai lớp vải, lớp ngoài là vải lụa xuyên thấu nhẹ nhàng, tạo hiệu ứng mờ ảo tôn vai, lớp trong là vải lót mềm mại giúp định hình dáng áo.</p>\r\n<p>Cổ áo tròn được may nếp ly, mang đến vẻ nền nã và nữ tính cho thiết kế. Điểm nhấn đặc biệt là chi tiết hoa nổi gắn lệch bên eo cùng phần xẻ tà tinh tế ở vạt áo trước, giúp tôn lên vòng eo thon gọn và làm nổi bật cho vẻ đẹp của sản phẩm.</p>\r\n<p>Áo peplum xẻ tà có thể được kết hợp với nhiều trang phục và phụ kiện khác nhau. Bạn có thể phối nó với một chiếc chân váy midi hoặc quần cạp cao để tạo nên một bộ trang phục thanh lịch và nữ tính. Nếu muốn tạo ra một phong cách cá nhân và thời trang hơn, hãy kết hợp áo với một đôi quần jeans và giày cao gót.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 163 cm</p>\r\n<p><strong>Cân nặng: </strong> 47 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-61-90 cm</p>\r\n<p>Mẫu mặc size S</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(111,85,0,56,'Peplum tweed skirt suit'),(112,76,0,56,'<div class=\"tab-content active showContent\">\r\n<p>Set đồ gồm áo vest dáng peplum và chân váy bút chì. Thiết kế áo peplum dài tay, vai độn, cổ tròn phối viền khác màu tạo điểm nhấn, áo cài bằng khóa kéo phía sau. Áo kèm dây đai da tháo rời. Chân váy dáng bút chì, độ dài ngang đầu gối.</p>\r\n<p>Đặc biệt, việc sử dụng chất liệu cao cấp nhất thị trường như Tweed đã đem lại sự sang trọng cho cả set đồ. Chất liệu Tweed được sử dụng là loại vải dày dặn được dệt từ những sợi len nhiều màu có cấu trúc vặn xoắn. Bề mặt vải Tweed có độ gồ ghề nhẹ đặc trưng, bên trong có lớp lót lụa mềm mại. Tính cao cấp của chất liệu Tweed đem lại là sự mềm nhẹ, khả năng chống nước, chống lạnh tốt. </p>\r\n<p>Lấy cảm hứng từ các bộ suit hoàng gia, thiết kế Peplum Tweed Skirt Suit không chỉ tôn dáng người mặc mà còn mang lại vẻ thanh lịch, quý phái nhất cho người mặc. Bởi vậy đây chính là sự lựa chọn hoàn hảo của các cô nàng dành cho các buổi sự kiện, dịp lễ quan trọng.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(113,85,0,57,'Set Áo Vest Kèm Đai Và Chân Váy'),(114,76,0,57,'<div class=\"tab-content active showContent\">\r\n<p>Áo vest cổ 2 ve, tay áo dài đính 3 khuy trang trí. 2 hàng khuy phía trước. Có đệm ở vai áo. Dáng croptop ngắn ngang eo kèm đai trẻ trung và tôn dáng nàng. Chân váy bút chì độ dài ngang bắp chân có xẻ trước tạo điểm nhấn.</p>\r\n<p>Được chăm chút từ khâu thiết kế đến khâu gia công với mong muốn đem đến một sản phẩm tốt nhất cho khách hàng của mình, IVY moda sử dụng chất liệu Tuysi cao cấp nhằm mang đến sự thoải mái, dễ chịu nhất mà vẫn đảm bảo tính thanh lịch, chỉn chu cho người mặc. Diện cả set đồ đi làm hay đi sự kiện hoặc nàng có thể tách set, dễ dàng phối cùng nhiều items khác nhau, đa dạng hơn phong cách ăn mặc hàng ngày.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 169 cm</p>\r\n<p><strong>Cân nặng:</strong> 48 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>80-60-90 cm</p>\r\n<p>Mẫu mặc size S</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(115,85,0,58,'Áo thun peplum dập lỗ tạo kiểu'),(116,76,0,58,'<div class=\"tab-content active showContent\">\r\n<p>Áo kiểu cổ tròn, tay lửng, eo xếp ly tạo kiểu peplum. Điểm nhấn là chi tiết thêu, đục lỗ tạo kiểu bên phía vai phải mang lại sự trẻ trung cho người mặc.</p>\r\n<p>Chất liệu vải thun thoáng mát, mềm mịn. Nàng có thể dễ dàng mix&amp;match với nhiều kiểu quần, chân váy khác nhau, phù hợp cho nàng diện đi làm hay đi chơi.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 168 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>80-62-95 cm</p>\r\n<p>Mẫu mặc size S</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(117,85,0,59,'Áo thun tay chờm'),(118,76,0,59,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ tròn thiết kế dáng suông với kiểu tay chờm trẻ trung và năng động. </p>\r\n<p>Áo tạo điểm nhấn in hoa nổi bật ở thân trước với màu sắc sinh động, sắc nét. Bạn mix áo cùng chân zuýp, quần jeans đi làm đi chơi, hay xuống phố sau giờ tan tầm...</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(119,85,0,60,'Áo thun tay hến rút sườn'),(120,76,0,60,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ tròn, tay hến, thiết kế rút sườn điều chỉnh độ dài. </p>\r\n<p>Áo được bao viền cổ khác màu nổi bật, thân trước in chữ sắc nét.</p>\r\n<p>Áo lựa chọn chất liệu thun cao cấp, thấm hút tốt và mang đến cảm giác mặc vô cùng thoải mái. Bạn có thể mix áo cùng quần short, chân váy, quần suông là sẽ tại nên những Outfits  trẻ trung, hiện đại và thời trang. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(121,85,0,61,'Áo thun tay hến rút sườn - Mẫu 2'),(122,76,0,61,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ tròn, tay hến, thiết kế rút sườn điều chỉnh độ dài. </p>\r\n<p>Áo được bao viền cổ khác màu nổi bật, thân trước in chữ sắc nét.</p>\r\n<p>Áo lựa chọn chất liệu thun cao cấp, thấm hút tốt và mang đến cảm giác mặc vô cùng thoải mái. Bạn có thể mix áo cùng quần short, chân váy, quần suông là sẽ tại nên những Outfits  trẻ trung, hiện đại và thời trang. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(123,85,0,62,'Áo thun IVY moda'),(124,76,0,62,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ tròn, tay ngắn, dáng baby tee ôm nhẹ body  trẻ trung và hiện đại. </p>\r\n<p>Áo tạo điểm nhấn qua chi tiết thêu hoa thân trước. Đặc biệt, áo có thêu logo IVY moda  thời thượng. </p>\r\n<p>Bạn lựa chọn mix áo cùng quần jeans, chân váy, quần suông đều phù hợp và mang đến những outfits thời trang. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(125,85,0,63,'Áo thun in hoa'),(126,76,0,63,'<div class=\"tab-content active showContent\">\r\n<p>Thuộc dòng sản phẩm Ladies trẻ trung, hiện đại, thiế kế áo thun tinh giản nhưng đủ sành điệu để nàng tự tin xuống phố.</p>\r\n<p>Áo dáng basic tay ngắn phổ biến dễ dàng mix &amp; match theo nhiều phong cách và cân mọi phong cách thời trang hiện nay. </p>\r\n<p>Áo được in hoa nổi  bật ở thân trước. Hình in sắc nét, độ bền màu cao. Chất liệu thun cao cấp, thấm hút mồ hồi tốt, mang đến cảm giác mặc thoải mái ngày hè. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(127,85,0,64,'Áo thun You'),(128,76,0,64,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ tròn, tay ngắn, dáng baby tee trẻ trung và năng động. Thiết kế có màu sắc tươi sáng, hiện đại, hợp thời trang.</p>\r\n<p>Thân trước áo được in và đính chữ nổi bật. Bạn mix áo cùng chân zuýp, quần jeans đi làm đi chơi, hay xuống phố sau giờ tan tầm...</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(129,85,0,65,'Áo thun tay lửng'),(130,76,0,65,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ tròn, độ dài thường, tay lửng, có bo chun nhẹ ở gấu áo và gấu tay. </p>\r\n<p>Thiết kế basic, phối được cùng nhiều đồ với các phong cách khác nhau. </p>\r\n<p>Chất liệu thun dày dặn, mềm mịn, mang đến cảm giác thoải mái khi mặc. Áo thích hợp diện trong thời tiết sang Thu - vào Đông, giữ ấm tốt. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(131,85,0,66,'Áo thun cổ đổ'),(132,76,0,66,'<div class=\"tab-content active showContent\">\r\n<p>- Thiết kế áo cổ đổ, tay hến, dáng ôm, tạo kiểu xếp tầng trẻ trung. </p>\r\n<p>- Chất liệu thun thoáng mát, ôm gọn gàng.</p>\r\n<p>- Mix cùng nhiều kiểu quần, chân váy khác nhau. Phù hợp diện đi chơi, dạo phố.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(133,85,0,67,'Áo len kẻ caro'),(134,76,0,67,'<div class=\"tab-content active showContent\">\r\n<p>Áo len ngắn tay, dáng suông, bo viền khác màu. Điểm nhấn áo nằm ở họa tiết kẻ caro đối lập, đầy ấn tượng. Sự kết hợp tinh tế giúp tôn lên vẻ đẹp tối giản và tạo nên sự khác biệt trong thiết kế.</p>\r\n<p>Áo lựa chọn chất liệu len mềm mịn, giữ ấm cơ thể tốt mà không gây  kích ứng da. Chiếc áo sẽ là lựa chọn hoàn hảo cho những buổi đi chơi, dạo phố hay hẹn hò cùng bạn bè, gia đình. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(135,85,0,68,'Áo len sợi đan chéo'),(136,76,0,68,'<div class=\"tab-content active showContent\">\r\n<p>Áo len sợi đan chéo mỏng phù hợp với thời tiết sang Thu. Áo cổ đức, phối khuy ngọc cố định, tay ngắn và được bo nhẹ ở gấu và cánh tay. </p>\r\n<p>Áo thời trang, hiện đại, có thể mix cùng nhiều kiểu quần, chân váy khác nhau. Áo diện được trong mọi hoàn cảnh, dù là đi làm hay đi chơi. </p>\r\n<p>Sợi len mịn, giữ nhiệt tốt, đặc biệt không gây kích ứng trên da. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(137,85,0,69,'Áo len ngắn tay phối kẻ ngang'),(138,76,0,69,'<div class=\"tab-content active showContent\">\r\n<p>Áo len ngắn tay được thiết kế với chất liệu len chọn lọc cao cấp, tạo nên hình ảnh mềm mại và sang trọng. Điểm nhấn nằm ở họa tiết kẻ ngang đầy ấn tượng trên nền màu áo đổi lập. Sự kết hợp tinh tế giúp tôn lên vẻ đẹp tối giản và tạo nên sự khác biệt trong thiết kế.</p>\r\n<p>Nhờ sự thoải mái và dễ chịu mà chất liệu len cùng kiểu dáng basic của sản phẩm mang lại, chiếc áo sẽ là lựa chọn hoàn hảo cho những buổi đi chơi, dạo phố hay hẹn hò cùng bạn bè, gia đình. Thiết kế đa năng này còn có thể kết hợp với quần suông, baggy hoặc chân váy để tạo nên nhiều phong cách thời trang khác nhau.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(139,85,0,70,'Áo len mongtoghi'),(140,76,0,70,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế áo croptop dáng ôm, điểm nhấn là hàng khuy kim loại phía trước, 2 bên phối túi tạo kiểu. Áo làm từ chất liệu len mongtoghi, đây là loại len có cấu trúc sợi nhỏ, mịn bề mặt và mỏng nhẹ mang đến sự thoải mái, nhẹ nhàng, quyến rũ cho người mặc. Phối cùng quần jeans hay chân váy là nàng đã có set đồ đi làm, xuống phố trẻ trung, năng động.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(141,85,0,71,'Áo thun cổ tim dài tay'),(142,76,0,71,'<div class=\"tab-content active showContent\">\r\n<p>Gam màu cam xâm chiếm lãnh địa thời trang Thu/Đông 2023. Là sự kết hợp giữa sắc đỏ mạnh mẽ, nồng nhiệt với gam màu vàng hạnh phúc, tươi mới, sắc cam xu hướng trở thành biểu tượng mang đến sự ấm áp và thổi nguồn năng lượng tích cực để những quý cô IVY moda tự tin theo đuổi mục tiêu.</p>\r\n<p>Thiết kế áo len cổ tim trên nền gam màu ấm của sự hạnh phúc sẵn sàng trở thành bạn đồng hành của nàng trong mùa Thu/Đông năm nay. Áo tay dài, có độ dài vừa, bo gấu. Dáng tay cánh rơi bồng nhẹ giúp tăng sự mềm mại, uyển chuyển. Nàng lựa chọn mix áo cùng nhiều item khác nhau như quần, chân  zuýp...để  tạo nên bản phối thời thượng, nổi bật hơn bao giờ hết. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(143,85,0,72,'Áo thun Wonder'),(144,76,0,72,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ tròn, tay dài. Bo gấu ở cổ và tay áo. Chất thun có độ dày vừa phải, mềm nhẹ, giữ ấm hiệu quả.</p>\r\n<p>Dễ dàng mix đồ với quần dài, zuýp bò...để có ngay set đồ ưng ý đi chơi, hẹn hò, đi làm mà vẫn cá tính.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(145,85,0,73,'Áo thun đính hoa'),(146,76,0,73,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ tròn, tay dài. Bo gấu ở cổ và tay áo. In hình họa tiết và đính hoa hạt tạo điểm nhấn. Chất thun có độ dày vừa phải, mềm nhẹ, giữ ấm hiệu quả.</p>\r\n<p>Dễ dàng mix đồ với quần dài, zuýp bò...để có ngay set đồ ưng ý đi chơi, hẹn hò, đi làm mà vẫn cá tính.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(147,85,0,74,'Áo thun đính hạt'),(148,76,0,74,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ tròn, tay dài. Bo gấu ở cổ và tay áo. In hình họa tiết và đính hạt cườm tạo điểm nhấn. Chất thun có độ dày vừa phải, mềm nhẹ, giữ ấm hiệu quả.</p>\r\n<p>Dễ dàng mix đồ với quần dài, zuýp bò...để có ngay set đồ ưng ý đi chơi, hẹn hò, đi làm mà vẫn cá tính.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(149,85,0,75,'Áo thun dập nổi kéo khóa'),(150,76,0,75,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ chữ V, kiểu dáng body ôm sát cơ thể. Áo tay dài, có khóa kéo phía trước, thích hợp với thời tiết sang Thu vào Đông. </p>\r\n<p>Chất liệu vải thun dày dặn, họa  tiết dập nổi bắt mắt, co giãn tốt và mang đến cảm giác thoải mái khi  mặc. Mix cùng quần jeans, zuýp xòe đơn sắc đã tạo nên set đồ năng động, trẻ trung đi chơi rồi đấy</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(151,85,0,76,'Áo thun Ladies tay dài'),(152,76,0,76,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun nữ cổ tròn, tay áo dài, có bo ở gấu áo và cổ tay. Thiết kế dáng áo ôm nhẹ, trẻ trung, thời trang, thích hợp mix&amp;mactch với nhiều phong cách khác nhau. </p>\r\n<p>Với kiểu dáng cơ bản dễ phối đồ với quần jeans, quần sooc..cùng chất liệu vải thun cao cấp rất thích hợp cho những ngày đi chơi, tụ họp bạn bè. Thiết kế chắc chắn sẽ là một sự lựa chọn hoàn hảo trong BST Thu - Đông tới đây.  </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(153,85,0,77,'Áo thun Ladies tay dài - Mẫu 2'),(154,76,0,77,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun nữ cổ tròn, tay áo dài, có bo ở gấu áo và cổ tay. Thiết kế dáng áo ôm nhẹ, trẻ trung, thời trang, thích hợp mix&amp;mactch với nhiều phong cách khác nhau. </p>\r\n<p>Với kiểu dáng cơ bản dễ phối đồ với quần jeans, quần sooc..cùng chất liệu vải thun cao cấp rất thích hợp cho những ngày đi chơi, tụ họp bạn bè. Thiết kế chắc chắn sẽ là một sự lựa chọn hoàn hảo trong BST Thu - Đông tới đây.  </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(155,85,0,78,'Áo thun Ladies tay dài - Mẫu 3'),(156,76,0,78,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun nữ cổ tròn, tay áo dài, có bo ở gấu áo và cổ tay. Thiết kế dáng áo ôm nhẹ, trẻ trung, thời trang, thích hợp mix&amp;mactch với nhiều phong cách khác nhau. </p>\r\n<p>Với kiểu dáng cơ bản dễ phối đồ với quần jeans, quần sooc..cùng chất liệu vải thun cao cấp rất thích hợp cho những ngày đi chơi, tụ họp bạn bè. Thiết kế chắc chắn sẽ là một sự lựa chọn hoàn hảo trong BST Thu - Đông tới đây.  </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(157,85,0,79,'Áo len lông cừu đục lỗ'),(158,76,0,79,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế áo lấy cảm hứng từ áo polo ngắn tay, cổ đức cùng hàng khuy kim loại tạo kiểu, tay và gấu áo may bo co giãn.</p>\r\n<p>Chất vải len làm từ sợi len lông cừu cao cấp với những đặc tính nổi bật như mềm mại, êm ái trên da; thoáng khí, hút ẩm tốt; độ đàn hồi và độ bền cao; giúp tăng khả năng chống tĩnh điện nên rất thân thiện với người mặc. Chất vải len mỏng tạo kiểu đục lỗ trẻ trung phù hợp diện vào mùa Xuân Hè này. Áo có độ xuyên thấu nhẹ, phía trước phối 2 túi vuông giúp trang phục thêm kín đáo.</p>\r\n<p>Áo mix cùng quần jeans, zuýp xòe là nàng đã có set đồ năng động, trẻ trung đi chơi hay đi làm rồi đó!</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(159,85,0,80,'Merino Wool - Áo len lông cừu'),(160,76,0,80,'<div class=\"tab-content active showContent\">\r\n<p>Áo len là item không thể thiếu vào những ngày đông. Thiết kế áo cổ tròn, dáng ôm sát cơ thể giúp giữ nhiệt hiệu quả nhất, không những vậy áo còn tôn dáng người mặc, trông nàng gọn người hơn, không cần mặc quá dày mà vẫn đủ ấm. </p>\r\n<p>Chất vải len cao cấp làm từ sợi len lông cừu Merino trứ danh. Cừu Merino là một giống cừu nổi tiếng về việc cho lông cừu làm len. Đây là giống cừu có bộ lông tuyệt vời với những sợi lông cực mảnh, mềm và trắng, là nguyên liệu cho loại len mịn và tốt nhất thế giới với những đặc tính nổi bật như mềm mại, êm ái trên da; thoáng khí, hút ẩm tốt; độ đàn hồi và độ bền cao; giúp tăng khả năng chống tĩnh điện nên rất thân thiện với người mặc do đó góp phần tạo nên ưu thế của giống này. </p>\r\n<p>Với thiết kế basic cùng chất liệu cao cấp, chiếc áo len xứng đáng là item nên có cho tủ đồ đông của nàng bởi tính bền bỉ và không lỗi mốt. Áo dễ dàng mix cùng nhiều kiểu quần, chân váy khác nhau phù hợp cho nàng diện hằng ngày.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(161,85,0,81,'Áo len dáng ôm trễ vai'),(162,76,0,81,'<div class=\"tab-content active showContent\">\r\n<p>Áo len gân dáng ôm kiểu trễ ngang vai, dài tay. Với gam màu đơn sắc nhẹ nhàng, dễ phối đồ.</p>\r\n<p>Chiếc áo mang phong cách trẻ trung và thời thượng. Chất liệu len mềm mịn ôm nhẹ sẽ giúp nàng cảm thấy thoải mái và dễ chịu khi diện. Có thể thoải mái mix match mẫu áo kiểu này với nhiều món đồ thời trang khác nhau mà vẫn đẹp, sành điệu khi xuống phố.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại. </p>\r\n</div>'),(163,85,0,82,'Áo len gân cổ kiểu'),(164,76,0,82,'<div class=\"tab-content active showContent\">\r\n<p>Mỗi độ thu về thì áo len cách điệu luôn là items được các em săn đón. Thiết kế áo cổ khoét sâu, kiểu dáng ôm body cùng độ dài vừa phải sẽ giúp nàng khéo léo khoe lên nét quyến rũ của mình.</p>\r\n<p>Chất liệu vải len gân co giãn, mềm nhẹ và giữ ấm hiệu quả. Để chất liệu vải được bền bỉ hơn, nàng hãy hạn chế giặt vắt bằng máy.</p>\r\n<p>Thiết kế này gần đây đã gây sốt vì vừa dễ phối đồ, có nhiều màu lựa chọn và rất thời trang. Nàng có thể mix cùng quần jeans, zuýp, quần tây hay quần ống rộng đều rất phù hợp nhé!</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(165,85,0,83,'Áo len gân phối khuy'),(166,76,0,83,'<div class=\"tab-content active showContent\">\r\n<p>Áo len cổ cách điệu có khuy đính 2 bên. Tay dài. Vải len gân.</p>\r\n<p>Chất len có độ dày vừa phải, mềm mịn cùng khả năng cách điện, cách nhiệt tốt. Dáng ôm vào body giúp nàng giữ ấm mà vẫn khoe trọn body của mình.</p>\r\n<p>Là item không thể thiếu trong tủ đồ của các nàng vào mùa thu đông, không chỉ giữ ấm cơ thể mà còn thể hiện phong cách thời trang “xịn mịn”. Đừng quên mix cùng chân zuýp, quần jeans hay đôi boot đùi để có set đồ thời trang nhất nhé!</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(167,85,0,84,'Phedra Vest - Áo vest xếp chéo'),(168,76,0,84,'<div class=\"tab-content active showContent\">\r\n<p>Phedra Vest nằm trong BST EXPRESS tham gia trình diễn tại show thời trang FALL/WINTER 2023, nơi những giá trị đích thực được đánh thức và tỏ bày thông qua các thiết kế cao cấp nhất ! </p>\r\n<p>Thiết kế được biến tấu từ áo khoác cổ hai ve cổ điển bên cạnh dáng croptop trẻ trung, hiện đại. Áo có tay dài, cách điệu giấu khuy, vừa mang đến sự cá tính vừa thể hiện gu thẩm mỹ thời thượng của nàng công sở đam mê thời trang. </p>\r\n<p>Chất liệu vải Tuysi cao cấp và mềm mại, bên trong có một lớp lót lụa cùng màu giúp cho item này có sự trẻ trung, phối đồ với đa dạng phong cách khác nhau từ chân váy, quần baggy, quần suông đều rất ưng ý.</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(169,85,0,85,'Kaylin Blazer - Áo Blazer thêu Logo'),(170,76,0,85,'<div class=\"tab-content active showContent\">\r\n<p>Mang đến những \"Lời bày tỏ từ giá trị đích thực\" trong Fall/winter 2023, Kaylin Blazer giữ vai trò thể hiện hình ảnh người phụ nữ xinh đẹp, mạnh mẽ. Từ không gian cổ điển trên con đường của thủ đô Paris, bên cạnh thiết kế thời thượng đã thành công phô diễn diện mạo vẹn toàn vượt ra khỏi khái niệm sắc đẹp đơn thuần.</p>\r\n<p>Thiết kế áo vest, blazer được kế thừa vẻ đẹp của form dáng áo vest cổ điển: cổ 2 ve, vai độn, dáng suông. Chất liệu tuysi mềm nhẹ, thoáng mát, ít nhăn và giữ form dáng tốt. Tất cả đã tạo nên cấu trúc thanh lịch, sang trọng mà vẫn đảm bảo tính thoải mái.</p>\r\n<p>Không chỉ đẹp từ thiết kế đến chất liệu, set đồ còn mang tính ứng dụng cao, phù hợp cho các cô nàng diện nơi công sở và đi dự sự kiện. </p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M </p>\r\n</div>'),(171,85,0,86,'Orabelle Vest'),(172,76,0,86,'<div class=\"tab-content active showContent\">\r\n<p>Không khóa mình trong những bộ suit \"cứng cáp\", IVY moda mang đến bản phối đầy xu hướng cho những quý cô công sở hiện đại. Sự kết hợp giữa áo vest chất liệu tweed cao cấp bậc nhất cùng chân váy vạt bất đối xứng vừa mang đến sự chỉn chu, tinh tế, vừa thể hiện sự nữ tính của người phụ nữ.</p>\r\n<p>Áo vest cổ hai ve khoét chữ K. Vai có đệm mút, 2 khuy cài và 4 khuy trang trí. Áo dáng bo eo, bên cạnh có 2 túi nắp phía trước. Thiết kế lựa chọn chất liệu vải tweed cao cấp, bền màu, giữ form dáng hoàn hảo. Có thể kết hợp cùng áo len, áo sơ mi, chân zuýp, hoặc quần âu đồng màu. Phù hợp đi làm, đi chơi, đi tiệc...</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(173,85,0,87,'Elegant Blazer - Áo blazer phối đai - Mẫu 2'),(174,76,0,87,'<div class=\"tab-content active showContent\">\r\n<p>Áo blazer với chi tiết cổ V cách tân, tay áo dài, đệm vai. 2 bên may xếp ly tạo điểm nhấn. Áo kèm đai rời thắt nơ đem lại vẻ thanh lịch và tôn dáng người mặc. </p>\r\n<p>Chất liệu được sử dụng là chất vải tuysi cao cấp. Đây là sự lựa chọn hàng đầu của các nhà mốt dành cho các thiết kế đòi hỏi sự thanh lịch, sang trọng mà vẫn đảm bảo tính thoải mái. Chân váy 2 lớp chất liệu vải tuysi mềm nhẹ, thoáng mát, ít nhăn và giữ form dáng tốt. </p>\r\n<p>Mix áo Blazer cùng chân váy dập ly là hoàn thiện outfit đi làm, đi chơi hay đi sự kiện.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(175,85,0,88,'Pink Suit'),(176,76,0,88,'<div class=\"tab-content active showContent\">\r\n<p>Áo vest cổ 2 ve khoét chữ K, tay dài. Vạt trước đắp chéo cài bằng 4 khuy phía trước. Có 2 nắp túi giả. Eo chiết. Phần dưới gấu tạo thành dáng peplum xếp ly mới lạ. Có thể mua cùng chân zuýp đồng bộ MS 31M6904.</p>\r\n<p>Lấy tất cả những suy nghĩ cứng nhắc dành cho một bộ suit truyền thống và ném qua cửa sổ. Nàng vẫn dịu dàng, thanh lịch trong bộ suit hồng nữ tính.</p>\r\n<p>Màu sắc: Hồng - Đen</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<p>Chiều cao: 1m68<br />Cân nặng: 52kg<br />Số đo 3 vòng: 83-62-95cm</p>\r\n</div>'),(177,85,0,89,'Larissa Set - Thiết kế áo blazer nơ kèm chân váy'),(178,76,0,89,'<div class=\"tab-content active showContent\">\r\n<p>Gọi tên Larissa Set trong BST FW2023 với hình ảnh cô gái tự tin, mạnh mẽ, tinh tế lại vô cùng sang trọng: Set. bộ là sự kết hợp hoàn hảo từ phiên bản blazer dáng Croptop bên cạnh chân váy bán nguyệt. </p>\r\n<p>Áo blazer Croptop dài tay, khuy cài kim loại bên cạnh chi tiết nơ cổ nổi bật.  </p>\r\n<p>Chân váy bán nguyệt, tạo độ bồng nhẹ, đặc biệt che khuyết điểm cực tốt.  </p>\r\n<p>Elysia Set sử dụng chất liệu Tuysi cao cấp, mang đến cảm giác mặc thoải mái và thích hợp với mọi thời tiết. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(179,85,0,90,'Cropped Vest'),(180,76,0,90,'<div class=\"tab-content active showContent\">\r\n<p>Phá cách thời trang xuống phố mùa Thu này với thiết kế áo Vest dáng croptop trẻ trung và hiện đại. Đây là thiết kế bắt mắt nằm trong BST EXPRESS tham gia trình diễn tại show thời trang FALL/WINTER 2023, nơi những giá trị đích thực được đánh thức và tỏ bày thông qua các thiết kế cao cấp nhất! </p>\r\n<p>Áo tạo kiểu cổ 2 ve truyền thống, tay dài, dáng suông và có đính kèm 1 khuy cài trên thân trước. Bạn có thể sử dụng để khoác ngoài, hoặc diện kèm với 1 áo Gile mỏng bên trong. Cropped Vest  tạo nên vẻ ngoại hình thời trang, năng động và phù hợp cho nhiều dịp, từ đi làm hàng ngày đến dự tiệc hoặc các buổi đi chơi, giao lưu cùng bạn bè. </p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(181,85,0,91,'Gray Serenity Vest - Áo vest chiết eo'),(182,76,0,91,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế nằm trong BST EXPRESS tham gia trình diễn tại show thời trang FALL/WINTER 2023, nơi những giá trị đích thực được đánh thức và tỏ bày thông qua các thiết kế cao cấp nhất! </p>\r\n<p>Gray Serenity Vest mang đậm phong cách office core, tôn vinh vẻ đẹp của người phụ nữ năng động, hiện đại. Không chỉ \"phá vỡ\" những chi tiết cơ bản, tạo sự mới mẻ và thú vị, các thiết kế còn dung hòa nét trang nhã với nhu cầu mặc tiện dụng của phái đẹp.</p>\r\n<p>Dáng vest thường thiết kế cổ kiểu, tạo nên vẻ đẹp thời thượng và sang trọng. Tạo điểm nhấn xếp li ôm nhẹ phần eo giúp nổi bật dáng vóc người mặc, mang đến sự gợi cảm và thon gọn. Đây chính là một thiết kế tinh tế, phù hợp cho nhiều dịp khác nhau. </p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(183,85,0,92,'Set bộ dạ kẻ viền'),(184,76,0,92,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế set bộ mang vẻ đẹp nhẹ nhàng, thanh lịch mà vẫn có chút điệu đà, mới lạ.</p>\r\n<p>Áo khoác cổ tròn, tay dài, giấu khuy. Áo độ dài thường, có thể mặc trơn hoặc sử dụng khoác ngoài. Chân váy chữ A dáng ngắn, hơi ôm nhẹ, thiết kế cơ bản nên rất dễ mix đồ. </p>\r\n<p>Bản phối sở hữu chất liệu Buckram cao cấp, được chọn là phiên bản tiền thân 4 mùa của chất liệu Tweed. Thiết kế vẫn giữ trọn vẹn đặc tính sang trọng, thời thượng của dòng Tweed và được biến tấu phù hợp thời tiết 4 mùa. </p>\r\n<p>Toàn bộ bản phối được tạo viền kẻ khác màu, không quá cầu kì nhưng vẫn toát lên vẻ đẹp sang trọng. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(185,85,0,93,'Orange Tweed - Áo dạ suông dáng ngắn'),(186,76,0,93,'<div class=\"tab-content active showContent\">\r\n<p>Gam màu cam xâm chiếm lãnh địa thời trang Thu/Đông 2023. Là sự kết hợp giữa sắc đỏ mạnh mẽ, nồng nhiệt với gam màu vàng hạnh phúc, tươi mới, sắc cam xu hướng trở thành biểu tượng mang đến sự ấm áp và thổi nguồn năng lượng tích cực để những quý cô IVY moda tự tin theo đuổi mục tiêu.</p>\r\n<p>Orange Tweed nằm trong BST EXPRESS tham gia trình diễn tại show thời trang FALL/WINTER 2023, nơi những giá trị đích thực được đánh thức và tỏ bày thông qua các thiết kế cao cấp nhất! </p>\r\n<p>Áo được làm từ chất liệu tweed có họa tiết sọc, tạo nên sự độc đáo và phong cách riêng biệt. Thiết kế cổ đức không chân, mang phong cách cổ điển, thanh lịch, tăng cảm giác ấm áp trong thời tiết lạnh. Orange Tweed được chăm chút tỉ mỉ với những đường may chắc chắn giúp bền bỉ và thể hiện tính thẩm mỹ cho thiết kế.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(187,85,0,94,'Silver Mist Blazer'),(188,76,0,94,'<div class=\"tab-content active showContent\">\r\n<p>Khẳng định vẻ đẹp thời trang xu hướng qua ấn phẩm Silver Mist Blazer trong BST EXPRESS, tham gia trình diễn tại show thời trang FALL/WINTER 2023, nơi những giá trị đích thực được đánh thức và tỏ bày thông qua các thiết kế cao cấp nhất!</p>\r\n<p>Thiết kế áo blazer được kế thừa vẻ đẹp của form dáng áo vest cổ điển: dáng suông, có túi kiểu. Chất liệu tuysi mềm nhẹ, thoáng mát, ít nhăn và giữ form dáng tốt. Tất cả đã tạo nên cấu trúc thanh lịch, sang trọng mà vẫn đảm bảo tính thoải mái.</p>\r\n<p>Không chỉ đẹp từ thiết kế đến chất liệu, set đồ còn mang tính ứng dụng cao, phù hợp cho các cô nàng diện nơi công sở và đi dự sự kiện. </p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(189,85,0,95,'Single Breasted'),(190,76,0,95,'<div class=\"tab-content active showContent\">\r\n<p>Set bộ vest với áo vest 2 khuy chiết eo kết hợp quần suông dáng lửng thể hiện sự thời trang, sành điệu của người phụ nữ, phù hợp cho nhiều dịp khác nhau như công sở, dự tiệc, hay các sự kiện quan trọng.</p>\r\n<p>Áo vest 2 khuy chiết eo tạo nét thanh lịch và chuyên nghiệp. Đảm bảo áo vest vừa vặn, tôn lên vóc dáng người mặc. </p>\r\n<p>Quần suông dáng lửng thoải mái, mang lại sự năng động lại phù hợp với áo vest.</p>\r\n<p>Nàng có thể mix bộ vest với giày cao gót hoặc giày oxford để tăng thêm vẻ lịch lãm. Bổ sung thêm phụ kiện như dây chuyền, đồng hồ, và túi xách phù hợp để hoàn thiện ensemble cho mình. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(191,85,0,96,'Lealia Blazer - Áo blazer nhung trơn'),(192,76,0,96,'<div class=\"tab-content active showContent\">\r\n<p>Gửi đến những \"Lời bày tỏ từ giá trị đích thực\" trong Fall/winter 2023, Lealia Blazer cùng Quý cô IVY moda sải bước tự tin trên đường phố Paris, mang theo hy vọng tích cực và vững vàng tiến về phía trước.</p>\r\n<p>Mẫu áo khoác thời thượng được trẻ hóa từ kiểu dáng suông với chi tiết cổ tròn cùng tay dài. Lấy thiết kế blazer chủ đạo trên nền vải nhung mềm, mịn, giữ ấm tốt, áo chính là sự lựa chọn được ưu tiên trong mùa Thu Đông năm nay. Áo thành công tái hiện sự đối lập qua các đường viền cổ, tay áo kết hợp hàng khuy bọc sang trọng phía trước. Thiết kế đã sẵn sàng thể hiện vẻ đẹp của sự đẳng cấp cho người mặc.</p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(193,85,0,97,'Louisa Set - Áo khoác croptop kèm chân váy A'),(194,76,0,97,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế set bộ trẻ trung, năng động với áo blazer croptop cá tính bên cạnh dáng chân váy A basic, thời thượng.</p>\r\n<p>Biến tấu thiết kế blazer sang phiên bản cổ đức kín đáo, thân trước có hai vạt xếp lên nhau được cố định bằng khuy kim loại. Chân váy A độ dài trên gối, có phối đai nhỏ tạo điểm nhấn, hoàn hảo hack dáng cũng như che khuyết điểm cực tốt. </p>\r\n<p>Louisa Set vừa có thể diện set bộ đi làm, đi họp hay đến những nơi vui chơi, gặp mặt bạn bè. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(195,85,0,98,'Sheath Set - Áo khoác lửng cùng đầm xòe'),(196,76,0,98,'<div class=\"tab-content active showContent\">\r\n<p>Một set sang trọng và hiện đại với áo khoác dáng lửng và đầm xòe để tạo ngoại hình rất ấn tượng đi làm, đi chơi hay những dịp quan trọng. </p>\r\n<p>Áo khoác tay dài, thiết kế cổ 2 ve thời thượng, được điểm thêm các khuy cài ấn tượng. Đầm độ dài qua gối, cổ V quyến rũ, ôm lấy cơ thể. Thân dưới đầm tạo ly xòe nhẹ, che khuyết điểm tốt, tăng sự bồng bềnh. </p>\r\n<p>Có thể kết hợp set với giày cao gót hoặc giày bệt, tùy thuộc vào phong cách cá nhân. Để thêm phần nổi bật, bạn nên chọn một chiếc túi xách phù hợp với set trang phục. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(197,85,0,99,'Ellie Outfit - Bản phối mùa Thu'),(198,76,0,99,'<div class=\"tab-content active showContent\">\r\n<p>Thời tiết sang Thu se lạnh rất thích hợp để nàng diện những thiết kế theo set bộ, vừa sang trọng, thanh lịch vừa tinh tế, nhẹ nhàng. Nằm trong BST REFINED - NEW COLLECTION FW2023, Ellie Outfit mang sự khởi đầu mới mẻ, hương vị Thu mới, sẵn sàng cùng nàng tự tin tỏa sáng. </p>\r\n<p>Bản phối được kết hợp giữa áo blazer ngắn, tay dài bên cạnh dáng chân váy A xếp ly bay bổng. Các chi tiết thiết kế gọn gàng, đảm bảo che khuyết điểm tốt mà còn nâng niu dáng vóc người mặc. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(199,85,0,100,'Eser Dress - Set đầm dạo phố'),(200,76,0,100,'<div class=\"tab-content active showContent\">\r\n<p>Phô diễn thần thái kiêu sa, thời thượng qua ấn phẩm Eser Dress trong BST EXPRESS, tham gia trình diễn tại show thời trang FALL/WINTER 2023, nơi những giá trị đích thực được đánh thức và tỏ bày thông qua các thiết kế cao cấp nhất!</p>\r\n<p>Outfit gồm áo khoác kiểu blazer croptop hiện đại cùng đầm hai dây bán nguyệt quyến rũ. Set bộ thiết kế dài tay, độ dài ngang gối rất thích hợp với tiết trời sang Thu. Bên cạnh đó, khi lựa chọn dáng váy xòe xếp ly bồng bềnh tăng sự mềm mại và uyển chuyển cho thiết kế. </p>\r\n<p>Bản phối được làm trên nền chất liệu Twill cao cấp, giữ form tốt, mang đến cảm giác thoải mái khi mặc. </p>\r\n<p>Để thêm phần nổi bật, Eser Dress đã được nhấn nhá thêm chi tiết hoa ngực, nàng chỉ cần lựa chọn phụ kiện đi kèm phù hợp là đã  có ngay một bản phối để  bắt đầu ngày mới. </p>\r\n<p>Thông tin mẫu:</p>\r\n<p>Chiều cao: 167 cm</p>\r\n<p>Cân nặng: 50 kg</p>\r\n<p>Số đo 3 vòng: 83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(201,85,0,101,'Áo vest cách điệu tay bồng'),(202,76,0,101,'<div class=\"tab-content active showContent\">\r\n<p>Sản phẩm áo vest cách điệu tay bồng của Ivy Moda là một sự kết hợp tuyệt vời giữa phong cách công sở và sự sang trọng hiện đại. Với kiểu dáng croptop tay ngắn, sản phẩm tôn lên vẻ ngoài tươi trẻ và cá tính của người mặc.</p>\r\n<p>Chất liệu tuytsi cao cấp được sử dụng cho mang lại sự mềm mại, thoải mái và độ bền cao. Thiết kế cách điệu tay bồng tạo nên sự nhẹ nhàng, bay bổng cho người mặc, giúp bạn tự tin hơn khi diện sản phẩm này.</p>\r\n<p>Áo vest cách điệu tay bồng có thể dễ dàng kết hợp với nhiều trang phục khác nhau, từ chân váy đến quần jean, giúp bạn tạo ra nhiều phong cách thời trang khác nhau. Với sự kết hợp độc đáo giữa phong cách cổ điển và hiện đại, sản phẩm này sẽ là một lựa chọn hoàn hảo cho các buổi gặp gỡ bạn bè, tiệc tùng hoặc những ngày làm việc tại văn phòng.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(203,85,0,102,'Set đầm tweed và áo khoác croptop'),(204,76,0,102,'<div class=\"tab-content active showContent\">\r\n<p>Set đồ gồm áo khoác croptop và đầm 2 dây. Áo khoác tweed dáng ngắn cổ tròn, gấu áo cắt vòm tăng thêm tính mềm mại cho set đồ. Điểm nhấn là chi tiết đan dây vặn thừng. Vải tweed dày dặn bên trong lót lớp vải lụa. Đầm 2 dây bản to dáng suông, độ dài trên đầu gối, kiểu dáng chữ A giúp che khuyết điểm phần thân dưới và tôn dáng nàng.</p>\r\n<p>Việc sử dụng chất liệu cao cấp nhất thị trường như Tweed đã đem lại sự sang trọng cho cả set đồ. Chất liệu có độ gồ ghề nhẹ đặc trưng, bên trong có lớp lót lụa mềm mại. Tính cao cấp của chất liệu Tweed đem lại là sự mềm nhẹ, khả năng chống nước, chống lạnh tốt. </p>\r\n<p>Lấy cảm hứng từ bộ suit cổ điển, các nhà mốt IVY đã \"trẻ hóa\" bộ suit, giúp các cô nàng diện lên trông thật thanh lịch, sang trọng mà vẫn giữ  được nét trẻ trung, duyên dáng. Set đồ với các items basic giúp nàng dễ dàng tách lẻ set để đa dạng hóa các bộ trang phục trong tuần theo nhiều phong cách khác nhau.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(205,85,0,103,'Tweed Biker Jacket'),(206,76,0,103,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế áo khoác lấy cảm hứng từ chiếc áo Biker thời thượng, cá tính kết hợp cùng chất liệu tweed mang lại nét trẻ trung, không kém phần nữ tính \"tiểu thư\". Vải tweed cao cấp giữ ấm tốt cùng gam màu trung tính giúp nàng dễ dàng phối cùng nhiều kiểu quần, dáng đầm khác nhau. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(207,85,0,104,'Jolie Tweed Set'),(208,76,0,104,'<div class=\"tab-content active showContent\">\r\n<p>Set đồ gồm áo khoác dáng suông và chân váy chữ A. Thiết kế áo khoác cổ điển với chi tiết cổ tròn phối viền trắng, ngực trái phối nơ tạo điểm nhấn. Chân váy chữ A độ dài trên đầu gối giúp khoe dáng nàng.</p>\r\n<p>Đặc biệt, chất vải được sử dụng là các sợi tuysi nhiều màu sắc, cùng công nghệ dệt may độc đáo đã tạo nên chất liệu vải mang vẻ sang trọng của Tweed nhưng lại mềm mát như Tuysi. Bởi vậy nàng có thể diện set đồ nhiều mùa trong năm hơn.</p>\r\n<p>Không chỉ đẹp từ thiết kế đến chất liệu, set đồ còn mang tính ứng dụng cao, phù hợp cho các cô nàng diện nơi công sở và đi dự sự kiện. Áo khoác và chân váy dễ dàng tách lẻ set giúp nàng thỏa sức mix&amp;match với nhiều items khách nhau. Vào những ngày \"không biết mặc gì\", nàng chỉ cần diện nguyên set là đã đủ thu hút mọi ánh nhìn.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(209,85,0,105,'Áo khoác tweed phối viền tua rua'),(210,76,0,105,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác mang hơi hướng cổ điển được cách điệu qua chi tiết phối viền tua rua. Thiết kế áo dài tay, độ dài ngang hông, cầu vai may đứng phom phối cùng viền may tua rua mang lại vẻ trẻ trung cho người mặc. </p>\r\n<p>Việc sử dụng chất liệu cao cấp nhất thị trường như Tweed đã đem lại sự sang trọng chiếc áo. Chất liệu Tweed được sử dụng là loại vải dày dặn được dệt từ những sợi len nhiều màu có cấu trúc vặn xoắn. Bề mặt vải Tweed có độ gồ ghề nhẹ đặc trưng, bên trong có lớp lót lụa mềm mại. Tính cao cấp của chất liệu Tweed đem lại là sự mềm nhẹ, khả năng chống nước, chống lạnh tốt. </p>\r\n<p>Không chỉ đẹp từ thiết kế đến chất liệu, chiếc áo còn mang tính ứng dụng cao, phù hợp cho các cô nàng diện nơi công sở và đi dự sự kiện. Áo khoác dễ dàng mix&amp;match với nhiều items khách nhau, phù hợp vs mọi phong cách nàng theo đuổi.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 169 cm</p>\r\n<p><strong>Cân nặng:</strong> 48 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>80-60-90 cm</p>\r\n<p>Mẫu mặc size S</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(211,85,0,106,'Cropped Tweed Set'),(212,76,0,106,'<div class=\"tab-content active showContent\">\r\n<p>Set đồ gồm áo khoác croptop và chân váy mini. Áo khoác tweed dáng ngắn cổ tròn, tay dài. Viền dây vặn thừng khác màu tạo điểm nhấn. Có phụ kiện hoa đính bên ngực. Vải tweed dày dặn bên trong lót lớp vải lụa. Chân váy mini ngắn giúp nàng khéo léo khoe đôi chân mình, đặc biệt \"ăn gian\" chiều cao khi để lộ nhiều phần chân.</p>\r\n<p>Việc sử dụng chất liệu cao cấp nhất thị trường như Tweed đã đem lại sự sang trọng cho cả set đồ. Chất liệu Tweed được sử dụng là loại vải dày dặn được dệt từ những sợi len nhiều màu có cấu trúc vặn xoắn. Bề mặt vải Tweed có độ gồ ghề nhẹ đặc trưng, bên trong có lớp lót lụa mềm mại. Tính cao cấp của chất liệu Tweed đem lại là sự mềm nhẹ, khả năng chống nước, chống lạnh tốt. </p>\r\n<p>Lấy cảm hứng từ bộ suit cổ điển, các nhà mốt IVY đã \"trẻ hóa\" bộ suit, giúp các cô nàng diện lên trông thật thanh lịch, sang trọng mà vẫn giữ  được nét trẻ trung, đáng yêu.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(213,85,0,107,'Set tweed đính hoa nổi'),(214,76,0,107,'<div class=\"tab-content active showContent\">\r\n<p>Set đồ gồm áo khoác croptop, áo 2 dây và chân váy chữ A. Áo khoác tweed dáng ngắn cổ tròn, tay dài, gấu may bo tròn. Điểm nhấn là chi tiết đính hoa nổi thủ công tinh tế, sang trọng. Áo 2 dây croptop mặc bên trong kín đáo nhưng vẫn rất tôn dáng. Chân váy chữ A ngắn giúp nàng khéo léo khoe đôi chân mình.</p>\r\n<p>Việc sử dụng chất liệu cao cấp nhất thị trường như Tweed đã đem lại sự sang trọng cho cả set đồ. Chất liệu Tweed được sử dụng là loại vải dày dặn được dệt từ những sợi len nhiều màu có cấu trúc vặn xoắn. Bề mặt vải Tweed có độ gồ ghề nhẹ đặc trưng, bên trong có lớp lót lụa mềm mại. Tính cao cấp của chất liệu Tweed đem lại là sự mềm nhẹ, khả năng chống nước, chống lạnh tốt. </p>\r\n<p>Lấy cảm hứng từ bộ suit cổ điển, các nhà mốt IVY đã \"trẻ hóa\" bộ suit, giúp các cô nàng diện lên trông thật thanh lịch, sang trọng mà vẫn giữ được nét trẻ trung.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(215,85,0,108,'Áo bomber thêu chữ'),(216,76,0,108,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác với thiết kế cổ tròn, tay dài chất vải dập nổi cùng chun nhúm. Có đai co giãn ở cổ tay, cổ áo và chân áo cùng màu. Điểm nhấn sau lưng thêu chữ \"Youth\".</p>\r\n<p>Kiểu cách basic với tính ứng dụng cao. Chất liệu khaki giúp giữ ấm và thời trang.</p>\r\n<p>Dễ dàng kết hợp cùng áo thun bên trong và chân váy zuýp mang đến set đồ trẻ trung, cá tính phù hợp với đi làm, đi chơi....</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 169 cm</p>\r\n<p><strong>Cân nặng:</strong> 48 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>80-60-90 cm</p>\r\n<p>Mẫu mặc size S</p>\r\n</div>'),(217,85,0,109,'Áo Tweed Jacket phối viền'),(218,76,0,109,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế áo khoác cổ điển với các chi tiết cổ tròn, độn vai, tạo kiểu viền lụa bắt mắt cùng khóa kéo kim loại cao cấp. Áo khoác dáng ngắn ngang hông, độ ôm vừa vặn giúp tôn lên vóc dáng nàng. Áo khoác mix cùng đầm đuôi cá MS 41B9134.</p>\r\n<p>Chất liệu tweed cao cấp và mềm mại, bên trong áo và chân váy đều có lớp lụa lót cùng màu. </p>\r\n<p>Một thiết kế thanh lịch dành cho các cô nàng diện đi tiệc, đi chơi hay đi làm. Khoác ngoài chiếc đầm đồng bộ giúp nàng bớt đi cái se lạnh vào mùa thu mà trông cực chảnh nữa đó.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(219,85,0,110,'Premium Trench Coat With Belt'),(220,76,0,110,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác dạ cổ 2 ve khoét chữ K. Tay dài. Túi vuông tạo kiểu phía trước. Có vạt đắp chéo kèm dây đai da bản to thời thượng.. Dáng áo dài ngang bắp chân.</p>\r\n<p>Kiểu dáng sang trọng, màu tinh tế. Dễ phối giày và phụ kiện cùng thời trang mặc phía trong. Với chất liệu áo làm bằng Lông cừu cao cấp, khâu tay 100% với các mũi khâu được khâu tỉ mỉ khéo léo không làm lộ chỉ. Với đặc điểm mềm, mỏng, nhẹ và giữ ấm tuyệt đối. Áo khoác dạ ép lông cừu đã trở thành item không thể thiểu của phái đẹp mỗi khi đông về. Nắm bắt kịp xu hướng cũng như nhu cầu này, IVY moda đã cho ra đời BST áo khoác dạ ép lông cừu khâu tay cao cấp đạt chuẩn với nhiều kiểu dáng, màu sắc cho phái đẹp lựa chọn.</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(221,85,0,111,'Wool Trench Coat - Áo măng tô dạ lông cừu khâu tay'),(222,76,0,111,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác thiết kế cổ chữ K bản to, dáng dài cùng màu sắc sang trọng, kiểu dáng vô cùng đẳng cấp. Với chất liệu áo làm bằng Lông cừu cao cấp, khâu tay 100% với các mũi khâu được khâu tỉ mỉ khéo léo không làm lộ chỉ. Với đặc điểm mềm, mỏng, nhẹ và giữ ấm tuyệt đối. Nắm bắt kịp xu hướng cũng như nhu cầu này, IVY moda đã cho ra đời BST áo khoác dạ ép lông cừu cao cấp đạt chuẩn với nhiều kiểu dáng, màu sắc cho phái đẹp lựa chọn.</p>\r\n<p>Lấy cảm hứng từ trang phục của quân đội châu Âu, những chiếc áo trench coat từ lâu đã khẳng định sự “thống trị” trong tủ đồ thời trang thu – đông. Thời thượng, thanh lịch nhưng không kém phần cá tính, áo trench coat dễ dàng làm xiêu lòng cả những quý cô khó tính nhất.</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(223,85,0,112,'Merino Wool - Áo khoác dạ lông cừu'),(224,76,0,112,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác cổ đức, dáng suông độ dài ngang hông. Điểm nhấn là túi vuông 1 bên thêu logo IVY moda. Cài bằng hàng khuy phía trước. </p>\r\n<p>Với chất liệu áo làm bằng Lông cừu cao cấp, trải qua những bước thực hiện tỉ mỉ và trau chuốt trong từng chi tiết, mỗi thiết kế đều được kiểm định chất lượng nghiêm ngặt với công đoạn xử lý thủ công hàng trăm giờ đồng hồ. Các mũi khâu tinh tế, phom dáng chuẩn từng centimet mang đến đẳng cấp khác biệt - sản phẩm thủ công nhưng vô cùng hiện đại.</p>\r\n<p>Kiểu áo này không chỉ ấm áp mà còn khiến bạn dễ phối đồ với rất nhiều kiểu đồ và phụ kiện khác nhau từ quần jean, legging tới giày cao gót hay bốt cao cổ, khăn quàng cổ,…</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(225,85,0,113,'Premium Wool Vest'),(226,76,0,113,'<div class=\"tab-content active showContent\">\r\n<p>Áo vest dạ cổ 2 ve, tay dài. 2 nắp túi giả tạo kiểu 2 bên, 1 khuy phía trước mix cùng phụ kiện dây xích kim loại trẻ trung, cá tính. Thông qua những đường nét tinh xảo như cầu vai sắc nét và phom dáng chuẩn từng centimet đã mang đến sự khác biệt, đẳng cấp cho thiết kế cũng như người mặc.</p>\r\n<p>Đặc biệt chất liệu áo làm bằng Lông cừu ép cao cấp, khâu tay 100% với các mũi khâu được khâu tỉ mỉ khéo léo không làm lộ chỉ. Với đặc điểm mềm, mỏng, nhẹ và giữ ấm tuyệt đối. Áo khoác dạ ép lông cừu đã trở thành item không thể thiểu của phái đẹp mỗi khi đông về. Nắm bắt kịp xu hướng cũng như nhu cầu này, IVY moda đã cho ra đời BST áo khoác dạ ép lông cừu khâu tay cao cấp đạt chuẩn với nhiều kiểu dáng, màu sắc cho phái đẹp lựa chọn.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n</div>'),(227,85,0,114,'Long Premium Wool Coat With Belt'),(228,76,0,114,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác dạ cổ 2 ve lật khoét chữ K, tay dài. 2 túi vuông có nắp 2 bên. 1 khuy phía trước, áo kèm đai tháo rời giúp nàng dễ dàng tạo kiểu. Thông qua những đường nét tinh xảo như cầu vai sắc nét, hàng khuy và phom dáng chuẩn từng centimet đã mang đến sự khác biệt, đẳng cấp cho thiết kế cũng như người mặc.</p>\r\n<p>Với chất liệu áo làm bằng Lông cừu cao cấp, khâu tay 100% với các mũi khâu được khâu tỉ mỉ khéo léo không làm lộ chỉ. Với đặc điểm mềm, mỏng, nhẹ và giữ ấm tuyệt đối. Áo khoác dạ ép lông cừu đã trở thành item không thể thiểu của phái đẹp mỗi khi đông về. Nắm bắt kịp xu hướng cũng như nhu cầu này, IVY moda đã cho ra đời BST áo khoác dạ ép lông cừu khâu tay cao cấp đạt chuẩn với nhiều kiểu dáng, màu sắc cho phái đẹp lựa chọn.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n</div>'),(229,85,0,115,'Áo khoác dạ dáng dài'),(230,76,0,115,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác dạ cổ 2 ve dài khoét chữ K. Tay áo dài đính 3 khuy trang trí. Có hàng khuy đôi 2 bên tà. 2 túi chéo phía trước.</p>\r\n<p>Với chất liệu dạ ấm áp cùng kiểu dáng tinh tế sẽ giúp nàng luôn thoải mái và xinh đẹp trong ngày Đông. Kiểu áo này không chỉ ấm áp mà còn khiến bạn dễ phối đồ với rất nhiều kiểu đồ và phụ kiện khác nhau từ quần jean, legging tới giày cao gót hay bốt cao cổ, khăn quàng cổ,…</p>\r\n<p>Màu sắc: Xanh Tím Than - Xanh Oliu - Ghi Khói</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m66</li>\r\n<li><em><strong>Cân nặng:</strong></em> 48kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-61-88 cm</li>\r\n</ul>\r\n</div>'),(231,85,0,116,'Áo dạ dáng ngắn'),(232,76,0,116,'<div class=\"tab-content active showContent\">\r\n<p>Áo vest dạ cổ đức không chân, dáng dài ngang hông. Tay áo dài. 2 túi vuông có nắp phía trước. Cài bằng hàng khuy phía trước. Mix cùng chân váy chữ A đồng bộ.</p>\r\n<p>Dáng áo ngắn tạo cảm giác trẻ trung khi mặc. Chất liệu dạ xù, bên trong lót vải lụa mềm mịn tạo cảm giác thoải mái khi mặc.</p>\r\n<p>Màu sắc: Xanh Tím Than - Cam Đào - Đỏ Mận</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m70</li>\r\n<li><em><strong>Cân nặng:</strong></em> 47kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-60-90</li>\r\n</ul>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(233,85,0,117,'Áo khoác dạ kẻ'),(234,76,0,117,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác dạ kẻ cổ đức không chân. Tay dài gấu có 1 khuy cài. 2 túi vuông có nắp 2 bên. Có 6 khuy (3 khuy cài) phía trước. Chiều dài ngang hông.</p>\r\n<p>Áo dạ dày dặn bên trong lót vải lụa. Những chiếc <strong>áo khoác dạ dáng ngắn</strong> này sẽ giúp người mặc trở nên trẻ trung và làm sáng bừng thời tiết u ám của mùa đông. </p>\r\n<p>Màu sắc: Kẻ Nâu Cà Phê - Kẻ Xanh Lá - Kẻ Nude</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m66</li>\r\n<li><em><strong>Cân nặng:</strong></em> 48kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-61-88</li>\r\n</ul>\r\n</div>'),(235,85,0,118,'Áo khoác dáng dài'),(236,76,0,118,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác dáng dài. Cổ 2 ve khoét chữ K. Vai đệm. Tay áo dài. Dáng xuông, dài ngang bắp cá chân. 2 túi có nắp 2 bên. Cài bằng hàng khuy đôi phía trước.</p>\r\n<p>Là 1 item không thể thiếu trong tủ đồ, dễ kết hợp với các trang phục, phụ kiện khác. Đường may tỉ mỉ, tinh tế giúp bạn yên tâm về chất lượng sản phẩm.</p>\r\n<p>Màu sắc: Đen - Nâu cà phê</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m70</li>\r\n<li><em><strong>Cân nặng:</strong></em> 47kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-60-90</li>\r\n</ul>\r\n</div>'),(237,85,0,119,'Beige Handmade Wool'),(238,76,0,119,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác dạ cổ 2 ve lật khoét chữ K, tay dài. 2 túi vuông có nắp 2 bên. 4 khuy phía trước. Thông qua những đường nét tinh xảo như cầu vai sắc nét, hàng khuy và phom dáng chuẩn từng centimet đã mang đến sự khác biệt, đẳng cấp cho thiết kế cũng như người mặc.</p>\r\n<p>Với chất liệu áo làm bằng Lông cừu cao cấp, khâu tay 100% với các mũi khâu được khâu tỉ mỉ khéo léo không làm lộ chỉ. Với đặc điểm mềm, mỏng, nhẹ và giữ ấm tuyệt đối. Áo khoác dạ ép lông cừu đã trở thành item không thể thiểu của phái đẹp mỗi khi đông về. Nắm bắt kịp xu hướng cũng như nhu cầu này, IVY moda đã cho ra đời BST áo khoác dạ ép lông cừu khâu tay cao cấp đạt chuẩn với nhiều kiểu dáng, màu sắc cho phái đẹp lựa chọn.</p>\r\n</div>'),(239,85,0,120,'Camel coat - Dạ lông cừu (handmade)'),(240,76,0,120,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác dạ cổ 2 ve dài khoét chữ K - chần chỉ nổi viền. Tay áo dài có hàng 4 khuy trang trí. Eo có đai rời cùng màu. 2 túi chéo 2 bên. Kiểu áo này không chỉ ấm áp mà còn khiến bạn dễ phối đồ với rất nhiều kiểu đồ và phụ kiện khác nhau từ quần jean, legging tới giày cao gót hay bốt cao cổ, khăn quàng cổ,…</p>\r\n<p>Với chất liệu áo làm bằng Lông cừu cao cấp, khâu tay 100% với các mũi khâu được khâu tỉ mỉ khéo léo không làm lộ chỉ. Với đặc điểm mềm, mỏng, nhẹ và giữ ấm tuyệt đối. Áo khoác dạ ép lông cừu đã trở thành item không thể thiểu của phái đẹp mỗi khi đông về. Nắm bắt kịp xu hướng cũng như nhu cầu này, IVY moda đã cho ra đời BST áo khoác dạ ép lông cừu khâu tay cao cấp đạt chuẩn với nhiều kiểu dáng, màu sắc cho phái đẹp lựa chọn.</p>\r\n<p>Màu sắc: Nude - Xanh lơ</p>\r\n<p><strong>Mẫu mặc size M:</strong></p>\r\n<p>Chiều cao: 1m74<br />Cân nặng: 49kg<br />Số đo 3 vòng: 80-57-88</p>\r\n</div>'),(241,85,0,121,'Royal Blue Coat - Dạ lông cừu (handmade)'),(242,76,0,121,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác dạ cổ 2 ve dài khoét chữ K - chần chỉ nổi viền. Tay áo dài có hàng 4 khuy trang trí. Eo có đai rời cùng màu. 2 túi chéo 2 bên. Kiểu áo này không chỉ ấm áp mà còn khiến bạn dễ phối đồ với rất nhiều kiểu đồ và phụ kiện khác nhau từ quần jean, legging tới giày cao gót hay bốt cao cổ, khăn quàng cổ,…</p>\r\n<p>Với chất liệu áo làm bằng Lông cừu cao cấp, khâu tay 100% với các mũi khâu được khâu tỉ mỉ khéo léo không làm lộ chỉ. Với đặc điểm mềm, mỏng, nhẹ và giữ ấm tuyệt đối. Áo khoác dạ ép lông cừu đã trở thành item không thể thiểu của phái đẹp mỗi khi đông về. Nắm bắt kịp xu hướng cũng như nhu cầu này, IVY moda đã cho ra đời BST áo khoác dạ ép lông cừu khâu tay cao cấp đạt chuẩn với nhiều kiểu dáng, màu sắc cho phái đẹp lựa chọn.</p>\r\n<p>Màu sắc: Nude - Xanh lơ</p>\r\n<p><strong>Mẫu mặc size M:</strong></p>\r\n<p>Chiều cao: 1m74<br />Cân nặng: 49kg<br />Số đo 3 vòng: 80-57-88</p>\r\n</div>'),(243,85,0,122,'Áo phao cổ mũ'),(244,76,0,122,'<p>Áo khoác dáng suông, dộ dài ngang hông, cổ cao, 2 túi phía trước có khóa kéo, áo có mũ đội đầu may liền.</p>\r\n<p>Chất liệu Polyester kết hợp cùng kiểu may chần bông siêu nhẹ có tác dụng giữa ấm tốt mà vẫn gọn nhẹ, thoải mái. Áo phao ấm áp thích hợp với thời tiết mùa đông lạnh, mix cùng áo len cổ lọ và quần jeans là nàng đã có 1 set đồ ấm áp, thời thượng.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>'),(245,85,0,123,'Áo khoác chần bông quả trám'),(246,76,0,123,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác dáng suông, cổ đức, 2 túi chéo 2 bên phối nắp phía trước tiện lợi, điểm nhấn là chi tiết chần bông quả trám thời thượng. Cài bằng hàng khuy bấm.</p>\r\n<p>Chất liệu Polyester kết hợp cùng kiểu may chần bông siêu nhẹ có tác dụng giữa ấm tốt mà vẫn gọn nhẹ, thoải mái. Áo phao mỏng nhẹ thích hợp với thời tiết giao mùa se lạnh này, mix cùng áo len cổ lọ và quần jeans là nàng đã có 1 set đồ ấm áp, thời thượng.</p>\r\n<p>Với thiết kế trẻ trung \"on trend\", đây chính là món đồ mà các cô gái nên sở hữu bởi tính ứng dụng cao và bền bỉ.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(247,85,0,124,'Buttoned Quilted Vest - Áo gile chần bông'),(248,76,0,124,'<div class=\"tab-content active showContent\">\r\n<p><strong>* Sản phẩm chỉ GIẶT KHÔ, tuyệt đối không giặt nước!</strong></p>\r\n<p><strong>* Phom áo rộng, bạn có thể chọn lùi 1 size để mặc vừa vặn hơn</strong></p>\r\n<p>Áo gile dáng suông, cổ tròn, 2 túi vuông phía trước, điểm nhấn là chi tiết may bo viền cổ, gấu tay và gấu áo. Cài bằng hàng khuy bấm.</p>\r\n<p>Chất liệu Polyester kết hợp cùng kiểu may chần bông siêu nhẹ có tác dụng giữa ấm tốt mà vẫn gọn nhẹ, thoải mái. Áo phao mỏng nhẹ mix cùng áo phông và jeans là nàng đã có 1 outfit trẻ trung, năng động và siêu thích hợp với thời tiết giao mùa ẩm ương này.</p>\r\n<p>Với thiết kế trẻ trung \"on trend\" cùng màu sắc pastel xinh xắn, đây chính là món đồ mà các cô gái nên sở hữu bởi tính ứng dụng cao và bền bỉ.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(249,85,0,125,'Áo phao kèm Đai phom rộng'),(250,76,0,125,'<div class=\"tab-content active showContent\">\r\n<p><strong>* Lưu ý: </strong>Sản phẩm này có phom dáng to hơn các SP thông thường. Để diện vừa vặn hơn bạn lưu ý<strong> CHỌN LÙI SIZE </strong>so với size thông thường bạn hay mặc nhé!</p>\r\n<p>Áo khoác phao cổ mũ viền lông có khóa kéo tháo rời. Áo dáng dài, suông có đai thắt eo giúp dáng nàng trông gọn gàng hơn. 2 túi chéo 2 bên có khóa kéo. Cài phía trước bằng khóa kéo.</p>\r\n<p>Áo phao dáng dài là sản phẩm \"must-have\" cho mùa Đông này. Chất liệu vải gió chần bông siêu nhẹ cùng phom dáng chuẩn và đường may tỉ mỉ chắc chắc sẽ mang lại một diện mạo trẻ trung, thanh lịch mà vô cùng ấm áp dành cho nàng.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(251,85,0,126,'Áo phao chần bông viền vặn thừng'),(252,76,0,126,'<div class=\"tab-content active showContent\">\r\n<p><strong>* Sản phẩm chỉ GIẶT KHÔ, tuyệt đối không giặt nước!</strong></p>\r\n<p>Áo khoác dáng suông, cổ tròn, 2 túi vuông phía trước, điểm nhấn là chi tiết vặn thừng ở viền cổ và dọc khóa kéo. </p>\r\n<p>Chất liệu Polyester kết hợp cùng kiểu may chần bông siêu nhẹ có tác dụng giữa ấm tốt mà vẫn gọn nhẹ, thoải mái. Áo phao mỏng nhẹ thích hợp với thời tiết giao mùa se lạnh này, mix cùng áo len cổ lọ và quần jeans là nàng đã có 1 set đồ ấm áp, thời thượng.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(253,85,0,127,'Áo phao cổ mũ tháo rời'),(254,76,0,127,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác dáng slim fit, dộ dài ngang hông, cổ cao, 2 túi phía trước có khóa kéo, mũ đội đầu có thể tháo rời.</p>\r\n<p>Chất liệu Polyester kết hợp cùng kiểu may chần bông siêu nhẹ có tác dụng giữa ấm tốt mà vẫn gọn nhẹ, thoải mái. Áo phao ấm áp thích hợp với thời tiết mùa đông lạnh, mix cùng áo len cổ lọ và quần jeans là nàng đã có 1 set đồ ấm áp, thời thượng.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(255,85,0,128,'Padded Quilted Jacket - Áo phao 2 mặt'),(256,76,0,128,'<div class=\"tab-content active showContent\">\r\n<p><strong>* Sản phẩm chỉ GIẶT KHÔ, tuyệt đối không giặt nước!</strong></p>\r\n<p>Áo khoác dáng suông, cổ tròn, 2 túi vuông phía trước, điểm nhấn là chi tiết may bo viền cổ, gấu tay và gấu áo. Cài bằng hàng khuy bấm, đặc biệt hơn thiết kế áo mặc được 2 mặt giúp nàng làm mới màu sắc cho trang phục thường ngày của mình.</p>\r\n<p>Chất liệu Polyester kết hợp cùng kiểu may chần bông siêu nhẹ có tác dụng giữa ấm tốt mà vẫn gọn nhẹ, thoải mái. Áo phao mỏng nhẹ thích hợp với thời tiết giao mùa se lạnh này, mix cùng áo len cổ lọ và quần jeans là nàng đã có 1 set đồ ấm áp, thời thượng.</p>\r\n<p>Với thiết kế trẻ trung \"on trend\" cùng màu sắc pastel xinh xắn, đây chính là món đồ mà các cô gái nên sở hữu bởi tính ứng dụng cao và bền bỉ.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(257,85,0,129,'Áo phao kèm đai'),(258,76,0,129,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác phao cổ mũ có dây kéo rút (mũ có thể tháo rời được), tay dài bo gấu bằng thun co giãn. Eo có đai co giãn đồng màu. 2 túi chéo 2 bên. Dáng xuông với độ dài ngang gối. Cài phía trước bằng khóa kéo.</p>\r\n<p>Dáng áo dài phù hợp cho mùa Thu - Đông. Bên trong lót bông dày dặn với phom dáng chuẩn cùng đường may tỉ mỉ. Tính năng giữ nhiệt, chống nước, độ bền cao.</p>\r\n<p>Màu sắc: Tím Lavender -  Đen - Nâu Cà Phê</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m66</li>\r\n<li><em><strong>Cân nặng:</strong></em> 48kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-61-88</li>\r\n</ul>\r\n</div>'),(259,85,0,130,'Áo phao dáng dài'),(260,76,0,130,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác cổ cao, dài tay. Có mũ trùm đầu có dây kéo điều chỉnh. Túi chéo trước có khóa kéo ẩn. Dáng xuông với độ dài ngang bắp. Cài phía trước bằng khóa kéo.</p>\r\n<p>Dáng áo dài phù hợp cho mùa Thu - Đông. Bên trong nhồi bông dày dặn với phom dáng chuẩn cùng đường may tỉ mỉ. Tính năng giữ nhiệt, chống nước, độ bền cao.</p>\r\n<p>Màu sắc: Nhiều màu</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m70</li>\r\n<li><em><strong>Cân nặng:</strong></em> 47kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-60-90</li>\r\n</ul>\r\n</div>'),(261,85,0,131,'Áo phao cổ viền lông'),(262,76,0,131,'<div class=\"tab-content active showContent\">\r\n<p>Áo phao dáng suông, dài ngang hông. Cổ mũ viền lông nhân tạo có khóa kéo tháo rời, dài tay. Có 2 túi cài khuy bấm. Cài bằng khóa kéo ẩn tà phía trước. Vải chần bông cách đều.</p>\r\n<p>Bên trong lớp bông dày dặn. Tính năng giữ nhiệt, chống nước, độ bền cao.</p>\r\n<p>Màu sắc: Nhiều màu</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m70</li>\r\n<li><em><strong>Cân nặng:</strong></em> 47kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-60-90</li>\r\n</ul>\r\n</div>'),(263,85,0,132,'Áo phao lông vũ cổ mũ'),(264,76,0,132,'<div class=\"tab-content active showContent\">\r\n<p>Áo phao lông vũ dáng suông. Cổ mũ có dây kéo điều chỉnh, dài tay. Có 2 túi kéo khóa bên hông. Cài bằng khóa kéo phía trước. Vải chần bông cách đều.</p>\r\n<p>Chất liệu được làm từ 90% lông tơ + 10% lông vũ. Từ loại lông ngỗng cao cấp có khả năng giữ ấm vượt trội. Kỹ thuật trần lông độc quyền tạo sự nhẹ nhàng tuyệt đối. Dễ dàng nén và cất gói mà không bị biến dạng. Tính năng giữ nhiệt, chống nước, độ bền cao.</p>\r\n<p>Màu sắc: Nhiều màu</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m69</li>\r\n<li><em><strong>Cân nặng:</strong></em> 48kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 80-60-90</li>\r\n</ul>\r\n</div>'),(265,85,0,133,'Áo Parka chần bông chống thấm nước'),(266,76,0,133,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác parka chần bông cổ cao. Có mũ trùm đầu phối viền lông nhân tạo. Dài tay, cổ tay bo thun co giãn bên trong. Có túi chéo khóa bằng khuy bấm. 2 túi chéo giả cài dây kéo khóa phía trên trang trí. Bên trong lót lông nhân tạo. Cài phía trước bằng khóa kéo và khuy bấm.</p>\r\n<p>Thiết kế thời trang, đơn giản không kém phần hiện đại. Màu sắc đa dạng giúp bạn dễ dàng mix cùng nhiều trang phục cho mùa Đông năm nay.</p>\r\n<p>Màu sắc: Xanh Dương Đậm - Tím Lavender - Gold - Đen</p>\r\n</div>'),(267,85,0,134,'Áo khoác len cổ đức không chân'),(268,76,0,134,'<div class=\"tab-content active showContent\">\r\n<div class=\"tab-content active showContent\">\r\n<p>Nằm trong top những item nhất định phải có trong tủ đồ thời trang mùa thu và đông, mẫu áo khoác len mới ra mắt của nhà  IVY moda đang rất được các nàng săn đón.</p>\r\n<p>Áo thiết kế dáng xuông, tay dài cùng kiểu cổ đức không chân. Họa tiết kẻ thời thượng, thích hợp mix cùng nhiều trang phục khác nhau.</p>\r\n<p>Áo sở hữu chất liệu len dệt cao cấp, mềm mại, thoải mái cũng như khả năng giữ ấm tốt. Nếu thời tiết se lạnh chỉ cần thêm một áo giữ nhiệt bên trong là đã có ngay một set đồ xuống phố.  </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>\r\n</div>'),(269,85,0,135,'Áo khoác len caro'),(270,76,0,135,'<div class=\"tab-content active showContent\">\r\n<p>Thêm vào tủ đồ Thu - Đông của nàng mẫu khoác len trẻ trung, hiện đại và phong cách. </p>\r\n<p>Thiết kế áo khoác dáng xuông, cổ  tròn cùng tay dài. Tay áo cách điệu thêm đường ly tạo độ bồng bềnh, mang đến sự nhẹ nhàng và nữ tính. </p>\r\n<p>Họa tiết kẻ caro bắt mắt, hài hòa, dễ dàng mix với nhiều kiểu trang phục khác nhau. </p>\r\n<p>Đặc biệt, thiết kế giữ ấm và tạo cảm giác thoải mái trong thời tiết lạnh. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(271,85,0,136,'Khoác cardigan len khuy kiểu'),(272,76,0,136,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác cardigan len cổ tròn, tay dài. Thiết kế áo bo viền len gân và đổi màu nổi bật. Áo khoác cài bằng khuy kim loại phía trước. </p>\r\n<p>Sang trọng và tinh tế. Thiết kế này giúp quý cô trở nên thời thượng khi mix cùng chân zuýp ôm, boot cao gót. Được may từ vải len dệt kim cao cấp tạo cảm giác mềm mại, giữ nhiệt hiệu quả.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(273,85,0,137,'Áo khoác len kẻ'),(274,76,0,137,'<div class=\"tab-content active showContent\">\r\n<p>Thêm chút hiện đại qua kiểu dáng trẻ trung sẽ tạo nên phiên bản hoàn hảo cho chiếc áo len Thu - Đông năm nay. Áo khoác dáng suông, tay dài, đan len phối hai màu tươi sáng. Bạn có thể kết hợp áo với nhiều kiểu quần và chân váy khác nhau. Nếu thời tiết lạnh chỉ cần thêm một áo khoác ngoài là đã có ngay một set đồ xuống phố.  </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(275,85,0,138,'Áo khoác len lông cừu'),(276,76,0,138,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác len cổ V dài tay. Cài bằng hàng khuy kim loại phía trước vừa tạo điểm nhấn, vừa mang lại vẻ thanh lịch.</p>\r\n<p>Chất vải len làm từ sợi len lông cừu cao cấp với những đặc tính nổi bật như mềm mại, êm ái trên da; thoáng khí, hút ẩm tốt; độ đàn hồi và độ bền cao; giúp tăng khả năng chống tĩnh điện nên rất thân thiện với người mặc.</p>\r\n<p>Áo mix cùng quần jeans, zuýp xòe là nàng đã có set đồ năng động, trẻ trung đi chơi hay đi làm rồi đó!</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(277,85,0,139,'Merino Wool croptop - Áo khoác len lông cừu dáng croptop'),(278,76,0,139,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác len là item không thể thiếu vào những ngày đông. Thiết kế áo cổ tròn, dáng croptop trẻ trung, form dáng ôm sát cơ thể giúp tôn dáng và giữ ấm hiệu quả. Điểm nhấn là hàng khuy cài ngọc trai thêm phần sang trọng.</p>\r\n<p>Chất vải len cao cấp làm từ sợi len lông cừu Merino trứ danh. Cừu Merino là một giống cừu nổi tiếng về việc cho lông cừu làm len. Đây là giống cừu có bộ lông tuyệt vời với những sợi lông cực mảnh, mềm và trắng, là nguyên liệu cho loại len mịn và tốt nhất thế giới với những đặc tính nổi bật như mềm mại, êm ái trên da; thoáng khí, hút ẩm tốt; độ đàn hồi và độ bền cao; giúp tăng khả năng chống tĩnh điện nên rất thân thiện với người mặc do đó góp phần tạo nên ưu thế của giống này. </p>\r\n<p>Với thiết kế basic cùng chất liệu cao cấp, chiếc áo len xứng đáng là item nên có cho tủ đồ đông của nàng bởi tính bền bỉ và không lỗi mốt. Áo mix cùng chân váy len MS 30M7835 đồng bộ là nàng đã có 1 outfit đi chơi hoàn hảo.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 165 cm</p>\r\n<p><strong>Cân nặng: </strong> 48 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>80-63-89 cm</p>\r\n<p>Mẫu mặc size S</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(279,85,0,140,'Áo khoác len mỏng'),(280,76,0,140,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế áo khoác len cổ V, dáng ôm, độ dài ngang hông. Vải len có đặc tính co giãn, thoát ẩm rất tốt mang lại cảm giác thoải mái, ấm áp.</p>\r\n<p>Áo khoác len mỏng là item không thể thiếu cho tủ đồ Thu Đông của các cô nàng. Đừng quên mix cùng chân váy MS 30M7801 để có 1 set đồ đẹp nhất nàng nhé!</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(281,85,0,141,'Áo khoác len cổ cao'),(282,76,0,141,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác len cổ cao dáng croptop ôm sát cơ thể. Cài bằng dây khóa phía trước. Điểm nhấn là chi tiết dệt viền sọc khác</p>\r\n<p>Chất liệu vải len dày dăn, mềm mịn, co giãn tốt. Mix cùng quần jeans, zuýp xòe đơn sắc đã tạo nên set đồ năng động, trẻ trung đi chơi rồi đấy!</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(283,85,0,142,'Áo khoác len phối viền màu'),(284,76,0,142,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế áo khoác kinh điển gồm các chi tiết: cổ tròn, dài tay phối cùng 2 túi vuông trước ngực, áo cài bằng hàng khuy kim loại. Đặc biệt là điểm nhấn viền khác màu trang trí mang lại sự thanh lịch, sang trọng cho người mặc.</p>\r\n<p>Vải len có đặc tính thoát ẩm rất tốt. Độ ẩm của làn da người sử dụng luôn được ổn định mang lại cảm giác thoải mái, ấm áp. Đừng quên mix cùng chân váy, áo len cổ cao bên trong bạn sẽ có set đồ đẹp nhất.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(285,85,0,143,'Áo sơ mi cổ 2 ve cách điệu'),(286,76,0,143,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi dáng vest. Đằng trước là cổ 2 ve, đằng sau là cổ thủy thủ. Phần eo được bo chun bản to phía sau. Chất liệu vải tuysi đứng phom, mềm mịn, ít nhăn.</p>\r\n<p>Thiết kế áo sơ mi này được lấy cảm hứng từ chiếc áo vest cổ điển với dáng đứng form. Cổ 2 ve mở rộng giúp khoe trọn đường xương quai xanh của nàng. Phía sau được phối cùng cổ thủy thủ đem đến nét trẻ trung và nữ tính. Dáng áo được bo chun phồng ở hông có tác dụng định hình tỷ lệ cơ thể người mặc. </p>\r\n<p>Với mẫu thiết kế này, nàng có thể chọn sơ vin hay thả suông đều rất đẹp, phối cùng kiều kiểu quần, chân váy khác nhau, phù hợp diện đi làm hay đi chơi.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(287,85,0,144,'Argyle Set - Set áo tweed họa tiết'),(288,76,0,144,'<div class=\"tab-content active showContent\">\r\n<p>Set áo khoác và áo 3 lỗ croptop thuộc BST Timeless và được trình diễn tại show diễn thời trang Fall Winter 2022 với cảm hứng là phong cách Academia kết hợp cùng những ý tưởng sáng tạo và đậm chất xu hướng thời đại mang đến diện mạo hoàn toàn mới mẻ, vượt ra khỏi khái niệm về sắc đẹp đơn thuần, giúp nàng mãi xinh đẹp và yêu kiều.</p>\r\n<p>Áo khoác thun phối tweed dài tay, cổ áo tròn, dáng suông có độ dài ngang hông. Khuy cài áo phía trước. Chất liệu vải thun mềm mại, bề mặt ngoài có phối vải tweed mỏng đủ để tạo điểm nhấn cho item này. Áo 3 lỗ dáng croptop, kiểu dáng ôm, cổ vuông, cài bằng hàng khuy phía trước. Thiết kế áo trẻ trung, thời thượng, phù hợp diện hàng ngày. Set áo dễ dàng tách lẻ và phối cùng các items khác nhau. Nàng theo phong cách sexy cá tính hay kín đáo dịu dàng đều diện đẹp!</p>\r\n<p>Set áo mix cùng chân váy 30M7949 đồng bộ sẽ là outffit hoàn hảo cho nàng trong mùa thu này.</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n</div>'),(289,85,0,145,'Áo khoác len mỏng viền màu'),(290,76,0,145,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác cổ tròn, dài tay. Có 2 túi vuông 2 bên có khuy đính. Viền khác màu trang trí. Cài khuy phía trước.</p>\r\n<p>Vải len có đặc tính thoát ẩm rất tốt. Độ ẩm của làn da người sử dụng luôn được ổn định mang lại cảm giác thoải mái, ấm áp. Đừng quên mix cùng chân váy, áo len cổ cao bên trong bạn sẽ có set đồ đẹp nhất.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n</div>'),(291,85,0,146,'Trench Coat - Áo khoác Măng Tô Có Đai'),(292,76,0,146,'<div class=\"tab-content active showContent\">\r\n<p>Hướng đến Fall/Winter 2023 Collection, nơi bản tuyên ngôn thời trang của IVY moda trên đường phố Paris - Kinh đô thời trang thế giới, giúp cho những người phụ nữ tự tin bước ra khỏi vùng an toàn và tỏa sáng theo cách riêng của họ.</p>\r\n<p>Trench coat được ưu ái nằm trong những thước phim đầu của BST, biểu tượng thời trang khẳng định sự thanh lịch của người phụ nữ.</p>\r\n<p>Trench coat của IVY moda đi sâu vào phom dáng, chi tiết như cầu vai mềm, vạt áo cách điệu. Hai bên cổ áo được đính khuy cài tinh tế cho những ngày lạnh, giúp giữ ấm phần cổ, đây là sự tận tâm mà các nhà thiết kế muốn gửi tới khách hàng và mang đến sự khác biệt, đẳng cấp của thương hiệu thời trang hàng đầu Việt Nam.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(293,85,0,147,'Long check trench coat'),(294,76,0,147,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác được thiết kế cổ hai ve to, cổ tay áo có đai mềm mại cố định ở áo. Hai hàng cúc tạo điểm nhấn. Phần eo có đai riêng để người mặc có thể thoải mái sáng tạo cách thắt dây cho thời trang nhất. Hai bên có túi nhỏ hình hộp để điện thoại hay cây son, ví tiền nhỏ,... Ở phía sau áo khoác có đường xẻ ở gấu áo giúp người mặc dễ dàng hoạt động.</p>\r\n<p>Độ dài của áo khoác ngang bắp chân, cực tôn dáng và là xu hướng của những năm gần đây. Áo khoác dễ dàng phối đồ với áo len, váy,... phù hợp với đi chơi, đi làm,...</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(295,85,0,148,'Oversize Trench Coat'),(296,76,0,148,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác thiết kế cổ hai ve bản to, dáng dài cùng màu sắc sang trọng, kiểu dáng vô cùng đẳng cấp. Với chất liệu Tuysi cao cấp bề mặt vải mềm mịn, không gây tích điện và khả năng giữ form cực tốt. Eo sử đụng đai đồng màu kèm hai hàng cúc mặt trước. thân dưới xòe nhẹ giúp người mặc sải bước tự tin khi đi xuống phố, đi làm, hay đi event...</p>\r\n<p>Lấy cảm hứng từ trang phục của quân đội châu Âu, những chiếc áo trench coat từ lâu đã khẳng định sự “thống trị” trong tủ đồ thời trang thu – đông. Thời thượng, thanh lịch nhưng không kém phần cá tính, áo trench coat dễ dàng làm xiêu lòng cả những quý cô, quý ông khó tính nhất</p>\r\n<p>Cùng với sự cách điệu phần vạt áo, lấy nguồn cảm hứng bất tận từ những quý cô người Pháp và sự sáng tạo vượt khuôn khổ, IVY moda đã tạo nên chiếc áo Trench Coat vừa cổ điển vừa hiện đại tinh tế.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(297,85,0,149,'Trench coat dáng dài'),(298,76,0,149,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác thiết kế cổ hai ve bản nhỏ, dáng dài cùng màu sắc sang trọng, kiểu dáng vô cùng đẳng cấp. Với chất liệu Tuysi cao cấp bề mặt vải mềm mịn, không gây tích điện và khả năng giữ form cực tốt. Eo sử đụng đai đồng màu kèm hai hàng cúc mặt trước. thân dưới xòe nhẹ giúp người mặc sải bước tự tin khi đi xuống phố, đi làm, hay đi event...</p>\r\n<p>Lấy cảm hứng từ trang phục của quân đội châu Âu, những chiếc áo trench coat từ lâu đã khẳng định sự “thống trị” trong tủ đồ thời trang thu – đông. Thời thượng, thanh lịch nhưng không kém phần cá tính, áo trench coat dễ dàng làm xiêu lòng cả những quý cô, quý ông khó tính nhất</p>\r\n<p>Cùng với sự cách điệu phần vạt áo, lấy nguồn cảm hứng bất tận từ những quý cô người Pháp và sự sáng tạo vượt khuôn khổ, IVY moda đã tạo nên chiếc áo Trench Coat vừa cổ điển vừa hiện đại tinh tế.</p>\r\n<p>Màu sắc: Hồng san hô - Xanh Oliu</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m68</li>\r\n<li><em><strong>Cân nặng:</strong></em> 48kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-64-88 cm</li>\r\n</ul>\r\n</div>'),(299,85,0,150,'Trench Coat - As Ageless As The Sun'),(300,76,0,150,'<div class=\"tab-content active showContent\">\r\n<p><strong>* SẢN PHẨM KHÔNG KÈM ĐAI</strong></p>\r\n<p>Áo khoác thiết kế cổ hai ve bản to, dáng dài cùng màu sắc sang trọng, kiểu dáng vô cùng đẳng cấp. Với chất liệu Tuysi cao cấp bề mặt vải mềm mịn, không gây tích điện và khả năng giữ form cực tốt. Eo sử đụng đai đồng màu kèm hai hàng cúc mặt trước. thân dưới xòe nhẹ giúp người mặc sải bước tự tin khi đi xuống phố, đi làm, hay đi event...</p>\r\n<p>Lấy cảm hứng từ trang phục của quân đội châu Âu, những chiếc áo trench coat từ lâu đã khẳng định sự “thống trị” trong tủ đồ thời trang thu – đông. Thời thượng, thanh lịch nhưng không kém phần cá tính, áo trench coat dễ dàng làm xiêu lòng cả những quý cô, quý ông khó tính nhất</p>\r\n<p>Cùng với sự cách điệu phần vạt áo, lấy nguồn cảm hứng bất tận từ những quý cô người Pháp và sự sáng tạo vượt khuôn khổ, IVY moda đã tạo nên chiếc áo Trench Coat vừa cổ điển vừa hiện đại tinh tế.</p>\r\n<p>Màu sắc: Đen - Nude</p>\r\n<p><strong>Mẫu mặc size M:</strong></p>\r\n<p>Chiều cao: 1m74<br />Cân nặng: 49kg<br />Số đo 3 vòng: 80-57-88</p>\r\n</div>'),(301,85,0,151,'Áo măng tô kẻ'),(302,76,0,151,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác măng tô. Tay dài. Dáng dài ngang bắp cá chân. Eo chiết có đỉa kèm đai rời cùng màu. Giắc lăng ở vai và tay áo. 2 túi chéo 2 bên. Cài bằng hàng khuy đôi phía trước.</p>\r\n<p>Là 1 item không thể thiếu trong tủ đồ, dễ kết hợp với các trang phục, phụ kiện khác. Đường may tỉ mỉ, tinh tế giúp bạn yên tâm về chất lượng sản phẩm.</p>\r\n<p>Màu sắc: Họa tiết Đen - Họa tiết Nâu Cà Phê</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m70</li>\r\n<li><em><strong>Cân nặng:</strong></em> 47kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-60-90</li>\r\n</ul>\r\n</div>'),(303,85,0,152,'Houndstooth Trench Coat'),(304,76,0,152,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác dạ kẻ dáng dài ngang gối. Cổ 2 ve lật khoét chữ K. Dài tay, cổ tay may con đỉa đính khuy. Túi trước có viền. Thắt lưng cùng màu. Cài phía trước bằng hàng khuy đôi.</p>\r\n<p>Các nhà thiết kế của IVY moda đã tinh tế lựa chọn những kiểu dáng hướng đến sự tiện dụng, thể hiện nét đẹp thanh lịch của người phụ nữ. Áo trench coat vừa đời thường, vừa mang màu sắc điện ảnh với họa tiết houndstooth cổ điển.</p>\r\n<p>Màu sắc: Kẻ Đen - Kẻ Nude - Họa tiết Ghi Tím</p>\r\n<p><strong>Mẫu mặc size M:</strong></p>\r\n<p>Chiều cao: 1m74<br />Cân nặng: 49kg<br />Số đo 3 vòng: 80-57-88</p>\r\n</div>'),(305,85,0,153,'Áo khoác tay giắc lăng'),(306,76,0,153,'<div class=\"tab-content active showContent\">\r\n<p><strong>* Sản phẩm không kèm đai</strong></p>\r\n<p>- Thiết kế cổ hai ve, dài tay, độ dài ngang hông đem lại sự trẻ trung cho những cô nàng yêu thích sự cá tính, năng động.<br />- Chất liệu kaki cao cấp kết hợp với vải tuysi mềm mại, mịn màng giúp người mặc cảm thấy dễ chịu, thoải mái.<br />- Mix cùng váy body, áo len hay quần dài...để có set đồ hoàn hảo diện đi chơi, đi làm...<br />- Màu: Nude, Vàng, đen</p>\r\n</div>'),(307,85,0,154,'Áo Crop Trench Coat 4 khuy'),(308,76,0,154,'<div class=\"tab-content active showContent\">\r\n<p>Áo vest cổ 2 ve khoét chữ K. Dáng áo ngắn. Tay dài gấu bo chun co giãn. Vai áo trang trí đai liền. Eo chiết kèm đai rời. Mix cùng chân zuýp đồng bộ.</p>\r\n<p>Tạo cảm giác mới mẻ khi diện set đồng bộ trong những buổi tiệc quan trọng, họp hành hay gặp gỡ đối tác khi diện set đồ này. Đừng quên mix cùng phụ kiện và đôi giày cao gót nàng nhé.</p>\r\n<p>Màu sắc: Cam - Hồng san hô.</p>\r\n</div>'),(309,85,0,155,'Trench Coat Dáng Oversize'),(310,76,0,155,'<div class=\"tab-content active showContent\">\r\n<p><strong>* Sản phẩm không kèm đai</strong></p>\r\n<p>Áo khoác được thiết kế cổ hai ve to, cổ tay áo có đai mềm mại cố định ở áo. Hai hàng cúc tạo điểm nhấn. Hai bên có túi nhỏ hình hộp để điện thoại hay cây son, ví tiền nhỏ,... Ở phía sau áo khoác có đường xẻ ở gấu áo giúp người mặc dễ dàng hoạt động.</p>\r\n<p>Độ dài của áo khoác ngang bắp chân, cực tôn dáng và là xu hướng của những năm gần đây. Áo khoác dễ dàng phối đồ với áo len, váy,... phù hợp với đi chơi, đi làm,...</p>\r\n</div>'),(311,85,0,156,'Houndstooth Trench Coat - Mẫu 2'),(312,76,0,156,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác dạ kẻ dáng dài ngang gối. Cổ 2 ve lật khoét chữ K. Dài tay, cổ tay may con đỉa đính khuy. Túi trước có viền. Thắt lưng cùng màu. Cài phía trước bằng hàng khuy đôi.</p>\r\n<p>Dáng áo trend coat mang vẻ đẹp thanh lịch, cá tính vào mỗi đợt Thu Đông về.</p>\r\n<p>Màu sắc: Kẻ Đen - Kẻ Nude - Họa tiết Ghi Tím.</p>\r\n</div>'),(313,85,0,157,'Set áo dài Thanh Liễu'),(314,76,0,157,'<div class=\"tab-content active showContent\">\r\n<p>Nằm trong BST áo dài Châu Gia, Thanh Liễu mang đến một vẻ đẹp truyền thống rất đỗi kiêu sa. Kế thừa nét đẹp của tà áo dài xưa qua các chi tiết như cổ áo cao, tà dài dáng suông, kết hợp cùng họa tiết thêu hoa thủ công tỉ mỉ đã mang đến vẻ đẹp thanh lịch, kiều diễm nhưng đúng với tên gọi - Thanh Liễu.</p>\r\n<p>Bức tranh thêu hoa mẫu đơn, đây là loài hoa tượng trưng cho thanh cao và sắc đẹp, sung túc và an khang. Chi tiết \'khánh\' ở eo duyên dáng mang tinh hoa xưa được các nhà thiết kế gìn giữ một cách trân quý, cách tân thêm logo thương hiệu đã khẳng định nét đặc trưng đậm tuyên ngôn thời trang riêng.</p>\r\n<p>Vừa mang nét truyền thống nhưng vẫn phù hợp với không gian sống hiện đại, Thanh Liễu sẽ là sự lựa chọn hoàn hảo cho các cô nàng diện ngày Tết và các dịp đặc biệt.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(315,85,0,158,'Set áo dài Hồng Phúc'),(316,76,0,158,'<div class=\"tab-content active showContent\">\r\n<p>Nằm trong BST áo dài Châu Gia, Hồng Phúc mang đến một vẻ đẹp truyền thống rất đỗi kiêu sa. Kế thừa nét đẹp của tà áo dài xưa qua các chi tiết như cổ áo cao, tà dài dáng suông, kết hợp cùng họa tiết thêu tay kì công tỉ mỉ đã mang đến vẻ đẹp thanh lịch, kiều diễm.</p>\r\n<p>Bức tranh thêu trái lựu căng đỏ tựa như những chiếc đèn lồng tượng trưng cho sự may mắn và tài lộc trong cuộc sống. Chi tiết \'khánh\' ở eo duyên dáng mang tinh hoa xưa được các nhà thiết kế gìn giữ một cách trân quý, cách tân thêm logo thương hiệu đã khẳng định nét đặc trưng đậm tuyên ngôn thời trang riêng.</p>\r\n<p>Vừa mang nét truyền thống nhưng vẫn phù hợp với không gian sống hiện đại, Hồng Phúc sẽ là sự lựa chọn hoàn hảo cho các cô nàng diện ngày Tết và các dịp đặc biệt.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: <