ruyền thống. Điểm nhấn của chiếc áo dài nằm ở chi tiết xếp ly voan độc đáo tạo kiểu vai phồng hình bán nguyệt; cổ cao dáng yếm tăng thêm nét cổ điển. Đặc biệt, chi tiết hoa ly được thêu đính thủ công còn mang ý nghĩa về sự may mắn, gắn kết hạnh phúc của tình yêu đôi lứa. </p>\r\n<p>Chất liệu vải Tuysi cao cấp, không nhăn, đứng phom cùng sắc trang nhã, thanh lịch. Tuyết Mai không chỉ là sự lựa chọn hoàn hảo cho ngày Tết mà còn rất phù hợp cho các cô dâu diện trong ngày trọng đại của mình.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(325,85,0,163,'Set áo dài Họa Y'),(326,76,0,163,'<div class=\"tab-content active showContent\">\r\n<p>Nằm trong BST áo dài Châu Gia, Họa Y là sự cộng hưởng của hơi thở truyền thống quý giá qua họa tiết thêu tay kì công và tỉ mỉ, cùng chất liệu voan, lụa bay bổng giúp nàng khoe nét yêu kiều một cách đầy tình tứ.</p>\r\n<p>Bức tranh thêu bình hoa ngày Tết với đầy đủ các chi tiết đậm sắc xuân là lộc, hoa và trái mang ý niệm về sự sung túc, căng tràn sức sống. Chi tiết \'khánh\' ở eo duyên dáng mang tinh hoa xưa được các nhà thiết kế gìn giữ một cách trân quý, cách tân thêm logo thương hiệu đã khẳng định nét đặc trưng đậm tuyên ngôn thời trang riêng.</p>\r\n<p>Họa Y mang lại vẻ trẻ trung, kiều diễm, sẽ là sự lựa chọn hoàn hảo cho các cô nàng diện ngày Tết và các dịp đặc biệt.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(327,85,0,164,'Set áo dài Hồng Phượng'),(328,76,0,164,'<div class=\"tab-content active showContent\">\r\n<p>Nằm trong BST áo dài Châu Gia, Hồng Phượng là hiện thân của sự quyền quý, cao sang, là sự kết hợp hoàn hảo giữa nét hiện đại và truyền thống. Điểm nhấn của chiếc áo dài nằm ở đường cắt may tinh xảo tạo kiểu vai phồng hình bán nguyệt, chi tiết cut-out cùng khuy đính ngọc trai thêm vẻ sang trọng, cổ điển. Chi tiết \'khánh\' ở eo duyên dáng mang tinh hoa xưa được các nhà thiết kế gìn giữ một cách trân quý, cách tân thêm logo thương hiệu đã khẳng định nét đặc trưng đậm tuyên ngôn thời trang riêng.</p>\r\n<p>Chất liệu vải Organza cao cấp, không nhăn, đứng phom cùng sắc đỏ thể hiện sự may mắn, hạnh phúc, Hồng Phượng chắc chắn sẽ là sự lựa chọn hoàn hảo cho nàng diện ngày Tết và các dịp đặc biệt.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(329,85,0,165,'Set áo dài Ngọc Châu'),(330,76,0,165,'<div class=\"tab-content active showContent\">\r\n<p>Nằm trong BST áo dài Châu Gia, Ngọc Châu là hiện thân của sự quyền quý, cao sang, là sự kết hợp hoàn hảo giữa nét hiện đại và truyền thống. Thiết kế áo dài với tay bồng xoắn kiểu, cổ vuông, dáng ôm. Chi tiết \'khánh\' ở eo duyên dáng mang tinh hoa xưa được các nhà thiết kế gìn giữ một cách trân quý, cách tân thêm logo thương hiệu đã khẳng định nét đặc trưng đậm tuyên ngôn thời trang riêng.</p>\r\n<p>Chất liệu vải Tuysi cao cấp, không nhăn, đứng phom cùng sắc trang nhã, thanh lịch. Ngọc Châu không chỉ là sự lựa chọn hoàn hảo cho ngày Tết mà còn rất phù hợp cho nàng diện trong các dịp đặc biệt.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(331,85,0,166,'Set áo dài Ngọc Trân'),(332,76,0,166,'<div class=\"tab-content active showContent\">\r\n<p>Nằm trong BST áo dài Châu Gia, Ngọc Trân là hiện thân của sự quyền quý, cao sang, là sự kết hợp hoàn hảo giữa nét hiện đại và truyền thống. Thiết kế áo dài với tay bồng xoắn kiểu, cổ vuông, dáng ôm. Chi tiết \'khánh\' ở eo duyên dáng mang tinh hoa xưa được các nhà thiết kế gìn giữ một cách trân quý, cách tân thêm logo thương hiệu đã khẳng định nét đặc trưng đậm tuyên ngôn thời trang riêng.</p>\r\n<p>Chất liệu vải Tuysi cao cấp, không nhăn, đứng phom cùng sắc trang nhã, thanh lịch. Ngọc Trân không chỉ là sự lựa chọn hoàn hảo cho ngày Tết mà còn rất phù hợp cho nàng diện trong các dịp đặc biệt.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 169 cm</p>\r\n<p><strong>Cân nặng: </strong> 48 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>80-60-90 cm</p>\r\n<p>Mẫu mặc size S</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(333,85,0,167,'Set áo dài Nhật Mai'),(334,76,0,167,'<div class=\"tab-content active showContent\">\r\n<p>Nằm trong BST áo dài Châu Gia, áo dài Tuyết Mai là hiện thân của sự quyền quý, cao sang, là sự kết hợp hoàn hảo giữa nét hiện đại và truyền thống. Điểm nhấn của chiếc áo dài nằm ở chi tiết xếp ly voan độc đáo tạo kiểu vai phồng hình bán nguyệt; cổ cao dáng yếm tăng thêm nét cổ điển. Đặc biệt, chi tiết hoa ly được thêu đính thủ công còn mang ý nghĩa về sự may mắn, gắn kết hạnh phúc của tình yêu đôi lứa. </p>\r\n<p>Chất liệu vải Tuysi cao cấp, không nhăn, đứng phom cùng sắc trang nhã, thanh lịch. Tuyết Mai không chỉ là sự lựa chọn hoàn hảo cho ngày Tết mà còn rất phù hợp cho các cô dâu diện trong ngày trọng đại của mình.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(335,85,0,168,'Set áo dài Ý Niên'),(336,76,0,168,'<div class=\"tab-content active showContent\">\r\n<p>Với BST Hoàng Cúc, ta vẫn thấy được những gì mộc mạc nhất của chiếc áo dài, nhưng điều làm ta rạo rực là chút ngẫu hứng đầy tinh tế đến hút hồn trong các thiết kế của BST: những đường nét mềm mại mà dứt khoát, cách điệu ở nơi cổ áo, tay và đặc biệt là sự \'chơi màu\' từ áo, quần đến khánh,...đã khiến BST vừa có sắc, vừa có thanh âm.</p>\r\n<p>Ý Niên: Được chọn làm dresscode cho những ngày Tết bởi sắc đỏ tượng trưng cho may mắn, sung túc và sự nồng nàn của tình yêu</p>\r\n<p><strong>Kiểu dáng:</strong> áo dài thiết kế cổ truyền thống, dáng suông, tay dài kiểu giắc lăng.<br /><strong>Phù hợp: </strong>lễ tết, cưới hỏi, đi sự kiện, tạo vẻ trẻ trung, duyên dáng cho người mặc.</p>\r\n<p>Màu sắc: Cam - Đỏ - Xanh Lime - Đỏ Hồng</p>\r\n</div>'),(337,85,0,169,'Single Breasted Set II'),(338,76,0,169,'<div class=\"tab-content active showContent\">\r\n<p>Set bộ vest với áo vest 2 khuy chiết eo kết hợp quần suông dáng lửng thể hiện sự thời trang, sành điệu của người phụ nữ, phù hợp cho nhiều dịp khác nhau như công sở, dự tiệc, hay các sự kiện quan trọng.</p>\r\n<p>Áo vest 2 khuy chiết eo tạo nét thanh lịch và chuyên nghiệp. Đảm bảo áo vest vừa vặn, tôn lên vóc dáng người mặc. </p>\r\n<p>Quần suông dáng lửng thoải mái, mang lại sự năng động lại phù hợp với áo vest.</p>\r\n<p>Nàng có thể mix bộ vest với giày cao gót hoặc giày oxford để tăng thêm vẻ lịch lãm. Bổ sung thêm phụ kiện như dây chuyền, đồng hồ, và túi xách phù hợp để hoàn thiện ensemble cho mình. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(339,85,0,170,'Set bộ Tweed Caily'),(340,76,0,170,'<div class=\"tab-content active showContent\">\r\n<p>Mở đầu BST FW2023 với dòng sản phẩm dạ Tweed cao cấp mang đến sự sang trọng và thanh lịch cho phái đẹp. Set bộ Caily được kết hợp hoàn hảo giữa thiết kế áo khoác ngoài cổ tròn bên cạnh chân váy dáng A thời thượng. </p>\r\n<p>Áo khoác dáng suông, độ dài  ngang  hông, thân trước có khuy cài, thích hợp cả diện theo set bộ hay mix với nhiều item khác. Chân váy A, độ dài trên gối, cạp cao, ôm nhẹ, che khuyết điểm tốt. </p>\r\n<p>Set bộ chính là sự lựa chọn hoàn hảo để nàng phô diễn vẻ đẹp kiêu sa mùa Thu - Đông này. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(341,85,0,171,'Calista Set - Bộ vest đai eo II'),(342,76,0,171,'<div class=\"tab-content active showContent\">\r\n<p>Tiết trời sang Thu rất thích hợp để diện những bộ Vest thanh lịch, tinh tế. Đến với thiết kế lần này, IVY Moda đã biến tấu set bộ Vest thông thường thành bản cách điệu độc đáo, phô diễn hoàn hảo nét đẹp nàng công sở. </p>\r\n<p>Áo Vest cổ hai ve, đơm hàng khuy bạc thời thượng. Áo được tạo tà peplum nhẹ bên cạnh phần eo kèm đai cách điệu. Chân váy bút chì hai lớp, ôm nhẹ, vừa che khuyết điểm tốt vừa tạo cảm giác thon gon. </p>\r\n<p>Set đồ là lựa chọn hoàn hảo cho nàng công sở hiện đại. Với thiết kế trẻ trung, màu sắc trendy, không những giúp tôn lên vóc dáng mà còn giúp nàng tiết kiệm thời gian khi chọn đồ.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại</p>\r\n</div>'),(343,85,0,172,'Set bộ công sở Adela II'),(344,76,0,172,'<div class=\"tab-content active showContent\">\r\n<p>Set đồ bao gồm một áo blazer ôm, kết hợp chân váy xếp ly nhẹ nhàng, tạo nên một bộ trang phục hoàn hảo cho nàng công sở bắt đầu ngày làm việc mới hay đến những buổi gặp mặt sang trọng. </p>\r\n<p>Dáng áo blazer cổ 2 ve thời thượng, thiết kế đơn giản nhưng không kém phần tinh tế, với đường triết eo cách điệu, tôn lên vẻ ngoài gọn gàng và thời trang. Chân váy xếp li bồng nhẹ, mang đến hình ảnh thanh lịch và cáo sang. Cùng với đó, chất liệu vải Tuysi mềm mại và thoáng mát giúp bạn cảm thấy thoải mái trong suốt ngày dài.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 163 cm</p>\r\n<p><strong>Cân nặng: </strong> 47 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-61-90 cm</p>\r\n<p>Mẫu mặc size S Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(345,85,0,173,'Vincent Set - Áo blazer kết hợp quần suông'),(346,76,0,173,'<div class=\"tab-content active showContent\">\r\n<p>Vincent Set được kết hợp từ áo khoác cổ hai ve, dáng croptop trẻ trung, hiện đại bên cạnh quần Tây suông xếp ly hách dáng. </p>\r\n<p>Thiết kế áo blazer tay dài, cách điệu giấu khuy, vừa mang đến sự cá tính vừa thể hiện gu thẩm mỹ thời thượng của nàng công sở đam mê thời trang. </p>\r\n<p>Quần dài ống rộng cạp cao có khóa kéo và đai eo nhỏ, tạo điểm nhấn thon gọn rất tốt.</p>\r\n<p>Set đồ là lựa chọn hoàn hảo cho nàng công sở hiện đại. Với thiết kế trẻ trung, màu sắc trendy, không những giúp tôn lên vóc dáng mà còn giúp nàng tiết kiệm thời gian khi chọn đồ.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(347,85,0,174,'Set áo blazer 6 khuy và chân váy mini'),(348,76,0,174,'<p>Set blazer là thiết kế hoàn hảo dành cho dành cho các cô nàng công sở đang tìm kiếm bộ trang phục trẻ trung, cá tính nhưng vẫn giữ được nét lịch sự, duyên dáng. Áo blazer là sự kế thừa vẻ đẹp của phom dáng áo vest cổ điển: cổ 2 ve, vai độn và 2 hàng khuy. Chân váy mini ngắn trẻ trung, tôn dáng người mặc.</p>\r\n<p>Chất liệu vải tweed dệt mềm mỏng, không nhăn, sang trọng,.. diện rất thoải mái và giữ phom dáng tốt. Xu hướng nữ quyền được IVY moda kết hợp giữa vẻ đẹp thanh lịch, sang trọng nhưng vẫn đề cao sự thoải mái, dễ chịu từ phom dáng đến chất liệu mềm mại.</p>\r\n<p>Không chỉ đẹp từ thiết kế đến chất liệu, áo blazer còn mang tính ứng dụng cao, phù hợp cho các cô nàng diện nơi công sở và đi dự sự kiện. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>'),(349,85,0,175,'Piece Suits - Set áo vest dáng oversize'),(350,76,0,175,'<div class=\"tab-content active showContent\">\r\n<p>Set áo vest gồm 3 items: áo vest, áo quây 2 dây và quần suống dài. Đây là thiết kế hoàn hảo dành cho các cô nàng theo đuổi phong cách Office Chic. Áo vest là sự kế thừa vẻ đẹp của phom dáng áo vest cổ điển: cổ 2 ve, vai độn, chiết eo. Áo quây 2 dây phối dây xích tạo kiểu (áo không kèm miếng lót ngực). Quần dài dáng suông, cạp cao tôn dáng người mặc.</p>\r\n<p>Chất liệu được sử dụng là chất vải tuysi cao cấp. Đây là sự lựa chọn hàng đầu của các nhà mốt dành cho các thiết kế đòi hỏi sự thanh lịch, sang trọng mà vẫn đảm bảo tính thoải mái. Vải tuysi mềm nhẹ, thoáng mát, ít nhăn và giữ form dáng tốt. Xu hướng nữ quyền được IVY moda kết hợp giữa vẻ đẹp thanh lịch, sang trọng nhưng vẫn đề cao sự thoải mái, dễ chịu từ phom dáng đến chất liệu mềm mại.</p>\r\n<p>Không chỉ đẹp từ thiết kế đến chất liệu, set đồ còn mang tính ứng dụng cao, phù hợp cho các cô nàng diện nơi công sở và đi dự sự kiện. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 169 cm</p>\r\n<p><strong>Cân nặng: </strong> 48 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>80-60-90 cm</p>\r\n<p>Mẫu mặc size S</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(351,85,0,176,'Cropped Tweed Set II'),(352,76,0,176,'<div class=\"tab-content active showContent\">\r\n<p>Set đồ gồm áo khoác croptop và chân váy mini. Áo khoác tweed dáng ngắn cổ tròn, tay dài. Viền dây vặn thừng khác màu tạo điểm nhấn. Có phụ kiện hoa đính bên ngực. Vải tweed dày dặn bên trong lót lớp vải lụa. Chân váy mini ngắn giúp nàng khéo léo khoe đôi chân mình, đặc biệt \"ăn gian\" chiều cao khi để lộ nhiều phần chân.</p>\r\n<p>Việc sử dụng chất liệu cao cấp nhất thị trường như Tweed đã đem lại sự sang trọng cho cả set đồ. Chất liệu Tweed được sử dụng là loại vải dày dặn được dệt từ những sợi len nhiều màu có cấu trúc vặn xoắn. Bề mặt vải Tweed có độ gồ ghề nhẹ đặc trưng, bên trong có lớp lót lụa mềm mại. Tính cao cấp của chất liệu Tweed đem lại là sự mềm nhẹ, khả năng chống nước, chống lạnh tốt. </p>\r\n<p>Lấy cảm hứng từ bộ suit cổ điển, các nhà mốt IVY đã \"trẻ hóa\" bộ suit, giúp các cô nàng diện lên trông thật thanh lịch, sang trọng mà vẫn giữ  được nét trẻ trung, đáng yêu.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(353,85,0,177,'Set Bộ Vest công sở'),(354,76,0,177,'<div class=\"tab-content active showContent\">\r\n<p>Set đồ gồm áo vest và quần dài ống đứng. Thiết kế áo vest cổ 2 ve, vai độn, eo chiết tôn dáng người mặc. Điểm nhấn là chi tiết khuy kim loại vàng giúp set đồ thêm phần nữ tính, sang trọng, giảm sự \"nghiêm túc\" cho set đồ. Mix cùng áo vest là quần dài ống đứng được là ly thẳng phía trước.</p>\r\n<p>Chất liệu tuysi là loại vải cao cấp, là sự lựa chọn hàng đầu của các nhà mốt dành cho các thiết kế đòi hỏi sự thanh lịch, sang trọng mà vẫn đảm bảo sự thoải mái. </p>\r\n<p>Với set đồ này, nàng có thể dễ dàng tách set để mix&amp;match với nhiều items khác nhau, đa dạng hơn các outfit trong tuần. Set đồ phù hợp đi làm hay đi sự kiện đòi hỏi sự chỉn chu, lịch sự. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(355,85,0,178,'Set Áo Vest Kèm Đai Và Chân Váy II'),(356,76,0,178,'<div class=\"tab-content active showContent\">\r\n<p>Áo vest cổ 2 ve, tay áo dài đính 3 khuy trang trí. 2 hàng khuy phía trước. Có đệm ở vai áo. Dáng croptop ngắn ngang eo kèm đai trẻ trung và tôn dáng nàng. Chân váy bút chì độ dài ngang bắp chân có xẻ trước tạo điểm nhấn.</p>\r\n<p>Được chăm chút từ khâu thiết kế đến khâu gia công với mong muốn đem đến một sản phẩm tốt nhất cho khách hàng của mình, IVY moda sử dụng chất liệu Tuysi cao cấp nhằm mang đến sự thoải mái, dễ chịu nhất mà vẫn đảm bảo tính thanh lịch, chỉn chu cho người mặc. Diện cả set đồ đi làm hay đi sự kiện hoặc nàng có thể tách set, dễ dàng phối cùng nhiều items khác nhau, đa dạng hơn phong cách ăn mặc hàng ngày.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 169 cm</p>\r\n<p><strong>Cân nặng:</strong> 48 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>80-60-90 cm</p>\r\n<p>Mẫu mặc size S</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(357,85,0,179,'Quinn Suit - Set áo vest và quần suông dập ly'),(358,76,0,179,'<div class=\"tab-content active showContent\">\r\n<p>Sản phẩm thuộc BST Timeless và được trình diễn trong show thời trang Fall Winter 2022. Bộ sưu tập lấy cảm hứng từ phong cách thời trang Academia, cộng hưởng với những ý tưởng sáng tạo đầy xu hướng, mang đến diện mạo học thức vượt ra khỏi khái niệm sắc đẹp đơn thuần.</p>\r\n<p>Set áo vest là thiết kế hoàn hảo dành cho các cô nàng theo đuổi phong cách Office Chic. Áo vest là sự kế thừa vẻ đẹp của phom dáng áo vest cổ điển: cổ 2 ve, vai độn, chiết eo. Quần dài dáng suông, dập ly 2 bên, cạp cao tôn dáng người mặc.</p>\r\n<p>Chất liệu được sử dụng là chất vải tuysi cao cấp. Đây là sự lựa chọn hàng đầu của các nhà mốt dành cho các thiết kế đòi hỏi sự thanh lịch, sang trọng mà vẫn đảm bảo tính thoải mái. Vải tuysi mềm nhẹ, thoáng mát, ít nhăn và giữ form dáng tốt. Xu hướng nữ quyền được IVY moda kết hợp giữa vẻ đẹp thanh lịch, sang trọng nhưng vẫn đề cao sự thoải mái, dễ chịu từ phom dáng đến chất liệu mềm mại.</p>\r\n<p>Không chỉ đẹp từ thiết kế đến chất liệu, set đồ còn mang tính ứng dụng cao, phù hợp cho các cô nàng diện nơi công sở và đi dự sự kiện. </p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(359,85,0,180,'3 Piece Blazer Set'),(360,76,0,180,'<div class=\"tab-content active showContent\">\r\n<p>3 Piece Blazer Set là sản phẩm thuộc BST Timeless và được trình diễn trong show thời trang Fall Winter 2022. BST được lấy cảm hứng từ phong cách Academia cùng những ý tưởng sáng tạo mang đầy tính xu hướng và nổi bật, mang đến một diện mạo học thức vượt xa khái niệm vẻ đẹp đơn thuần, dấu ấn vượt thời gian cùng những trang phục \"không tuổi\".</p>\r\n<p>3 Piece Blazer Set là set đồ 3 món bao gồm: áo blazer, áo 2 dây và quần baggy. Áo blazer với thiết kế phần cổ áo 2 ve dáng dài, vai áo được độn nhẹ để tạo độ cứng cáp cho phần vai ao, tay áo nhún chun có độ nhăn nhẹ tạo nét chấm phá nổi bật cho cả set đồ. </p>\r\n<p>Áo 2 dây cổ V dáng suông thanh lịch và dễ mặc, dễ phối đồ.</p>\r\n<p>Quần baggy dáng lửng, cạp cao có đai bản to đi kèm cùng 2 túi chéo 2 bên hông, khóa cài là khóa trước. </p>\r\n<p>Màu trơn, dễ mặc phù hợp cho cô nàng công sở, những cuộc gặp gỡ đối tác hoặc những dịp quan trọng. </p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n</div>'),(361,85,0,181,'Set bộ IVY You cá tính'),(362,76,0,181,'<div class=\"tab-content active showContent\">\r\n<p>Set bộ thời trang IVY You cá tính, hiện đại gồm: Áo sơ mi cổ đức cách điệu cùng chân váy chữ A bắt mắt.</p>\r\n<p>Áo sơ mi có thiết kế tay ngắn, tạo điểm nhấn tinh tế với cổ đức, tạo nên sự thanh lịch. Áo giấu khuyết điểm với một dãy khuy che phần thân trước, thể hiện sự gọn gàng và trang nhã. Đặc biệt, phần gấu áo thiết kế dây rút, cho phép bạn biến tấu tùy theo sở thích của mình. </p>\r\n<p>Chân váy đi kèm là chữ A, độ dài trên đầu gối, tạo cảm giác thoải mái và dễ di chuyển. Bên cạnh đó, chiếc chân váy này còn được trang bị túi hộp, giúp bạn tiện lợi để đựng các vật dụng nhỏ. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(363,85,0,182,'Larissa Set - Thiết kế áo blazer nơ kèm chân váy II'),(364,76,0,182,'<div class=\"tab-content active showContent\">\r\n<p>Gọi tên Larissa Set trong BST FW2023 với hình ảnh cô gái tự tin, mạnh mẽ, tinh tế lại vô cùng sang trọng: Set. bộ là sự kết hợp hoàn hảo từ phiên bản blazer dáng Croptop bên cạnh chân váy bán nguyệt. </p>\r\n<p>Áo blazer Croptop dài tay, khuy cài kim loại bên cạnh chi tiết nơ cổ nổi bật.  </p>\r\n<p>Chân váy bán nguyệt, tạo độ bồng nhẹ, đặc biệt che khuyết điểm cực tốt.  </p>\r\n<p>Elysia Set sử dụng chất liệu Tuysi cao cấp, mang đến cảm giác mặc thoải mái và thích hợp với mọi thời tiết. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(365,85,0,183,'Set bộ họa tiết chấm bi II'),(366,76,0,183,'<div class=\"tab-content active showContent\">\r\n<p>Thêm điểm chạm hiện đại, trẻ trung, năng động trong thiết kế Set bộ dành tặng nàng. Bản phối được kết  hợp từ áo croptop bên cạnh dáng chân váy dài, qua gối cực kì tôn dáng. </p>\r\n<p>Áo croptop cổ thuyền, có bo nhẹ ở gấu. Thiết kế tay ngắn tựa dáng vai chờm và thêm dây rút để  điều chỉnh độ dài. Chân váy midi chiều dài qua gối, lưng cao, vừa che được các khuyết điểm mà còn rất tôn dáng. </p>\r\n<p>Để thêm phần hoàn chỉnh cho set bộ, gợi ý nàng mix thêm các phụ kiện như giày cao gót, túi sách, vòng tay, vòng cổ...</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(367,85,0,184,'Set bộ dạ kẻ viền II'),(368,76,0,184,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế set bộ mang vẻ đẹp nhẹ nhàng, thanh lịch mà vẫn có chút điệu đà, mới lạ.</p>\r\n<p>Áo khoác cổ tròn, tay dài, giấu khuy. Áo độ dài thường, có thể mặc trơn hoặc sử dụng khoác ngoài. Chân váy chữ A dáng ngắn, hơi ôm nhẹ, thiết kế cơ bản nên rất dễ mix đồ. </p>\r\n<p>Bản phối sở hữu chất liệu Buckram cao cấp, được chọn là phiên bản tiền thân 4 mùa của chất liệu Tweed. Thiết kế vẫn giữ trọn vẹn đặc tính sang trọng, thời thượng của dòng Tweed và được biến tấu phù hợp thời tiết 4 mùa. </p>\r\n<p>Toàn bộ bản phối được tạo viền kẻ khác màu, không quá cầu kì nhưng vẫn toát lên vẻ đẹp sang trọng. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(369,85,0,185,'Sheath Set - Áo khoác lửng'),(370,76,0,185,'<div class=\"tab-content active showContent\">\r\n<p>Một set sang trọng và hiện đại với áo khoác dáng lửng và đầm xòe để tạo ngoại hình rất ấn tượng đi làm, đi chơi hay những dịp quan trọng. </p>\r\n<p>Áo khoác tay dài, thiết kế cổ 2 ve thời thượng, được điểm thêm các khuy cài ấn tượng. Đầm độ dài qua gối, cổ V quyến rũ, ôm lấy cơ thể. Thân dưới đầm tạo ly xòe nhẹ, che khuyết điểm tốt, tăng sự bồng bềnh. </p>\r\n<p>Có thể kết hợp set với giày cao gót hoặc giày bệt, tùy thuộc vào phong cách cá nhân. Để thêm phần nổi bật, bạn nên chọn một chiếc túi xách phù hợp với set trang phục. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(371,85,0,186,'Ellie Outfit - Bản phối Thu'),(372,76,0,186,'<div class=\"tab-content active showContent\">\r\n<p>Thời tiết sang Thu se lạnh rất thích hợp để nàng diện những thiết kế theo set bộ, vừa sang trọng, thanh lịch vừa tinh tế, nhẹ nhàng. Nằm trong BST REFINED - NEW COLLECTION FW2023, Ellie Outfit mang sự khởi đầu mới mẻ, hương vị Thu mới, sẵn sàng cùng nàng tự tin tỏa sáng. </p>\r\n<p>Bản phối được kết hợp giữa áo blazer ngắn, tay dài bên cạnh dáng chân váy A xếp ly bay bổng. Các chi tiết thiết kế gọn gàng, đảm bảo che khuyết điểm tốt mà còn nâng niu dáng vóc người mặc. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(373,85,0,187,'Elysia Set - Thiết kế áo kiểu kèm chân váy'),(374,76,0,187,'<div class=\"tab-content active showContent\">\r\n<p>Bản phối trẻ trung nhưng vẫn thời thượng và sang trọng dành cho nàng công sở mùa thu này hãy gọi tên Elysia Set. Set bộ gồm được mix từ áo vest kiểu, dáng Croptop cùng chân váy xếp li. </p>\r\n<p>Áo vest Croptop, kiểu dáng trẻ trung năng động với thiết kế tay ngắn bên cạnh cầu vai bồng. Thân trước cách điệu cổ V nhẹ nhàng, đính 4 khuy sang trọng. </p>\r\n<p>Chân váy A xếp li độ dài qua gối, tạo độ bồng nhẹ, đặc biệt che khuyết điểm cực tốt.  </p>\r\n<p>Elysia Set sử dụng chất liệu Tuysi cao cấp, mang đến cảm giác mặc thoải mái và thích hợp với mọi thời tiết. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(375,85,0,188,'Set bộ công sở Beauty'),(376,76,0,188,'<div class=\"tab-content active showContent\">\r\n<p>Beauty Set là thiết kế mang vẻ đẹp tươi sáng và trang nhã, gồm thiết kế áo và chân váy đồng bộ, được làm từ chất liệu vải ren cao cấp với họa tiết hoa in nổi tinh tế.</p>\r\n<p>Áo được may với hàng dây buộc nổi bật phía trước, tạo nên điểm nhấn thanh lịch và nữ tính mỗi khi diện lên. Lớp lót bảo vệ bên trong giúp định hình sản phẩm và mang đến cảm giác thoải mái khi mặc.</p>\r\n<p>Chân váy được thiết kế theo phong cách chữ A, ôm gọn làm nổi bật lên đường cong cơ thể. Khi kết hợp với chiếc áo, Rosie Set sẽ tôn lên vẻ đẹp tinh tế và quyến rũ của người diện.</p>\r\n<p>Thiết kế phù hợp để mặc trong các dịp hẹn hò, đi chơi, dự tiệc hay các sự kiện quan trọng khác. Cách phối đồ thật đơn giản và dễ dàng, có thể kết hợp với giày cao gót để tạo độ dài cho đôi chân hoặc với giày bệt để tăng sự thoải mái và trẻ trung.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(377,85,0,189,'Set đầm tweed'),(378,76,0,189,'<div class=\"tab-content active showContent\">\r\n<p>Set đồ gồm áo khoác croptop và đầm 2 dây. Áo khoác tweed dáng ngắn cổ tròn, gấu áo cắt vòm tăng thêm tính mềm mại cho set đồ. Điểm nhấn là chi tiết đan dây vặn thừng. Vải tweed dày dặn bên trong lót lớp vải lụa. Đầm 2 dây bản to dáng suông, độ dài trên đầu gối, kiểu dáng chữ A giúp che khuyết điểm phần thân dưới và tôn dáng nàng.</p>\r\n<p>Việc sử dụng chất liệu cao cấp nhất thị trường như Tweed đã đem lại sự sang trọng cho cả set đồ. Chất liệu có độ gồ ghề nhẹ đặc trưng, bên trong có lớp lót lụa mềm mại. Tính cao cấp của chất liệu Tweed đem lại là sự mềm nhẹ, khả năng chống nước, chống lạnh tốt. </p>\r\n<p>Lấy cảm hứng từ bộ suit cổ điển, các nhà mốt IVY đã \"trẻ hóa\" bộ suit, giúp các cô nàng diện lên trông thật thanh lịch, sang trọng mà vẫn giữ  được nét trẻ trung, duyên dáng. Set đồ với các items basic giúp nàng dễ dàng tách lẻ set để đa dạng hóa các bộ trang phục trong tuần theo nhiều phong cách khác nhau.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(379,85,0,190,'Set tweed hoa nổi'),(380,76,0,190,'<div class=\"tab-content active showContent\">\r\n<p>Set đồ gồm áo khoác croptop, áo 2 dây và chân váy chữ A. Áo khoác tweed dáng ngắn cổ tròn, tay dài, gấu may bo tròn. Điểm nhấn là chi tiết đính hoa nổi thủ công tinh tế, sang trọng. Áo 2 dây croptop mặc bên trong kín đáo nhưng vẫn rất tôn dáng. Chân váy chữ A ngắn giúp nàng khéo léo khoe đôi chân mình.</p>\r\n<p>Việc sử dụng chất liệu cao cấp nhất thị trường như Tweed đã đem lại sự sang trọng cho cả set đồ. Chất liệu Tweed được sử dụng là loại vải dày dặn được dệt từ những sợi len nhiều màu có cấu trúc vặn xoắn. Bề mặt vải Tweed có độ gồ ghề nhẹ đặc trưng, bên trong có lớp lót lụa mềm mại. Tính cao cấp của chất liệu Tweed đem lại là sự mềm nhẹ, khả năng chống nước, chống lạnh tốt. </p>\r\n<p>Lấy cảm hứng từ bộ suit cổ điển, các nhà mốt IVY đã \"trẻ hóa\" bộ suit, giúp các cô nàng diện lên trông thật thanh lịch, sang trọng mà vẫn giữ được nét trẻ trung.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(381,85,0,191,'Knit Set - Áo len và chân váy bút chì'),(382,76,0,191,'<div class=\"tab-content active showContent\">\r\n<p>Set đồ len đang trở thành xu hướng thời trang Thu-Đông 2022. Knit Set với kiểu dáng thanh lịch, có độ ôm sát vừa phải giúp tôn lên vóc dáng nàng. Điểm nhấn là chi tiết len dệt nổi văn thừng độc đáo. Chất liệu len với độ dày vừa phải, có độ bền và giữ ấm hiệu quả. </p>\r\n<p>Lựa một set đồ len với phom dáng và màu sắc trẻ trung như vậy, trông nàng sẽ thật xinh xắn tươi trẻ và năng động, xóa đi vẻ ủ rũ trong ngày lạnh giá. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong> 83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(383,85,0,192,'Ivory white tweed set'),(384,76,0,192,'<div class=\"tab-content active showContent\">\r\n<p><strong>* Sản phẩm chỉ GIẶT KHÔ, tuyệt đối không giặt nước!</strong></p>\r\n<p>Set áo khoác và chân váy Tweed là sản phẩm thuộc BST Timeless tham gia trình diễn trong show thời trang Fall Winter 2022. BST lấy cảm hứng từ phong cách Academia với ý tưởng sáng tạo mang tính xu hướng và nổi bật, đem đến diện mạo học thức vượt ra khỏi khái niệm sắc đẹp đơn thuần, dấu ấn vượt thời gian cùng những trang phục \"không tuổi\".</p>\r\n<p>Set đồ bao gồm áo khoác và chân váy:</p>\r\n<p>Áo khoác dài tay dáng ngắn cổ tròn, khuy cài kim loại lấp lánh đính logo IVY moda tạo độ ấn tượng cho chiếc áo màu hồng phấn đẹp mắt, kèm theo đó là 2 chiếc túi nhỏ trước ngực tạo kiểu. </p>\r\n<p>Chân váy bút chì cạp cao, độ dài chân váy qua đầu gối và xẻ sau. Khóa cài của chân váy ở phía sau kèm theo 2 túi nhỏ phía trước đồng bộ với 2 túi hộp trước ngực.  </p>\r\n<p>Chất liệu dạ tweed cao cấp và mềm mại, bên trong áo và chân váy đều có lớp lụa lót cùng màu. Thiết kế Set áo khoác và chân váy Tweed được làm nổi bật với đường viền màu đen trên nền trang phục màu hồng ấn tượng và bắt mắt. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(385,85,0,193,'Set bộ SMILE'),(386,76,0,193,'<div class=\"tab-content active showContent\">\r\n<p>Bản phối áo kiểu kết hợp quần jogger cá tính là đã mang đến thiết kế  set bộ hữu dụng cho mùa Thu - Đông tới đây. </p>\r\n<p>Áo cổ tròn, tay dài, dáng croptop hơi thụng, bo gấu và có dây rút điều chỉnh. Trước ngực tạo điểm nhấn bằng hình thêu chữ Smile sắc nét. Quần Jogger cạp chun, co giãn, mặc thoải mái. </p>\r\n<p>Chất liệu nỉ thun cao cấp, mềm mịn, giữ ấm tốt, không gây kích ứng khi mặc. Bạn có thể mix quần với  giày thể thao là đã  cho ngay set đồ năng động, hiện đại. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(387,85,0,194,'Set bộ Hoodie chữ S'),(388,76,0,194,'<div class=\"tab-content active showContent\">\r\n<p>Set bộ đa dụng cho mùa Thu - Đông mà bất cứ ai cũng nên có trong tủ đồ của mình</p>\r\n<p>Thiết kế áo dáng hoodie cơ bản, oversize trẻ trung năng động: mũ dây rút kèm túi phía trước. Áo bo ở gấu và cổ tay. Trước ngực tạo hình thêu chữ S tỉ mỉ.</p>\r\n<p>Quần jogger với bộ cạp chun co giãn, dễ dàng điều chỉnh vòng eo. Ống quần bo gấu, đi cùng giày thể thao năng động, cá tính. </p>\r\n<p>Set bộ sử dụng chất liệu thun cao cấp, độ co giãn đàn hồi cao. Đặc biệt, chất liệu còn có tính năng chống gió, cách nhiệt giữ ấm cơ thể.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(389,85,0,195,'Set bộ Hoodie kèm CV kẻ'),(390,76,0,195,'<div class=\"tab-content active showContent\">\r\n<p>Set đồ gồm áo hoodie có mũ, dáng suông và chân váy chữ A. Thiết kế hoodie cá tinh với dáng suông trẻ trung cùng dây điều chỉnh. Chân váy chữ A độ dài trên đầu gối, tôn dáng người mặc. </p>\r\n<p>Thiết kế mang tính ứng dụng cao, phù hợp cho các cô nàng diện nơi công sở và đi chơi. Áo và chân váy dễ dàng tách lẻ set giúp nàng thỏa sức mix&amp;match với nhiều items khách nhau. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(391,85,0,196,'Set thun bộ chữ Y'),(392,76,0,196,'<div class=\"tab-content active showContent\">\r\n<p>Bản phối áo kiểu kết hợp quần jogger cá tính là đã mang đến thiết kế  set bộ hữu dụng cho mùa Thu - Đông tới đây. </p>\r\n<p>Áo cổ lọ kéo khóa, dáng croptop hơi thụng, bo gấu và bo tay. Trước ngực có tạo điểm nhấn bằng hình thêu chữ Y sắc nét. Quần Jogger cạp chun, kết hợp dây điều chỉnh và bo gấu nhẹ. </p>\r\n<p>Chất liệu nỉ thun cao cấp, mềm mịn, giữ ấm tốt, không gây kích ứng khi mặc. Bạn có thể mix quần với giày thể thao là đã có ngay set đồ năng động, hiện đại. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(393,85,0,197,'Set Áo Croptop Hoodie'),(394,76,0,197,'<div class=\"tab-content active showContent\">\r\n<p>Set áo hoddie dáng croptop trẻ trung, cổ mũ liền có dây rút, tay và gấu áo bo tròn. Điểm nhấn trước ngực in chữ Stay Awesome bền màu, không bong. Quần jogger eo chun co giãn có dây rút, 2 túi chéo 2 bên, gấu quần chun bó năng động. Chất liệu vải thun dày dặn, giữ nhiệt tốt phù hợp với tiết trời se lạnh.</p>\r\n<p>Set đồ phối cùng giày sneakers là nàng đã có một outfit đi chơi, dạo phố đầy cá tính!</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n</div>'),(395,85,0,198,'Set áo thun kẻ và chân váy'),(396,76,0,198,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế áo dài tay, dáng suông, cổ bản to cách điệu có khóa kéo. Đây là thiết kế áo \"quốc dân\" dành cho mùa lạnh bởi sự tối giản nhưng không đơn giản, mang lại sự thoải mái và trẻ trung cho người mặc. Chân váy đi kèm dáng bút chì, cạp cao có khóa kéo phía sau, điểm nhất là 2 túi vuông viền đen phía trước.</p>\r\n<p>Chất liệu vải thun mềm nhẹ, giữ ấm hiệu quả. Họa tiết kẻ vuông thời thượng cùng màu sắc trung tính đem lại cảm giác ấm áp cho ngày lạnh.</p>\r\n<p>Nàng chỉ cần diện full set là sẽ có ngay 1 outfit trendy và thời thượng. Ngoài ra, dáng áo khoác này có thể phối hợp với quần ống rộng, ống suông, quần jean các loại, chân váy dễ dàng diện cùng nhiều kiểu áo.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại. </p>\r\n</div>'),(397,85,0,199,'Set đồ thun GROWTH'),(398,76,0,199,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun dáng suông với độ dài vừa phải, tay ngắn, cổ tròn. Phía trước là dòng chữ Growth trên nền in màu hồng san hô. Phần tay áo gập nếp theo phong cách độc đáo và mới lạ hiện nay. Áo có độ ôm vừa phải, gọn gàng và chỉn chu dễ dàng để phối hợp cùng nhiều item khác nhau.</p>\r\n<p>Quần đùi eo chun co giãn thoải mái.</p>\r\n<p>Một set đồ năng động nhưng không kém phần nữ tính dành cho mọi cô nàng. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 168 cm</p>\r\n<p><strong>Cân nặng:</strong> 52 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-62-95 cm</p>\r\n<p>Mẫu mặc size S</p>\r\n</div>'),(399,85,0,200,'Set bộ thun bo gấu'),(400,76,0,200,'<div class=\"tab-content active showContent\">\r\n<p>Set bộ với áo thun cổ tròn, tay dài. Dáng áo bo gấu, bên hông có 3 khuy cài tạo kiểu. Chân váy MS 30B8536 dáng xòe đồng bộ, cài khóa kéo ẩn phía sau. Họa tiết đan hình quả trám nổi bật.</p>\r\n<p>Set bộ vừa trẻ trung, vừa mang đến sự ấm áp nhờ vào chất liệu thun dày dặn. Nàng chẳng cần phải suy nghĩ mix và match quá nhiều mà vẫn có set đồ thanh lịch và tươi trẻ nhất.</p>\r\n<p>Màu sắc: Ghi Khói - Hồng</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<p><strong>Chiều cao:</strong> 1m66<br /><strong>Cân nặng: </strong>48kg<br /><strong>Số đo 3 vòng:</strong> 78-61-88</p>\r\n</div>'),(401,85,0,201,'Áo khoác thun cổ mũ'),(402,76,0,201,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác thun cổ mũ có dây kéo rút. Dây khóa kéo bằng kim loại phía trước. Mặc cùng set với áo croptop MS 17B8996 và áo khoác MS 77B8996</p>\r\n<p>Dáng áo để phối hợp với quần ống rộng, ống suông, quần jean các loại. Mặc khoác ra ngoài, mua thu sẽ giúp bạn trở nên năng động và trẻ trung hơn bao giờ hết. Thiết kế must-have cho các cô nàng trong tủ đồ nhà mình!</p>\r\n<p>Màu sắc: Trắng - Đen - Be</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m66</li>\r\n<li><em><strong>Cân nặng:</strong></em> 48kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-61-88</li>\r\n</ul>\r\n</div>'),(403,85,0,202,'Áo khoác gió cổ mũ'),(404,76,0,202,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác gió cổ mũ có dây kéo rút, trước cổ có dây kéo khóa thẳng. Tay áo dài bo chun co giãn. Dây kéo rút gấu áo. Có thể mix cùng quần đồng bộ MS 22M6881</p>\r\n<p>• Chất liệu: Polyester 100%. Có khả năng chống nhăn, dễ dàng làm sạch, độ bền cao và khả năng chống nước và cháy.<br />• Thiết kế: Áo khoác với chất liệu 100% Polyester có độ bền cao, nhiều ưu điểm vượt trội như khả năng khán nước, thoát ẩm, có khả năng chống tia UV, khán khuẩn, nấm mốc cực kỳ tốt.<br />• Phù hợp: Vui chơi, dạo phố, đi học, đi làm, tập luyện thể thao.</p>\r\n<p>Màu sắc: Nhiều màu</p>\r\n<p><strong>Mẫu mặc size M:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m70</li>\r\n<li><em><strong>Cân nặng:</strong></em> 47kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-60-90</li>\r\n</ul>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(405,85,0,203,'Set bộ nỉ Greatness'),(406,76,0,203,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ mũ có dây kéo rút, dài tay cổ áo bo. Dáng croptop. Trang trí chữ mặt trước. Quần đồng bộ cạp chun co giãn, gấu bó.</p>\r\n<p>Chất liệu thun mềm mang đến cảm giác dễ chịu và thoải mái cho người mặc. Đừng quên mặc cùng áo cùng set phối cùng giày thể thao giúp bạn có set đồ trẻ trung, năng động.</p>\r\n<p>Màu sắc: Bạc - Nude</p>\r\n<p><strong>Mẫu mặc size M:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m70</li>\r\n<li><em><strong>Cân nặng:</strong></em> 47kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-60-90</li>\r\n</ul>\r\n</div>'),(407,85,0,204,'Set bộ nỉ Greatness II'),(408,76,0,204,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ mũ có dây kéo rút, dài tay cổ áo bo. Dáng croptop. Trang trí chữ mặt trước. Quần đồng bộ cạp chun co giãn, gấu bó.</p>\r\n<p>Chất liệu thun mềm mang đến cảm giác dễ chịu và thoải mái cho người mặc. Đừng quên mặc cùng áo cùng set phối cùng giày thể thao giúp bạn có set đồ trẻ trung, năng động.</p>\r\n<p>Màu sắc: Bạc - Nude</p>\r\n<p><strong>Mẫu mặc size M:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m70</li>\r\n<li><em><strong>Cân nặng:</strong></em> 47kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-60-90</li>\r\n</ul>\r\n</div>'),(409,85,0,205,'Quần dạ ống đứng'),(410,76,0,205,'<div class=\"tab-content active showContent\">\r\n<p>Cho dù thời trang có bất kỳ biến số nào xuất hiện, gam màu đen quyền lực vẫn luôn giữ vững ngôi vương trong hàng trăm màu sắc thời trang, mang đến các quý cô vẻ ngoài đầy sức hút bí ẩn.</p>\r\n<p>Thiết kế nằm trong BST EXPRESS tham gia trình diễn tại show thời trang FALL/WINTER 2023, nơi những giá trị đích thực được đánh thức và tỏ bày thông qua các thiết kế cao cấp nhất! </p>\r\n<p>Quần suông, ống đứng với chất liệu dạ gân nổi bật, thích hợp thời tiết Thu Đông. Quần thiết kế cạp cao, dấu khuy, giúp tôn hông và che khuyết điểm tốt. Bạn có thể mix quần cùng nhiều kiểu áo khác nhau để tăng tính thời trang cũng như tạo nên phong cách riêng của mình. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(411,85,0,206,'Quần suông kẻ viền'),(412,76,0,206,'<div class=\"tab-content active showContent\">\r\n<p>Lựa chọn thời trang vừa tiện ích vừa năng động cho nàng qua thiết kế quần suông rút gấu mới nhất. Quần cạp cao, ống suông, độ dài qua mắt cá chân. Gấu quần thiết kế dây rút điều chỉnh nên quần có thể mặc được hai kiểu đó là kiểu suông hay kiểu jogger. </p>\r\n<p>Bạn tham khảo mix quần cùng áo thun và giày thể thao để tạo nên những outfits cá tinh, thời trang nhất. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(413,85,0,207,'Quần dài ống suông kéo khóa'),(414,76,0,207,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài ống suông, cạp cao, kéo khóa. Quần có 2 túi chéo 2 bên tiện lợi. thiết kế dáng đứng, suông nhẹ mang đến sự thoải mái, hiện đại. Chất liệu Tuysi giữ phom hiệu quả, không bám dính mồ hôi gây khó chịu nên nàng sẽ cảm thấy rất thoải mái khi mặc. Thích hợp mix cùng các kiểu áo sơ mi, áo thun kiểu và phụ kiện tạo vẻ ngoài sang trọng nơi công sở hay sành điệu khi đi làm, họp hành hay những buổi gặp gỡ quan trọng.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(415,85,0,208,'Tana Pants - Quần suông cách điệu'),(416,76,0,208,'<div class=\"tab-content active showContent\">\r\n<p>Tana Pants nằm trong BST EXPRESS tham gia trình diễn tại show thời trang FALL/WINTER 2023, nơi những giá trị đích thực được đánh thức và tỏ bày thông qua các thiết kế cao cấp nhất! </p>\r\n<p>Quần dáng suông, ống rộng. Thiết kế chiết ly thân trước tạo điểm nhấn cũng như tăng sự mềm  mại và uyển chuyển. Thiết kế  là câu trả lời hoàn hảo cho những ngày không biết biết măc gì. Những cô nàng yêu thích phối áo croptop hay cách mặc sơ vin chắc hẳn sẽ rất ưng ý item này. </p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n</div>'),(417,85,0,209,'Quần suông chiết ly'),(418,76,0,209,'<div class=\"tab-content active showContent\">\r\n<p>Quần ống suông thiết kế chiết ly đơn giản nhưng thanh lịch. Item dễ dàng mix với nhiều kiểu áo khác nhau để tạo nên phong cách thời trang trẻ trung và hiện đại.</p>\r\n<p>Quần có thể được mặc đi làm hoặc đi chơi, phù hợp với nhiều hoàn cảnh khác nhau. Không chỉ đẹp mắt, sản phẩm còn đảm bảo sự thoải mái khi mặc, giúp bạn dễ dàng di chuyển và hoạt động trong suốt ngày dài.</p>\r\n<p>Ngoài ra, chất liệu vải tuytsi còn mang đến sự mềm mại và thoải mái khi mặc.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(419,85,0,210,'Quần suông ống đính khuy'),(420,76,0,210,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài ống suông, độ dài qua mắt cá chân và có chiết ly thân trước. Gấu quần phối khuy kim loại tạo điểm nhấn.</p>\r\n<p>Thiết kế dáng suông rộng mang đến sự thoải mái, hiện đại. Chất liệu Tuysi giữ phom hiệu quả, không bám dính mồ hôi gây khó chịu nên nàng sẽ cảm thấy rất thoải mái khi mặc. Thích hợp mix cùng các kiểu áo sơ mi, áo thun kiểu và phụ kiện tạo vẻ ngoài sang trọng nơi công sở hay sành điệu khi đi làm, họp hành hay những buổi gặp gỡ quan trọng.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(421,85,0,211,'Quần suông đính khuy sườn'),(422,76,0,211,'<div class=\"tab-content active showContent\">\r\n<p>- Quần suông, tạo ly giữa, độ dài qua mắt cá chân. Thiết kế cạp cao, hách dáng  và che khuyết điểm tốt. </p>\r\n<p>- Phần cạp hai bên được tạo điểm nhấn khuy nổi giúp quần biến mất sự cứng nhắc, tăng vẻ nữ tính, điệu đà. </p>\r\n<p>- Thiết kệ lựa chọn chất liệu tuysi mềm mại, giữ form tốt.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(423,85,0,212,'Quần dài ống rộng'),(424,76,0,212,'<div class=\"tab-content active showContent\">\r\n<p>Quần suông ống rộng, độ dài đến mắt cá chân tôn dáng. Quần cạp cao eo bản to may viền tạo điểm nhấn. 2 túi chéo 2 bên vừa tiện lợi.</p>\r\n<p>Chất liệu tuysi là loại vải cao cấp, là sự lựa chọn hàng đầu của các nhà mốt dành cho các thiết kế đòi hỏi sự thanh lịch mà vẫn đảm bảo sự thoải mái. Với màu sắc trung tính và form dáng trẻ trung, đây chính là mẫu quần \"must-have\" cho tủ đồ của các cô nàng.</p>\r\n<p>Với mẫu quần ống suông họa tiết kẻ các nàng có thể dễ dàng kết hợp với nhiều kiểu áo khác nhau để diện hàng ngày, đi làm, đi chơi đều phù hợp.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(425,85,0,213,'Quần Chiffon dập ly dáng dài'),(426,76,0,213,'<div class=\"tab-content active showContent\">\r\n<p>Quần dập ly dáng suông dài đến mắt cá chân tôn dáng với thiết kế 2 túi chéo 2 bên tiện lợi cho các nàng có thể đựng điện thoại khi ra ngoài. Thiết kế quần dập ly bằng chất liệu Chifon mềm mại, bay bổng phù hợp với nhiều dáng người khác nhau. Đặc biệt bên trong có kèm theo một lớp lót ngắn giúp nàng tự tin, thoải mái hơn khi sử dụng.</p>\r\n<p>Với mẫu quần Chifon dập ly màu đen các nàng có thể dễ dàng kết hợp với nhiều kiểu áo khác nhau để diện hàng ngày đi làm, đi chơi đều phù hợp.</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(427,85,0,214,'Quần ống suông họa tiết kẻ'),(428,76,0,214,'<div class=\"tab-content active showContent\">\r\n<p>Quần suông ống rộng, độ dài đến mắt cá chân tôn dáng. Quần cạp cao xếp ly, thiết kế 2 túi chéo 2 bên vừa tiện lợi vừa tạo điểm nhấn bởi chi tiết nắp túi và khuy đính độc đáo.</p>\r\n<p>Chất liệu tuysi là loại vải cao cấp, là sự lựa chọn hàng đầu của các nhà mốt dành cho các thiết kế đòi hỏi sự thanh lịch mà vẫn đảm bảo sự thoải mái. Với màu sắc và họa tiết kẻ trendy, đây chính là mẫu quần \"must-have\" cho tủ đồ của các cô nàng.</p>\r\n<p>Với mẫu quần ống suông họa tiết kẻ các nàng có thể dễ dàng kết hợp với nhiều kiểu áo khác nhau để diện hàng ngày, đi làm, đi chơi đều phù hợp.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 163 cm</p>\r\n<p><strong>Cân nặng: </strong> 47 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-61-90 cm</p>\r\n<p>Mẫu mặc size S Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(429,85,0,215,'Quần dài phối đai'),(430,76,0,215,'<div class=\"tab-content active showContent\">\r\n<p>- Quần dài suông, ống rộng</p>\r\n<p>- Cạp cao, phối đai vải cùng màu</p>\r\n<p>- Phía trước có 2 túi chéo, sau có túi giả</p>\r\n<p>- Chất liệu tuysi mềm mại, giữ form tốt</p>\r\n<p>- Mix cùng áo blazer MS 67M8069. Phù hợp đi làm, đi sự kiện.</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n</div>'),(431,85,0,216,'Quần suông dài cạp tạo kiểu'),(432,76,0,216,'<div class=\"tab-content active showContent\">\r\n<p>Quần dáng suông, ống đứng. Thiết kế eo buộc dây tạo kiểu.</p>\r\n<p>Ai nói thời trang công sở là nhàm chán? Với thiết kế tinh tế đến từ IVY moda, phong cách casual của nàng sẽ được nâng lên tầm cao mới. Một chiếc quần Tây với dáng xuông là sự lựa chọn hoàn hảo cho những ngày chẳng biết măc gì. Những cô nàng yêu thích cách mặc sơ vin chắc hẳn sẽ rất ưng ý item này. Phần đai eo đầy độc đáo với thiết kế móc cài lệch. Đây chính là điểm nhấn đắt giá cho chiếc quần này.</p>\r\n</div>'),(433,85,0,217,'Quần bò phối túi sườn'),(434,76,0,217,'<div class=\"tab-content active showContent\">\r\n<p>Quần ống suông, cạp cao tôn dáng, độ dài ngang mắt cá chân. Quần tạo điểm nhấn nổi bật qua các điểm chạm túi với 2 túi sườn, 2 túi sau và 1 túi hộp cá tính. </p>\r\n<p>Thiết kế lựa chọn chất liệu demin, độ bền màu cao, đứng form, không bai nhão theo thời gian</p>\r\n<p>Bạn có thể mix quần với nhiều kiểu áo khác nhau để tạo nên outfit thời thượng, trẻ trung, hiện đại. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(435,85,0,218,'Quần Jeans suông xanh sáng'),(436,76,0,218,'<div class=\"tab-content active showContent\">\r\n<p>Quần jeans dáng suông che khuyết điểm phần đùi hiệu quả, độ dài ngang mắt cá chân, cạp sử dụng khóa và khuy kim loại. Chất liệu denim có độ bền cực kỳ cao cùng màu sắc xanh lơ đậm đánh bạc dễ dàng phối với nhiều kiểu áo, mang lại dáng vẻ trẻ trung cho người mặc. </p>\r\n<p>Mix quần cùng áo sơ mi, áo thun... để có set đồ đi làm, đi chơi năng động và không kém phần cá tính.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(437,85,0,219,'Quần Jeans Skinny Basic'),(438,76,0,219,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài bò cạp cao, kiểu dáng Skinny trẻ trung, sử dụng khóa và khuy kim loại. Quần có độ co giãn, dáng ôm nhưng diện vẫn vô cùng thoải mái.</p>\r\n<p>Quần sử dụng chất liệu denim có độ bền cực kỳ cao. Sự dày dặn của chất liệu này giúp các sản phẩm làm từ vải denim luôn bền bỉ theo thời gian.</p>\r\n<p>Bạn có thể mix quần cùng áo sơ mi, áo thun... để có set đồ đi làm, đi chơi năng động và không kém phần cá tính.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(439,85,0,220,'Quần jeans suông xanh đậm'),(440,76,0,220,'<div class=\"tab-content active showContent\">\r\n<p>Quần jeans dáng suông, cạp cao tôn dáng cùng độ dài ngang mắt cá chân.</p>\r\n<p>Quần có 2 túi sườn và 2 túi sau.</p>\r\n<p>Thiết kế basic cơ bản, trẻ trung, hiện đại, dễ mix với nhiều kiểu áo khác nhau. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(441,85,0,221,'Quần lửng jeans gập gấu'),(442,76,0,221,'<div class=\"tab-content active showContent\">\r\n<p>Quần jean dáng đứng, độ dài trên mắt cá chân. Thiết kế  cạp cao tôn dáng cùng màu xanh đậm phối chỉ nâu tinh tế, rất đẹp mắt. </p>\r\n<p>Quần tạo điểm nhấn gập gấu thời trang, mix được với nhiều kiểu áo khác nhau. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(443,85,0,222,'Quần jeans ống loe nhẹ'),(444,76,0,222,'<div class=\"tab-content active showContent\">\r\n<p>Quần jeans ống lọe nhẹ, dáng đứng, độ dài ngang mắt cá chân, cạp sử dụng khóa và khuy kim loại. Chất liệu denim có độ bền cực kỳ cao cùng màu sắc xanh sẫm dễ dàng phối với nhiều kiểu áo, mang lại dáng vẻ trẻ trung cho người mặc. </p>\r\n<p>Quần tôn  dáng, có thể mix cùng áo sơ mi, áo thun... để có set đồ đi làm, đi chơi năng động và không kém phần cá tính.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(445,85,0,223,'Quần jeans ống đứng mài đùi'),(446,76,0,223,'<div class=\"tab-content active showContent\">\r\n<p>Quần jeans ống dứng, dáng lửng, cạp cao, khuy kim loại và tôn dáng. </p>\r\n<p>Quần có màu xanh than sáng, đùi được mài bạc hơn so với tổng thể để tạo nét nổi bật. </p>\r\n<p>Sử dụng chất liệu demin cao cấp, có độ bền màu cao, càng mặc càng thích. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(447,85,0,224,'Quần Jeans Baggy'),(448,76,0,224,'<div class=\"tab-content active showContent\">\r\n<p>Mẫu quần Jeans Baggy cạp cao được lựa chọn là item không thế thiếu trong tủ đồ của bất kì bạn nữ nào. Với chất liệu denim cao cấp, sản phẩm có độ bền cao, đảm bảo bạn có thể mặc nó lâu dài mà không lo sợ sự mài mòn hay rách.</p>\r\n<p>Kiểu dáng Baggy, ống ôm vừa phải tạo ra sự cân đối và thanh lịch cho thân hình của người mặc. Độ dài ngang mắt cá chân giúp tôn lên đôi chân, thiết kế lưng cao của sản phẩm giúp tạo hiệu ứng thon gọn cho vùng bụng và che khuyết điểm nếu có.</p>\r\n<p>Thiết kế có thể dễ dàng phối với nhiều trang phục khác nhau. Bạn có thể kết hợp với áo thun tạo nên một phong cách thoải mái và năng động. Hoặc có thể mix cùng áo sơ mi và giày cao gót để có một vẻ ngoài lịch sự và sang trọng. Bạn cũng có thể thêm phụ kiện như mũ, túi xách hay dây nịt để tạo điểm nhấn cho trang phục.</p>\r\n<p>Với quần jean lưng cao này, bạn sẽ cảm nhận được sự tự tin và thoải mái trong mọi hoàn cảnh. Sản phẩm này không chỉ mang đến vẻ thời trang mà còn giúp bạn cảm thấy tự tin với vóc dáng của mình.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 163 cm</p>\r\n<p><strong>Cân nặng: </strong> 47 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-61-90 cm</p>\r\n<p>Mẫu mặc size S Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(449,85,0,225,'Quần jeans túi vuông'),(450,76,0,225,'<div class=\"tab-content active showContent\">\r\n<p>Hách dáng cùng mẫu quần jeans ống suông mới nhất. Nàng dễ dàng mix với nhiều kiểu áo khác nhau để thể hiện vẻ đẹp tự tin, cá tính của mình. </p>\r\n<p>Màu xám khói kết hợp thiết kế thời thượng, chỉ mới liếc nhìn đã đủ thấy vẻ đẹp ấn tượng mà items mang lại. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 163 cm</p>\r\n<p><strong>Cân nặng: </strong> 47 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-61-90 cm</p>\r\n<p>Mẫu mặc size S Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(451,85,0,226,'Quần jeans loe xẻ gấu'),(452,76,0,226,'<div class=\"tab-content active showContent\">\r\n<p>Đầu tuần chỉn chu và lịch sự với mẫu quần jean form ôm, ống xẻ gấu loe nhẹ. Chất liệu Demin cao cấp, có độ co giãn nhẹ, diện thoải mái không lo bí bách. Bạn có thể lựa chọn mix quần cùng nhiều kiểu áo khác nhau thêm một đôi cao gót sẽ trở thành bộ đôi hách dáng hoàn hảo, không thể bỏ lỡ. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 163 cm</p>\r\n<p><strong>Cân nặng: </strong> 47 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-61-90 cm</p>\r\n<p>Mẫu mặc size S Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(453,85,0,227,'Quần jeans lưng cao'),(454,76,0,227,'<div class=\"tab-content active showContent\">\r\n<p>Với chất liệu denim cao cấp, sản phẩm có độ bền cao, đảm bảo bạn có thể mặc nó lâu dài mà không lo sợ sự mài mòn hay rách.</p>\r\n<p>Kiểu dáng ống suông đứng tạo ra sự cân đối và thanh lịch cho thân hình của người mặc. Độ dài ngang mắt cá chân giúp tôn lên đôi chân, thiết kế lưng cao của sản phẩm giúp tạo hiệu ứng thon gọn cho vùng bụng và che khuyết điểm nếu có.</p>\r\n<p>Thiết kế có thể dễ dàng phối với nhiều trang phục khác nhau. Bạn có thể kết hợp với áo thun tạo nên một phong cách thoải mái và năng động. Hoặc có thể mix cùng áo sơ mi và giày cao gót để có một vẻ ngoài lịch sự và sang trọng. Bạn cũng có thể thêm phụ kiện như mũ, túi xách hay dây nịt để tạo điểm nhấn cho trang phục.</p>\r\n<p>Với quần jean lưng cao này, bạn sẽ cảm nhận được sự tự tin và thoải mái trong mọi hoàn cảnh. Sản phẩm này không chỉ mang đến vẻ thời trang mà còn giúp bạn cảm thấy tự tin với vóc dáng của mình.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(455,85,0,228,'Quần jeans ống đứng'),(456,76,0,228,'<div class=\"tab-content active showContent\">\r\n<p>Mang phong cách trẻ trung và năng động, sản phẩm quần jeans ống đứng với chất liệu cotton tuyển chọn sẽ đem đến cảm giác thông thoáng và mềm mại khi tiếp xúc, giúp bạn cảm thấy thoải mái và dễ chịu suốt cả ngày dài mặc jeans. Sợi vải spandex được kết hợp vào tạo nên chất liệu đàn hồi, điều này giúp quần jean ôm vừa vặn và thoải mái, đồng thời tăng tính bền bỉ, cho phép bạn mặc lâu dài mà không lo lớp vải bị biến dạng hay mất form.</p>\r\n<p>Với kiểu dáng quần suông, ống đứng, thiết kế giúp tôn lên vẻ đẹp của đôi chân thon gọn. Bạn có thể tự tin diện quần jean này trong nhiều dịp khác nhau, từ đi làm đến dạo phố hay gặp gỡ bạn bè. Bạn có thể kết hợp nó với áo thun đơn giản và sneakers để có một phong cách năng động hàng ngày, hoặc kết hợp với áo sơ mi và giày cao gót để tạo nên một vẻ ngoài lịch sự và thời trang hơn. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(457,85,0,229,'Quần ống loe đính khuy'),(458,76,0,229,'<div class=\"tab-content active showContent\">\r\n<p>- Quần dáng ống loe, chiều dài qua mắt cá chân. Thiết kế quần cạp cao, bản to và có khóa kéo ẩn.</p>\r\n<p>- Thân trên quần dáng ôm body giúp tôn vòng ba, tạo hiệu ứng chân dài cực tốt. Thân dưới quần ống loe sang trọng, thời thượng. Quần tạo điểm nhấn qua các chi tiết khuy nổi bật ở cạp và phần thân trên. Các khuy sắp xếp đồng đều, khi sơ vin sẽ rất đẹp. </p>\r\n<p>- Nàng mix cùng áo sơ mi, áo thun là hoàn thiện outfit đi làm, đi học hay đi chơi.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(459,85,0,230,'Quần ống loe Tuysi'),(460,76,0,230,'<div class=\"tab-content active showContent\">\r\n<p>Quần thiết kế ống loe, chất liệu Tuysi, có 2 túi chéo 2 bên. Quần có độ dài qua mắt cá chân, cạp cao tôn hông, che khuyết điểm tốt. </p>\r\n<p>Những chiếc quần loe luôn đem đến vẻ đẹp cổ điển, thời thượng cùng sự sang trọng cần thiết cho các quý cô. Với một chiếc quần Tuysi như thế này, nàng có thể chọn phối cùng nhiều trang phục khác nhau, từ áo kiểu năng động cho đến áo sơ mi thanh lịch.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(461,85,0,231,'Quần dài ống loe xẻ trước'),(462,76,0,231,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài cạp cao xếp ly, 2 túi chéo 2 bên tiện lợi. Ống quần loe và xẻ dài mặt trước của gấu. Cài bằng dây khóa ẩn phía trước.</p>\r\n<p>Quần ống loe, hay còn gọi là quần ống chuông, là kiểu quần thịnh hành vào những năm 1960 và 1970. Mang vẻ sành điệu vượt thời gian, khi mix cùng với các kiểu áo sơ mi hay áo thun đều mang cá tính riêng biệt. Nàng đừng quên phối cùng phụ kiện nhé!</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(463,85,0,232,'Quần dài ống loe'),(464,76,0,232,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài dáng ống loe, dài qua mắt cá chân. Phần hông ôm nhẹ và loe dần về cuối. Quần có đai cao cùng khuy cài.</p>\r\n<p>Thiết kế quần ống loe bắt trend sẽ biến nàng trở thành quý cô thời thượng nhất. Không hề kén dáng, item quần ống loe này dễ dàng khiến nàng sở hữu đôi chân dài miên man. Hãy phối cùng 1 đôi cao gót để nâng cao vẻ đẹp hình thể nàng nhé.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(465,85,0,233,'Quần dài xẻ gấu'),(466,76,0,233,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài cạp cao có đỉa, 2 túi chéo 2 bên. Ống quần loe và xẻ tà bên. Cài bằng dây khóa phía trước.</p>\r\n<p>Quần ống suông hơi 