u cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(477,85,0,239,'Quần ống loe may ly giữa II'),(478,76,0,239,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài dáng ống loe, dài qua mắt cá chân. Phần hông ôm nhẹ và loe dần về cuối. Quần cài khuy lệch, khóa kéo phía trước. Quần may ly nổi càng tăng thêm vẻ chỉnh chu, thanh lịch cho bộ trang phục của bạn.</p>\r\n<p>Thiết kế quần ống loe bắt trend sẽ biến nàng trở thành quý cô thời thượng nhất. Không hề kén dáng, item quần ống loe này dễ dàng khiến nàng sở hữu đôi chân dài miên man. Hãy phối cùng 1 đôi cao gót để nâng cao vẻ đẹp hình thể nàng nhé.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(479,85,0,240,'Quần ống loe xẻ gấu II'),(480,76,0,240,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài cạp cao có đỉa, 2 viền túi giả ngang 2 bên. Ống quần loe và xẻ dài mặt trước của gấu. Cài bằng dây khóa ẩn.</p>\r\n<p>Quần ống loe, hay còn gọi là quần ống chuông, là kiểu quần thịnh hành vào những năm 1960 và 1970. Mang vẻ sành điệu vượt thời gian, khi mix cùng với các kiểu áo sơ mi hay áo thun đều mang cá tính riêng biệt. Nàng đừng quên phối cùng phụ kiện nhé!</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<p><strong>Chiều cao: 1m66<br />Cân nặng: 48kg<br />Số đo 3 vòng: 78-61-88</strong></p>\r\n</div>'),(481,85,0,241,'Quần Baggy chiết ly'),(482,76,0,241,'<div class=\"tab-content active showContent\">\r\n<p>Quần baggy cạp cao, độ dài trên ngang mắt cá chân. Ống có độ ôm nhẹ, chiết ly thân trước thanh lịch, trẻ trung. 2 bên quần có 2 túi chéo. </p>\r\n<p>Thiết kế quần phù hợp để nàng phối cùng nhiều item khác nhau, từ thanh lịch công sở với sơ mi cho đến năng động trẻ trung cùng áo thun. Chất liệu Tuysi thoáng mát và thấm hút mồ hôi tốt. Hơn nữa còn giữ form quần suốt cả ngày dài.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(483,85,0,242,'Quần dáng đứng phối khuy'),(484,76,0,242,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài ống đứng, độ dài qua mắt cá chân và có chiết ly thân trước. Gấu quần phối khuy kim loại tạo điểm nhấn.</p>\r\n<p>Thiết kế quần dáng đứng mang đến sự thanh lịch, hiện đại. Chất liệu Tuysi giữ phom hiệu quả, không bám dính mồ hôi gây khó chịu nên nàng sẽ cảm thấy rất thoải mái khi mặc. Thích hợp mix cùng các kiểu áo sơ mi, áo thun kiểu và phụ kiện tạo vẻ ngoài sang trọng nơi công sở hay sành điệu khi đi làm, họp hành hay những buổi gặp gỡ quan trọng.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(485,85,0,243,'Quần baggy dây lưng thắt nơ'),(486,76,0,243,'<div class=\"tab-content active showContent\">\r\n<p>Với kiểu dáng ống đứng thanh thoát, chiếc quần này giúp tôn lên đôi chân dài và sẽ là sự lựa chọn hoàn hảo cho những buổi đi làm hay các sự kiện đặc biệt. Chất liệu tuýt si mềm mại và thoáng mát, giúp bạn cảm thấy thoải mái và tự tin suốt cả ngày dài.</p>\r\n<p>Điểm nhấn của chiếc quần là dây lưng buộc nơ, tạo nên một chi tiết độc đáo và nữ tính, tôn thêm nét quyến rũ cho người mặc. Bạn có thể điều chỉnh độ chặt của dây lưng để tạo nên phom dáng hoàn hảo và phù hợp với từng thân hình.</p>\r\n<p>Từ sự kết hợp tinh tế giữa kiểu dáng, chất liệu và điểm nhấn độc đáo, chiếc quần này chắc chắn sẽ trở thành một món đồ yêu thích trong tủ quần áo của bạn.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(487,85,0,244,'Quần baggy phối phụ kiện'),(488,76,0,244,'<div class=\"tab-content active showContent\">\r\n<p>Quần dáng baggy, chất liệu Tuysi mềm mại, đứng form. 2 túi chéo 2 bên phối với dây kim loại 1 bên tạo điểm nhấn. Cài bằng khóa kéo ẩn bên sườn.</p>\r\n<p>Những chiếc quần suông luôn đem đến vẻ phóng khoáng, tự do cùng sự sang trọng cần thiết cho các quý cô. Với một chiếc quần Tuysi như thế này, nàng có thể chọn phối cùng nhiều trang phục khác nhau, từ áo kiểu năng động cho đến áo sơ mi thanh lịch.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(489,85,0,245,'Quần baggy cạp phối phụ kiện'),(490,76,0,245,'<p>Quần baggy cạp cao, 2 bên phối đai phụ kiện tạo kiểu. Độ dài trên ngang mắt cá chân. Ống có độ ôm nhẹ, 2 túi chéo 2 bên tiện lợi.</p>\r\n<p>Thiết kế quần phù hợp để nàng phối cùng nhiều item khác nhau, từ thanh lịch công sở với sơ mi cho đến năng động trẻ trung cùng áo thun. Chất liệu Tuysi thoáng mát và thấm hút mồ hôi tốt. Hơn nữa còn giữ form quần suốt cả ngày dài.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại</p>'),(491,85,0,246,'Quần baggy lửng đai thắt nơ'),(492,76,0,246,'<div class=\"tab-content active showContent\">\r\n<p>Quần baggy xếp ly, ống lửng độ dài trên mắt cá chân. Cạp cao phối dây đai vải thắt nơ tạo điểm nhấn. Có 2 túi chéo và 2 viền túi giả phía sau. Cài bằng khóa kéo phía trước.</p>\r\n<p>Kiểu dáng quần baggy cổ điển giúp người mặc giấu được khuyết điểm về phần hông và đùi, đồng thời tôn lên phần eo thon, đôi chân dài. Phần cạp cách điệu làm mới cho tủ quần áo của bạn.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(493,85,0,247,'Quần baggy lửng xếp ly trước'),(494,76,0,247,'<div class=\"tab-content active showContent\">\r\n<p>Quần baggy cạp cao, độ dài trên ngang mắt cá chân. Ống có độ ôm nhẹ, chi tiết xếp ly trước thanh lịch, trẻ trung. 2 bên có 2 túi chéo. </p>\r\n<p>Thiết kế quần phù hợp để nàng phối cùng nhiều item khác nhau, từ thanh lịch công sở với sơ mi cho đến năng động trẻ trung cùng áo thun. Chất liệu Tuysi thoáng mát và thấm hút mồ hôi tốt. Hơn nữa còn giữ form quần suốt cả ngày dài.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n</div>'),(495,85,0,248,'Quần baggy viền chỉ trắng'),(496,76,0,248,'<div class=\"tab-content active showContent\">\r\n<p>Quần baggy lửng độ dài ngang mắt cá chân, thiết kế cạp cao bản to, khóa kéo ẩn cùng đường viền may chỉ nổi khác màu tạo điểm nhấn. Phía trước là 2 túi chéo 2 bên tiện lợi. </p>\r\n<p>Chất liệu được sử dụng là chất vải tuysi cao cấp. Vải tuysi mềm nhẹ, thoáng mát, ít nhăn và giữ form dáng tốt. Quần là li giữa càng tăng thêm vẻ chỉn chu cho trang phục công sở của nàng.</p>\r\n<p>Mang kiểu dáng đơn giản, rộng vừa phải, dễ mặc và dễ phối cùng nhiều kiểu áo khác nhau, phù hợp cho nàng diện đi làm, đi học hay đi chơi.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 163 cm</p>\r\n<p><strong>Cân nặng: </strong> 47 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-61-90 cm</p>\r\n<p>Mẫu mặc size S Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(497,85,0,249,'Quần baggy viền chỉ xanh'),(498,76,0,249,'<div class=\"tab-content active showContent\">\r\n<p>Quần baggy lửng độ dài ngang mắt cá chân, thiết kế cạp cao bản to, khóa kéo ẩn cùng đường viền may chỉ nổi khác màu tạo điểm nhấn. Phía trước là 2 túi chéo 2 bên tiện lợi. </p>\r\n<p>Chất liệu được sử dụng là chất vải tuysi cao cấp. Vải tuysi mềm nhẹ, thoáng mát, ít nhăn và giữ form dáng tốt. Quần là li giữa càng tăng thêm vẻ chỉn chu cho trang phục công sở của nàng.</p>\r\n<p>Mang kiểu dáng đơn giản, rộng vừa phải, dễ mặc và dễ phối cùng nhiều kiểu áo khác nhau, phù hợp cho nàng diện đi làm, đi học hay đi chơi.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 163 cm</p>\r\n<p><strong>Cân nặng: </strong> 47 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-61-90 cm</p>\r\n<p>Mẫu mặc size S Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(499,85,0,250,'Quần baggy viền chỉ đen'),(500,76,0,250,'<div class=\"tab-content active showContent\">\r\n<p>Quần baggy lửng độ dài ngang mắt cá chân, thiết kế cạp cao bản to, khóa kéo ẩn cùng đường viền may chỉ nổi khác màu tạo điểm nhấn. Phía trước là 2 túi chéo 2 bên tiện lợi. </p>\r\n<p>Chất liệu được sử dụng là chất vải tuysi cao cấp. Vải tuysi mềm nhẹ, thoáng mát, ít nhăn và giữ form dáng tốt. Quần là li giữa càng tăng thêm vẻ chỉn chu cho trang phục công sở của nàng.</p>\r\n<p>Mang kiểu dáng đơn giản, rộng vừa phải, dễ mặc và dễ phối cùng nhiều kiểu áo khác nhau, phù hợp cho nàng diện đi làm, đi học hay đi chơi.</p>\r\n<p><strong>Mẫu mặc size M</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(501,85,0,251,'Quần legging phối phụ kiện'),(502,76,0,251,'<div class=\"tab-content active showContent\">\r\n<p>Quần legging dáng dài tôn dáng với thiết kế 2 túi chéo 2 bên tiện lợi cho các nàng có thể đựng điện thoại khi ra ngoài. Thiết kế quần tạo điểm nhấn với chi tiết cạp phối phụ kiện kim loại vàng sang trọng giúp cho mẫu quần legging bớt phần nhàm chán, đơn điệu. Chi tiết khóa phía trước giúp những nàng có vòng hai đầy đặn \"giấu nhẹm\" khuyết điểm.</p>\r\n<p>Với mẫu quần legging đen các nàng có thể dễ dàng kết hợp với nhiều kiểu áo khác nhau để diện hàng ngày đi làm, đi chơi đều phù hợp.</p>\r\n<p><strong>Mẫu mặc size M</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n</div>'),(503,85,0,252,'Quần lửng ống đứng'),(504,76,0,252,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế quần lửng dáng ống đứng, eo cạp cao, chun bản to có dây rút. 2 túi vuông 2 bên. Chất liệu vải thô mềm mịn, dày dặn, mang lại cảm giác thoải mái tuyệt đối. Quần phối cùng áo phông, phù hợp diện đi chơi và ở nhà.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 169 cm</p>\r\n<p><strong>Cân nặng:</strong> 48 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>80-60-90 cm</p>\r\n<p>Mẫu mặc size S</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại. </p>\r\n</div>'),(505,85,0,253,'Quần sooc phối đai'),(506,76,0,253,'<div class=\"tab-content active showContent\">\r\n<p>Quần sooc cạp cao, cài bằng khóa kéo, thiết kế 2 túi chéo 2 bên tiện lợi. Ống suông kiểu rộng. Điểm nhấn là chi tiết tạo kiểu đai đính khuy bắt mắt. </p>\r\n<p>Thiết kế vải Tuysi mềm mại, dễ mặc, độ thấm hút tốt. Các sợi vải rất nhẹ và mềm mịn mang lại cảm thoải mái tuyệt đối khi diện. Kết hợp cùng áo kiểu hay áo thun là nàng đã có set đồ đi chơi ngày hè năng động.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(507,85,0,254,'Quần short cạp kiểu'),(508,76,0,254,'<div class=\"tab-content active showContent\">\r\n<p>Quần sooc cạp cao, cài bằng khóa kéo ẩn, 2 túi chéo 2 bên tiện lợi. Ống suông kiểu rộng, năng động, trẻ trung. Điểm nhấn là chi tiết cạp tạo các đường kẻ độc đáo</p>\r\n<p>Trên nền vải thô mềm mại, dễ mặc, độ thấm hút tốt. Các sợi vải rất nhẹ và mềm mịn mang lại cảm thoải mái tuyệt đối khi diện. Kết hợp cùng áo kiểu hay áo thun là nàng đã có set đồ đi chơi ngày hè năng động.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(509,85,0,255,'Quần sooc Organza dập ly'),(510,76,0,255,'<div class=\"tab-content active showContent\">\r\n<p>- Quần sooc cạp cao, dáng suông, ống đứng, thiết kế dập ly thân trước. </p>\r\n<p>- Thiết kế sử dụng chất liệu Organza cao cấp, đứng form, dày dặn, có độ bóng nhẹ</p>\r\n<p>- Quần có 2 túi 2 bên rất tiện lợi</p>\r\n<p>- Có thể mix quần cùng áo sơ mi, áo kiểu có chất liệu tương đồng, phù hợp diện khi đi chơi, đi tiệc.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 163 cm</p>\r\n<p><strong>Cân nặng: </strong> 47 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-61-90 cm</p>\r\n<p>Mẫu mặc size S Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(511,85,0,256,'Quần sooc Organza'),(512,76,0,256,'<div class=\"tab-content active showContent\">\r\n<p>- Quần sooc cạp cao, dáng suông, ống đúng</p>\r\n<p>- Chất liệu Organza cao cấp, đứng phom, dày dặn, có độ bóng nhẹ</p>\r\n<p>- 2 túi ẩn 2 bên </p>\r\n<p>- Khóa kéo phía sau</p>\r\n<p>- Hãy mix quần cùng áo sơ mi, áo kiểu có chất liệu tương đồng, phù hợp diện khi đi chơi, đi tiệc.</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 168 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>80-62-95 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n</div>'),(513,85,0,257,'Quần sooc viền ren'),(514,76,0,257,'<div class=\"tab-content active showContent\">\r\n<p>Quần sooc cạp cao, cài bằng khóa kéo ẩn phía trước. 2 túi chéo 2 bên tiện lợi. Ống suông kiểu rộng. Điểm nhấn là chi tiết may viền ren 2 bên sườn.</p>\r\n<p>Trên nền vải thô mềm mại, dễ mặc, độ thấm hút tốt. Các sợi vải rất nhẹ và mềm mịn mang lại cảm thoải mái tuyệt đối khi diện. Kết hợp cùng áo kiểu hay áo thun là nàng đã có set đồ đi chơi ngày hè năng động.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(515,85,0,258,'Quần sooc giả váy'),(516,76,0,258,'<div class=\"tab-content active showContent\">\r\n<p>Quần sooc ngắn, cạp cao mang lại sự trẻ trung và tôn dáng nàng. Thiết kế giả váy giúp nàng ăn diện thoải mái mà vẫn đậm chất tiểu thư.</p>\r\n<p>Chất liệu tuysi là loại vải cao cấp, là sự lựa chọn hàng đầu của các nhà mốt dành cho các thiết kế đòi hỏi sự thanh lịch, sang trọng mà vẫn đảm bảo sự thoải mái. Quần sooc từ chất liệu vải tuysi mềm nhẹ, thoáng mát, ít nhăn và giữ form dáng tốt.  Mix quần cùng nhiều kiểu áo khác nhau, phù hợp diện đi chơi, đi tiệc hay đi làm.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong>167 cm</p>\r\n<p><strong>Cân nặng: </strong>50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(517,85,0,259,'Quần sooc đai cạp đính phụ kiện'),(518,76,0,259,'<div class=\"tab-content active showContent\">\r\n<p>Sản phẩm thuộc BST Timeless và được trình diễn trong show thời trang Fall Winter 2022. Bộ sưu tập lấy cảm hứng từ phong cách thời trang Academia, cộng hưởng với những ý tưởng sáng tạo đầy xu hướng, mang đến diện mạo học thức vượt ra khỏi khái niệm sắc đẹp đơn thuần.</p>\r\n<p>Một thiết kế quần sooc basic mà bất kì cô nàng công sở cũng nên sở hữu. Những chiếc âu dài trở nên \"dừ\" và nhàm chán thì nàng hãy \"đổi gió\" bằng chiếc quần sooc dáng suông thoải mái, cạp cao tôn dáng giúp tạo kiểu sơ vin cực sang khi cạp có phối phụ kiện kim loại. Độ dài đến ngang đùi phù hợp nơi công sở. Quần có 2 túi chéo 2 bên tiện lợi và cài bằng khóa kéo phía sau.</p>\r\n<p>Chất liệu tuysi là loại vải cao cấp, là sự lựa chọn hàng đầu của các nhà mốt dành cho các thiết kế đòi hỏi sự thanh lịch, sang trọng mà vẫn đảm bảo sự thoải mái. Quần sooc từ chất liệu vải tuysi mềm nhẹ, thoáng mát, ít nhăn và giữ form dáng tốt. </p>\r\n<p>Thiết kế quần này nàng có thể diện khi đi làm, đi chơi. Chất liệu và kiểu dáng quần giúp nàng thỏa sức mix&amp;match cùng nhiều kiểu áo khác nhau, phù hợp với mọi phong cách mà nàng theo đuổi.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(519,85,0,260,'Quần sooc phối phụ kiện'),(520,76,0,260,'<p>Sản phẩm thuộc BST Timeless và được trình diễn trong show thời trang Fall Winter 2022. Bộ sưu tập lấy cảm hứng từ phong cách thời trang Academia, cộng hưởng với những ý tưởng sáng tạo đầy xu hướng, mang đến diện mạo học thức vượt ra khỏi khái niệm sắc đẹp đơn thuần.</p>\r\n<p>Một thiết kế quần sooc basic mà bất kì cô nàng công sở cũng nên sở hữu. Những chiếc âu dài trở nên \"dừ\" và nhàm chán thì nàng hãy \"đổi gió\" bằng chiếc quần sooc dáng suông thoải mái, cạp cao tôn dáng