 mọi phong cách mà nàng theo đuổi.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 167 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(523,85,0,262,'Quần lửng ống đứng phối đai'),(524,76,0,262,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế quần lửng ống đứng, cạp cao đục lỗ phối đai tạo điểm nhấn. Cài bằng khóa kéo phía trước. Có 2 túi chéo 2 bên. Chất liệu tuysi dày dặn, đứng phom mang lại cảm giác thoải mái mà vẫn giữ nét thanh lịch, lịch sự cho người mặc. Mix quần cùng áo thun, áo 2 dây là nàng đã có set đồ năng động đi dạo phố. Đây chính là chiếc quần \"must-have\" cho tủ đồ của các cô nàng bởi tính bền bỉ và không lo lỗi mốt!</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 168 cm</p>\r\n<p><strong>Cân nặng:</strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>80-62-95 cm</p>\r\n<p>Mẫu mặc size S</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại. </p>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(525,85,0,263,'Quần sooc ống suông'),(526,76,0,263,'<div class=\"tab-content active showContent\">\r\n<p>Quần sooc cạp cao, cài bằng khóa kéo bên hông, quần có túi chéo 2 bên. Dáng ống suông.</p>\r\n<p>Trên nền vải Tuysi mềm mại, dễ mặc, độ thấm hút tốt, luôn tạo cảm giác thoải mái cho người mặc và dễ dàng di chuyển, vận động. Quần mặc cùng áo sơ mi cách điệu sẽ hoàn thiện trang phục công sở vừa thanh lịch, vừa trẻ trung của nàng.</p>\r\n</div>'),(527,85,0,264,'Quần Sooc Dáng Ngắn'),(528,76,0,264,'<p>Quần sooc vải tuysi không co giãn. Cạp cao có đỉa đeo thắt lưng. Quần dáng ngắn cùng chất liệu nhẹ mát thích hợp mặc trong những ngày hè.</p>\r\n<p>Thiết kế quần trẻ trung, năng động phối cùng áo sơ mi hay áo thun basci giúp bạn có một set đồ dạo phố, đi chơi hay đi du lịch.</p>'),(529,85,0,265,'Quần jogger nữ'),(530,76,0,265,'<div class=\"tab-content active showContent\">\r\n<p>Quần jogger thiết kế ống dài bo gấu với đường gân dọc khỏe khoắn, cạp chun và 2 túi bên. Chất liệu thun dày mềm, mịn, nhẹ, thoáng, thấm hút mồ hôi và giữ ấm hiệu quả. Mặc cùng set với áo croptop MS 17B8996 và áo khoác MS 77B8996.</p>\r\n<p>Set bộ trẻ trung, năng động phù hợp với đi chơi, tập thể thao hay đơn giản là buổi gặp gỡ bạn bè thân quen ngày cuối tuần.</p>\r\n<p>Màu sắc: Đen - Be - Trắng - Đỏ Ruby</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m69</li>\r\n<li><em><strong>Cân nặng:</strong></em> 48kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 80-60-90</li>\r\n</ul>\r\n</div>'),(531,85,0,266,'Quần gió nữ cao cấp'),(532,76,0,266,'<div class=\"tab-content active showContent\">\r\n<p>Quần gió 2 lớp cạp chun co giãn thoải mái, gấu bo chun ôm chân. Dáng trẻ trung, khỏe khoắn. Phối cùng áo khoác đồng bộ MS 70M6881</p>\r\n<p>Không chỉ có thể mặc vào mỗi mùa đông mà các bạn nữ hoàn toàn có thể mặc áo khoác gió vào mùa hè để che nắng, che bụi, hay che mưa. Với nhiều công dụng, khi mặc thì gọn nhẹ, những bộ gió ngày càng được nhiều khách hàng tin tưởng và sử dụng. Được làm từ chất liệu chọn lọc, mẫu mã thời trang, nhiều màu sắc để lựa chọn.</p>\r\n<p>Màu sắc: Nhiều màu</p>\r\n<p><strong>Mẫu mặc size M:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m70</li>\r\n<li><em><strong>Cân nặng:</strong></em> 47kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-60-90</li>\r\n</ul>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(533,85,0,267,'Quần jogger nữ II'),(534,76,0,267,'<div class=\"tab-content active showContent\">\r\n<p>Quần jogger thiết kế ống dài bo gấu với đường gân dọc khỏe khoắn, cạp chun và 2 túi bên. Chất liệu thun dày mềm, mịn, nhẹ, thoáng, thấm hút mồ hôi và giữ ấm hiệu quả. Mặc cùng set với áo croptop MS 17B8996 và áo khoác MS 77B8996.</p>\r\n<p>Set bộ trẻ trung, năng động phù hợp với đi chơi, tập thể thao hay đơn giản là buổi gặp gỡ bạn bè thân quen ngày cuối tuần.</p>\r\n<p>Màu sắc: Đen - Be - Trắng</p>\r\n<p><strong>Mẫu mặc size M:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m70</li>\r\n<li><em><strong>Cân nặng:</strong></em> 47kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-60-90</li>\r\n</ul>\r\n</div>'),(535,85,0,268,'Quần gió nữ cao cấp - II'),(536,76,0,268,'<div class=\"tab-content active showContent\">\r\n<p>Quần gió 2 lớp cạp chun co giãn thoải mái, gấu bo chun ôm chân. Dáng trẻ trung, khỏe khoắn. Phối cùng áo khoác đồng bộ MS 70M6881</p>\r\n<p>Không chỉ có thể mặc vào mỗi mùa đông mà các bạn nữ hoàn toàn có thể mặc áo khoác gió vào mùa hè để che nắng, che bụi, hay che mưa. Với nhiều công dụng, khi mặc thì gọn nhẹ, những bộ gió ngày càng được nhiều khách hàng tin tưởng và sử dụng. Được làm từ chất liệu chọn lọc, mẫu mã thời trang, nhiều màu sắc để lựa chọn.</p>\r\n<p>Màu sắc: Bạc Hà - Hồng</p>\r\n<p><strong>Mẫu mặc size M:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m70</li>\r\n<li><em><strong>Cân nặng:</strong></em> 47kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-60-90</li>\r\n</ul>\r\n</div>'),(537,85,0,269,'Quần Jogger III'),(538,76,0,269,'<div class=\"tab-content active showContent\">\r\n<div class=\"tab-content active showContent\">\r\n<p>Quần jogger thiết kế ống dài bo gấu với đường gân dọc khỏe khoắn, cạp chun và 2 túi bên. Chất liệu thun dày mềm, mịn, nhẹ, thoáng, thấm hút mồ hôi và giữ ấm hiệu quả. Mặc cùng set với áo croptop MS 17B8996 và áo khoác MS 77B8996.</p>\r\n<p>Set bộ trẻ trung, năng động phù hợp với đi chơi, tập thể thao hay đơn giản là buổi gặp gỡ bạn bè thân quen ngày cuối tuần.</p>\r\n<p>Màu sắc: Đen - Be - Trắng - Đỏ Ruby</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m69</li>\r\n<li><em><strong>Cân nặng:</strong></em> 48kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 80-60-90</li>\r\n</ul>\r\n</div>\r\n</div>'),(539,85,0,270,'Jumpsuit Trễ vai tay bèo'),(540,76,0,270,'<div class=\"tab-content active showContent\">\r\n<p>Sản phẩm được làm từ chất liệu vải thô hai lớp, tạo cảm giác mềm mại và thoáng khí cho da. Chất liệu này cũng mang đến độ bền cao và giúp duy trì hình dáng của jumpsuit theo thời gian.Thiết kế trễ vai phối cùng chi tiết tay 2 tầng bèo nhẹ nhàng tạo nên vẻ ngoài độc đáo và phá cách.</p>\r\n<p>Jumpsuit trễ vai tay bèo là một sự kết hợp hoàn hảo giữa sự thoải mái và phong cách. Dễ dàng phối đồ với các phụ kiện và giày dép, thiết kế có thể được mặc trong nhiều dịp khác nhau, từ các buổi hẹn hò, tiệc tùng đến các sự kiện thời trang hay du lịch. Với sự kết hợp độc đáo giữa kiểu dáng trễ vai và tay bèo, jumpsuit này chắc chắn sẽ làm nổi bật phong cách cá nhân và thu hút sự chú ý của mọi người xung quanh.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 163 cm</p>\r\n<p><strong>Cân nặng: </strong> 47 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-61-90 cm</p>\r\n<p>Mẫu mặc size S</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(541,85,0,271,'Jumpsuit Hai dây phối bèo'),(542,76,0,271,'<div class=\"tab-content active showContent\">\r\n<p>Được chế tác từ chất liệu vải thô tinh tế, sản phẩm đem lại cảm giác thoải mái và thoáng mát mỗi khi diện.</p>\r\n<p>Jumpsuit được thiết kế với phần thân áo hai dây cúp ngực, tạo nên vẻ gợi cảm và nữ tính. Bên cạnh đó, thân áo của sản phẩm được may bằng 2 tầng bèo xếp tầng, mang đến một diện mạo phong cách và trẻ trung.</p>\r\n<p>Thiết kế là một lựa chọn tuyệt vời cho các dịp, từ buổi dạo phố đến các sự kiện đặc biệt. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(543,85,0,272,'Jumpsuit Hai dây phối bèo II'),(544,76,0,272,'<p>Được chế tác từ chất liệu vải thô tinh tế, sản phẩm đem lại cảm giác thoải mái và thoáng mát mỗi khi diện.</p>\r\n<p>Jumpsuit được thiết kế với phần thân áo hai dây cúp ngực, tạo nên vẻ gợi cảm và nữ tính. Bên cạnh đó, thân áo của sản phẩm được may bằng 2 tầng bèo xếp tầng, mang đến một diện mạo phong cách và trẻ trung.</p>\r\n<p>Thiết kế là một lựa chọn tuyệt vời cho các dịp, từ buổi dạo phố đến các sự kiện đặc biệt. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao: </strong> 167 cm</p>\r\n<p><strong>Cân nặng: </strong> 50 kg</p>\r\n<p><strong>Số đo 3 vòng: </strong>83-65-93 cm</p>\r\n<p>Mẫu mặc size M</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại</p>'),(545,85,0,273,'Bodysuit Ren'),(546,76,0,273,'<p>Bodysuit chất liệu vải ren mềm mịn, không gây ngứa, phần đáy có móc cài điều chỉnh độ dài ngắn. Phần ngực có gọng, dáng độn, mút độn tháo rời đc, phía trc đính logo ivy secret. Áo phối các đường vải khác tạo kiểu dáng corset.</p>'),(547,85,0,274,'Jumpsuit Lụa ống rộng'),(548,76,0,274,'<div class=\"tab-content active showContent\">\r\n<p>Jumpsuit trơn dáng suông, cổ V. Dáng áo không tay, vạt áo may dáng xòe, lượn sóng nhẹ. Dáng quần ống đứng, rộng, độ dài chạm gót. 2 bên có 2 túi chéo. Chất liệu lụa mềm nhẹ.</p>\r\n<p>Thiết kế Jumpsuit từ lụa mềm này sẽ là lựa chọn hoàn hảo cho chuyến du lịch của nàng. Chẳng cần mất công mix-match, chỉ với một thiết kế Jumpsuit, nàng đã có thể sẵn sàng xuống phố. Chất liệu lụa cao cấp cùng thiết kế tối giản nâng tầm phong cách của bộ trang phục. Nàng có thể thoải mái phối cùng những phụ kiện khác nhau.</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m66</li>\r\n<li><em><strong>Cân nặng:</strong></em> 48kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 78-61-88</li>\r\n</ul>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(549,85,0,275,'Jumpsuit Lụa suông trơn'),(550,76,0,275,'<div class=\"tab-content active showContent\">\r\n<p>Jumpsuit trơn dáng suông. Dáng áo không tay, vạt đổ từ đằng trước xuống đằng sau. Dáng quần ống đứng, rộng, độ dài chạm gót. 2 bên có 2 túi chéo. Chất liệu chính là lụa.</p>\r\n<p>Thiết kế Jumpsuit từ lụa mềm này sẽ là lựa chọn hoàn hảo cho chuyến du lịch của nàng. Chẳng cần mất công mix-match, chỉ với một thiết kế Jumpsuit, nàng đã có thể sẵn sàng xuống phố. Chất liệu lụa cao cấp cùng thiết kế tối giản nâng tầm phong cách của bộ trang phục. Nàng có thể thoải mái phối cùng những phụ kiện khác nhau.</p>\r\n<p>Màu sắc: Vàng nghệ - Xanh nước biển</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<p><strong>Chiều cao: </strong>1m68<br /><strong>Cân nặng:</strong> 52kg<br /><strong>Số đo 3 vòng:</strong> 83-62-95cm</p>\r\n</div>'),(551,85,0,276,'JUMPSUIT LỤA SUÔNG TRƠN II'),(552,76,0,276,'<div class=\"tab-content active showContent\">\r\n<p>Jumpsuit trơn dáng suông. Dáng áo không tay, vạt đổ từ đằng trước xuống đằng sau. Dáng quần ống đứng, rộng, độ dài chạm gót. 2 bên có 2 túi chéo. Chất liệu chính là lụa.</p>\r\n<p>Thiết kế Jumpsuit từ lụa mềm này sẽ là lựa chọn hoàn hảo cho chuyến du lịch của nàng. Chẳng cần mất công mix-match, chỉ với một thiết kế Jumpsuit, nàng đã có thể sẵn sàng xuống phố. Chất liệu lụa cao cấp cùng thiết kế tối giản nâng tầm phong cách của bộ trang phục. Nàng có thể thoải mái phối cùng những phụ kiện khác nhau.</p>\r\n<p>Màu sắc: Vàng nghệ - Xanh nước biển</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<p><strong>Chiều cao: </strong>1m68<br /><strong>Cân nặng:</strong> 52kg<br /><strong>Số đo 3 vòng:</strong> 83-62-95cm</p>\r\n</div>'),(553,85,0,277,'Jumpsuit Vest phối đai'),(554,76,0,277,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế Jumpsuit dáng suông, giữa eo được nhấn bằng đai cài. Phần áo dáng cổ vest, tay ngắn vén ống. Quần ống đứng, độ dài chạm mắt cá chân. Chất liệu chính là lụa mềm có độ bóng nhẹ.</p>\r\n<p>Những chiếc Jumpsuit đa năng chính là lựa chọn hàng đầu cho các quý cô hiện đại. Chẳng cần mix-match cầu kỳ, chỉ cần diện nguyên bộ Jumpsuit từ IVY moda, nàng đã có ngay một diện mạo hoàn chỉnh thu hút mọi ánh nhìn.</p>\r\n<p>Màu sắc: Đỏ ruby - Hồng san hô - Họa tiết Tím lavender</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<p>Chiều cao: 1m68<br /><strong>Cân nặng:</strong> 52kg<br /><strong>Số đo 3 vòng:</strong> 83-62-95cm</p>\r\n</div>'),(555,85,0,278,'Jumpsuit Vest phối đai II'),(556,76,0,278,'<p>Thiết kế Jumpsuit dáng suông. Phần áo dáng cổ vest, tay ngắn vén ống. Quần ống đứng, độ dài chạm mắt cá chân. Chất liệu chính là lụa mềm có độ bóng nhẹ.</p>\r\n<p>Những chiếc Jumpsuit đa năng chính là lựa chọn hàng đầu cho các quý cô hiện đại. Chẳng cần mix-match cầu kỳ, chỉ cần diện nguyên bộ Jumpsuit từ IVY moda, nàng đã có ngay một diện mạo hoàn chỉnh thu hút mọi ánh nhìn.</p>\r\n<p>Màu sắc: Đỏ ruby - Hồng san hô - Họa tiết Tím lavender</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<p>Chiều cao: 1m68<br /><strong>Cân nặng:</strong> 52kg<br /><strong>Số đo 3 vòng:</strong> 83-62-95cm</p>'),(557,85,0,279,'Jumpsuit dáng Vest'),(558,76,0,279,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế Jumpsuit được cách điệu dựa trên dáng vest với cổ 2 ve. Điểm nhấn đai bắt chéo nằm ở phía trước. Phần eo cao và được chiết nhẹ. Ống tay bo nhẹ ở phần đầu. Phần quần dáng suông hơi loe nhẹ ở đầu ống.</p>\r\n<p>Chẳng phải đau đầu nghĩ xem \"mặc gì hôm nay\", hãy cứ chọn lựa một thiết kế jumpsuit để vẻ ngoài chỉn chu mà không cần tốn công mix match nàng nhé. Gam màu trung tính cùng chất liệu Tuysi chính là bộ đôi hoàn hảo cho thời trang công sở. Thiết kế jumpsuit này được lấy cảm hứng từ một bộ vest với những chi tiết như cổ 2 ve, quần suông dáng Tây hay túi chéo 2 bên. Nàng có thể diện outfit này cho những ngày đi làm hoặc những sự kiện quan trọng đều rất phù hợp.</p>\r\n<p>Màu sắc: Bạc - Ghi tím - Nâu cà phê</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<p><strong>Chiều cao:</strong> 1m69</p>\r\n<p><strong>Cân nặng:</strong> 48kg</p>\r\n<p><strong>Số đo:</strong> 80-60-90cm</p>\r\n</div>'),(559,85,0,280,'Jumpsuit Nhấn lệch vai'),(560,76,0,280,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế Jumpsuit trơn được làm từ chất liệu Tuysi. Phần vai áo được may lệch dạng xoắn độc đáo. Jumpsuit có đai giả nhấn ở eo trên. Phần quần ống suông loe dần đến cuối ống. Đằng sau Jumpsuit có khóa kéo.</p>\r\n<p>Diện Jumpsuit nhưng vẫn cần thời trang và trẻ trung? Vậy outfit này chắc chắn là câu trả lời hoàn hảo dành cho nàng. Thiết kế Jumpsuit cơ bản được nhấn thêm đường xoắn lệch vai. Nhờ chi tiết này, tổng thể trang phục trở nên hiện đại và thời trang hơn rất nhiều. Thân áo được kết hợp khéo léo với đai eo giả khiến phần nối giữa áo và quần trở nên gọn gàng và ôm sát hơn. Dù diện Jumpsuit nhưng vóc dáng của người mặc vẫn được tôn lên tuyệt đối, nàng tha hồ khoe những đường nét đẹp của bản thân.</p>\r\n<p>Màu sắc: Cam - Đỏ ruby - Đen</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<p><strong>Chiều cao:</strong> 1m69</p>\r\n<p><strong>Cân nặng:</strong> 48kg</p>\r\n<p><strong>Số đo:</strong> 80-60-90cm</p>\r\n</div>'),(561,85,0,281,'Jumpsuit Quần dài'),(562,76,0,281,'<div class=\"tab-content active showContent\">\r\n<p>Jumpsuit (áo liền quần) cổ V đáp chéo. Tay ngắn. Eo chiết. Túi chéo 2 bên. Quần dài ống xuông. Eo có đỉa kèm đai rời. Cài bằng khóa kéo ẩn sau lưng.</p>\r\n<p>Với thiết kế quần dài mang đến phong cách thời trang ấn tượng, dễ tạo sự lôi cuốn với người đối diện. Gam màu cơ bản dễ mix&amp;match cùng phụ kiện.</p>\r\n<p>Màu sắc: Đen - Vàng</p>\r\n<p><strong>Mẫu mặc size S:</strong></p>\r\n<p>Chiều cao: 1m68<br />Cân nặng: 52kg<br />Số đo 3 vòng: 83-62-95cm</p>\r\n</div>'),(563,85,0,282,'Jumpsuit Lụa nhăn'),(564,76,0,282,'<div class=\"tab-content active showContent\">\r\n<p>Jumpsuit 2 dây, phần cúp ngực viền chun co giãn. Layer bên ngoài. Eo chiết. Phần quần dài ống rộng. Vải lụa nhăn ánh kim cao cấp.</p>\r\n<p>Nếu nàng đang phân vân không biết mặc gì cho cuối tuần này thì đây là thiết kế gợi ý dành cho nàng. Vừa tôn dáng, vừa sang chảnh cùng với chất lụa nhăn ánh kim sẽ giúp nàng trở thành tâm điểm của buổi hẹn cuối tuần đấy.</p>\r\n<p>Màu sắc: Cam</p>\r\n</div>'),(565,85,0,283,'Giày mũi nhọn phối màu'),(566,76,0,283,'<div class=\"tab-content active hideContent\">\r\n<p>Giày mũi nhọn, Gót nhỏ cao 3cm. 1 dây quai ngang móc cài. Phối 2 màu tạo kiểu.</p>\r\n<p>Màu sắc: Nâu cà phê - Nude</p>\r\n</div>'),(567,85,0,284,'Xăng đan da cao gót'),(568,76,0,284,'<div class=\"tab-content active showContent\">\r\n<p>Xăng đan cao gót, có 4 quai mảnh bằng da. Gót nhọn bọc chất liệu cùng màu.</p>\r\n<p>Gót cao 7cm</p>\r\n</div>'),(569,85,0,285,'Xăng đan cao gót'),(570,76,0,285,'<p>Xăng đan cao gót màu pastel nữ tính, dây quai trước phối phụ kiện tạo điểm nhấn. Gót nhọn cao 7cm bọc chất liệu cùng màu. Dây ngang móc cài có thể tùy chỉnh độ dài.</p>'),(571,85,0,286,'Dép cao gót đế nhựa'),(572,76,0,286,'<p>Dép cao gót phối đế nhựa trong suốt. Có 1 quai ngang và vặn tạo kiểu. Gót cao 9 cm. Mũi bo vuông.</p>'),(573,85,0,287,'Giày búp bê Retro'),(574,76,0,287,'<div class=\"tab-content hideContent active\">\r\n<p>Giày búp bê mũi bít mang kiểu dáng cổ điển. Gót vuông cao 3cm. Chất liệu da trơn bóng, đai có đính ngọc trai mang lại vẻ thanh lịch.</p>\r\n<p>Giày phù hợp để đi trong mọi dịp như đi làm, dạo phố hay đi tiệc.</p>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(575,85,0,288,'Xăng đan cao gót dây mảnh'),(576,76,0,288,'<p>Xăng đan cao gót, dây quai mảnh phối đan chéo. Gót trụ bọc chất liệu cùng màu và bo vuông. Gót cao 9 cm.</p>'),(577,85,0,289,'Dép cao gót'),(578,76,0,289,'<p>Dép cao gót chất liệu da PU, 2 quai trước đắp chéo tạo kiểu. Độ cao 5cm.</p>'),(579,85,0,290,'Dép da bệt'),(580,76,0,290,'<p>Dép da bệt mũi vuông, quai đan tạo kiểu.</p>'),(581,85,0,291,'Giày cao gót mũi nhọn'),(582,76,0,291,'<p>Giày mũi nhọn, Gót nhỏ cao 6cm. 1 dây quai ngang móc cài. Chất liệu da PU tổng hợp cao cấp nhập khẩu có độ bóng nhẹ, mềm mịn, chống nấm mốc, bám bụi hiệu quả.</p>'),(583,85,0,292,'Giày cao gót phối lưới'),(584,76,0,292,'<div class=\"tab-content hideContent active\">\r\n<p>Giày cao gót mũi nhọn, phối lưới, gót bọc da. Gót cao 7cm.</p>\r\n<p>Màu sắc: Đen - Nude</p>\r\n</div>'),(585,85,0,293,'Túi da xách tay'),(586,76,0,293,'<div class=\"tab-content active showContent\">\r\n<p>Mẫu túi xách tay size medium, chất liệu da PU. Bên trong lót vải, có 1 ngăn ẩn. Quai xách cố định, không tháo rời và điều chỉnh được. Thiết kế túi cơ bản phù hợp với mọi outfit của các cô nàng.</p>\r\n<p><strong>Kích thước túi: </strong>cao x rộng x ngang: 20 x 22 x 17cm</p>\r\n</div>'),(587,85,0,294,'Clutch nữ cao cấp'),(588,76,0,294,'<div class=\"tab-content active showContent\">\r\n<p>Túi clutch chần bông có 3 ngăn lớn, các ngăn nhỏ bên trong và một ngăn khóa kéo bên trong túi.</p>\r\n<p>Từ lâu, túi clutch nữ hàng hiệu đã trở thành một món đồ xa xỉ không thể thiếu đối với phái đẹp khi xuống phố, khi đi dự tiệc hay tụ tập bạn bè. Một chiếc clutch không chỉ giúp phái nữ đựng đồ dùng, trang thiết bị cá nhân mà còn khoe ra sự đẳng cấp, thời thượng.</p>\r\n<p><strong>Kích thước: </strong>Cao x rộng x sâu: 11 x 20 x 3 cm</p>\r\n<p>Màu sắc: Nude - Đen</p>\r\n</div>'),(589,85,0,295,'Ví Dài Kèm Dây Đeo'),(590,76,0,295,'<div class=\"tab-content active showContent\">\r\n<p>Ví da dáng dài nhỏ gọn giúp nàng dễ dàng sử dụng. Ví kèm dây đai giúp nàng biến hóa thành mini bag để đa dạng hơn outfit của mình.</p>\r\n<p><strong>Kích thước túi:</strong> Cao x Rộng x Ngang: 9 x 9 x 1 cm</p>\r\n</div>'),(591,85,0,296,'Túi da đeo vai'),(592,76,0,296,'<div class=\"tab-content active showContent\">\r\n<p>Túi xách size medium, chất liệu da PU. Bên trong lót vải, có 1 ngăn ẩn. Quai đeo vai cố định, không tháo rời và điều chỉnh được. Có túi nhỏ đi kèm.</p>\r\n<p><strong>Kích thước túi: </strong>cao x rộng x ngang: 21 x 29 x 12cm</p>\r\n</div>'),(593,85,0,297,'Túi Xách Phối Đai Xích'),(594,76,0,297,'<div class=\"tab-content active showContent\">\r\n<p>Túi form dáng to có kèm dây đai da rời, thiết kế basic tiện lợi cho nàng mang đi làm hay đi chơi.</p>\r\n<p><strong>Kích thước túi:</strong> Cao x Rộng x Ngang: 20 x 23 x 9 cm</p>\r\n</div>'),(595,85,0,298,'Ví da mini'),(596,76,0,298,'<div class=\"tab-content active showContent\">\r\n<p>Ví da mini tiện lợi không khóa và 3 ngăn xếp phụ. In logo IVY moda</p>\r\n<p>Với những đường chần chỉ tinh tế và những tone màu cực ăn ý với mọi trang phuc tạo sức hấp dẫn khó cưỡng cho phong cách của bạn.</p>\r\n<p><strong>Kích thước: </strong>Cao x rộng: 8 x 11cm</p>\r\n<p>Màu sắc: Gold - Đỏ Ruby</p>\r\n</div>'),(597,85,0,299,'Túi minibag chần chỉ'),(598,76,0,299,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế đứng phom, có nắp đóng mở bằng khóa kim loại. Mặt sau in logo IVY moda. Dây đeo chéo phối xích và da đi kèm, không tháo rời. Bên trong lót vải, có 1 ngăn lớn kéo khóa bên trong 1 ngăn phụ. Không có nắp. Bên ngoài chần chỉ nổi tạo điểm nhấn.</p>\r\n<p><strong>Kích thước:</strong> Cao x Rộng x Sâu: 15 x 22 x 8 cm</p>\r\n<p>Màu sắc: Đen - Hồng</p>\r\n</div>'),(599,85,0,300,'Túi đeo vai nắp lệch'),(600,76,0,300,'<div class=\"tab-content active showContent\">\r\n<p>Túi đeo vai Medium. Thân túi hình chữ nhật, chất liệu da pu giả da động vật. Có quai đeo vai tháo rời được. Lót vải bên trong có 1 ngăn nhỏ có khóa. Đóng mở bằng nam châm.</p>\r\n<p><strong>Kích thước túi:</strong> Cao x Rộng x Ngang: 7 x 24 x 7 cm</p>\r\n</div>'),(601,85,0,301,'Túi nhựa mini trong suốt'),(602,76,0,301,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế túi nhựa độc đáo dành cho cô nàng cá tính. Mix cùng set đồ đơn giản là nàng đã có ngay 1 outfit đi chơi nổi bật.</p>\r\n<p><strong>Kích thước túi:</strong> Cao x Rộng x Ngang: 10 x 17 x 7 cm</p>\r\n</div>'),(603,85,0,302,'Balo da trơn'),(604,76,0,302,'<p>Balo da PU. Đóng mở bằng khóa kéo kim loại. Có một quai cầm tay và hai quai đeo vai có thể điều chỉnh ở phía sau. </p>'),(605,85,0,303,'Áo thun loang màu Balance'),(606,76,0,303,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ tròn. Tay dài. Dáng Regular. Vải loang in chữ mặt trước. Xè gấu 2 bên.</p>\r\n<p>Sử dụng chất liệu thun mềm mại, thông thoáng và co giãn tối ưu, tạo cảm giác thoải mái khi mặc. Mix cùng quần jean, quần short...để có set đồ năng động cho mùa này</p>\r\n<p>Màu sắc: Họa tiết Xanh Cổ Vịt Nhạt - Họa tiết Nâu</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p>Chiều cao: 1m85<br />Cân nặng: 75kg<br />Số đo 3 vòng: 100-78-95 cm</p>\r\n</div>'),(607,85,0,304,'Áo thun nam dài tay'),(608,76,0,304,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun nam cổ tròn, tay dài. Dáng xuông. In chữ khác màu 1 bên ngực.</p>\r\n<p>Kiểu dáng cơ bản dễ phối đồ với quần jeans, quần sooc.. Điểm nổi bật của sản phẩm là chữ in màu nổi mặt trước 1 bên ngực. Chất liệu vải thun cao cấp tạo ra được độ mềm và thoáng cho những người ưa vận động hay chơi thể thao, độ thấm hút mồ hôi tốt và có khả năng co giãn 4 chiều, đem đến cảm giác vô cùng thoải mái, dễ chịu khi sử dụng.</p>\r\n<p>Màu sắc: Bạc - Đen</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br /><strong>Chiều cao:</strong> 1m85<br /><strong>Cân nặng: </strong>75kg<br /><strong>Số đo 3 vòng: </strong>100-78-95 cm</p>\r\n</div>'),(609,85,0,305,'Áo thun trơn Slim fit'),(610,76,0,305,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun nam cổ tròn, tay ngắn, kiểu dáng Slim fit, form cơ bản.</p>\r\n<p>Chất liệu thun cao cấp, mang đến cho bạn nam sự trẻ trung, năng động nhưng cũng không kém phần hiện đại.</p>\r\n<p>Bên cạnh đó, sản phẩm với 4 gam màu trung tính, giúp bạn quý anh dễ phối cùng các phụ kiện khác làm tăng thêm sự sành điệu trong phong cách thời trang của mình cũng như vừa đảm bảo phù hợp để phối cùng mọi set đồ năng động, trẻ trung. </p>\r\n</div>'),(611,85,0,306,'Áo thun nam cổ đức'),(612,76,0,306,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ đức cài 3 khuy cài. Tay dài bo gấu. Thêu chữ nhiều màu 1 bên ngực. Dáng áo suông với màu đơn sắc dễ phối hợp.</p>\r\n<p>Sử dụng chất liệu thun mềm mại, thông thoáng và co giãn tối ưu, tạo cảm giác thoải mái khi mặc. Mix cùng quần jean, quần short...để có set đồ năng động cho mùa này</p>\r\n<p>Màu sắc: Xanh Lá Đậm - Xanh Lơ</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p>Chiều cao: 1m85<br />Cân nặng: 75kg<br />Số đo 3 vòng: 100-78-95 cm</p>\r\n</div>'),(613,85,0,307,'Áo thun nam dài tay II'),(614,76,0,307,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ đức bằng chun co giãn, cài 3 khuy cài. Tay dài bo gấu. Dáng áo suông với màu đơn sắc dễ phối hợp.</p>\r\n<p>Sử dụng chất liệu thun mềm mại, thông thoáng và co giãn tối ưu, tạo cảm giác thoải mái khi mặc. Mix cùng quần jean, quần short...để có set đồ năng động cho mùa này</p>\r\n<p>Màu sắc: Gold - Đỏ Ruby</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p>Chiều cao: 1m85<br />Cân nặng: 75kg<br />Số đo 3 vòng: 100-78-95 cm</p>\r\n</div>'),(615,85,0,308,'Áo thun nam tay dài'),(616,76,0,308,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun nam cổ đức có 3 khuy cài, tay dài. Dáng áo Regular. </p>\r\n<p>Chất liệu vải thun cá sấu dày dặn thấm hút mồ hôi tốt giúp bạn thoải mái vận động. Mix cùng quần jean, short...giày thể thao để có set đồ năng động.</p>\r\n<p>Màu sắc: Xanh Cổ Vịt Nhạt - Đỏ Ruby</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br /><strong>Chiều cao:</strong> 1m83<br /><strong>Cân nặng: </strong>74kg</p>\r\n</div>'),(617,85,0,309,'Áo thun in họa tiết'),(618,76,0,309,'<p>Áo nỉ/ Áo sweater nam, cổ tròn và dài tay. Họa tiết dây xích độc quyền ELLE khiến chàng nổi bật hơn trong đám đông. Chất vải thun dày giữ ấm tốt. Dễ dàng phối hợp với quần jeans, quần âu, giày thể thao,... để có set đồ năng động nhất.</p>'),(619,85,0,310,'Áo thun nam dáng Regular FIt'),(620,76,0,310,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun nam, cổ tròn và dài tay. Bo chun co giãn ở gấu. 2 gạch in 2 bên tạo kiểu.</p>\r\n<p>Chất vải thun với độ dày vừa phải giữ ấm tốt. Phối hợp với quần jeans, quần âu, giày thể thao để có set đồ năng động nhất, Đây là một mẫu áo chiếm thị phần số 1 trong mùa thu đông, bởi tính đa nhiệm, tiện dụng và giá cả rất hợp lí của chúng.</p>\r\n<p>Màu sắc: Đen - Ghi Khói</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br /><strong>Chiều cao:</strong> 1m83<br /><strong>Cân nặng: </strong>74kg</p>\r\n</div>'),(621,85,0,311,'Áo thun kẻ cổ bo'),(622,76,0,311,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ bo cài 2 khuy. Tay dài. Vải kẻ ngang làm điểm nhấn.</p>\r\n<p>Sử dụng chất liệu thun mềm mại, thông thoáng và co giãn tối ưu, tạo cảm giác thoải mái khi mặc. Mix cùng quần jean, quần short...để có set đồ năng động cho mùa này.</p>\r\n<p>Màu sắc: Kẻ Đỏ Ruby.</p>\r\n</div>'),(623,85,0,312,'Áo thun thêu Science'),(624,76,0,312,'<div class=\"tab-content active showContent\">\r\n<p>Áo cổ tròn chất thun kết hợp với tay ngắn và độ dài vừa phải mang lại cảm giác trẻ trung năng động.</p>\r\n<p>Họa tiết chữ thêu nổi cùng màu với áo và chất thun thoáng mát sẽ là sự lựa chọn tuyệt vời trong bất kì hoàn cảnh nào. Chàng có thể phối cùng với bất kì item khác mà vẫn mang ghi điểm trong mắt người nhìn.</p>\r\n<p>Màu sắc: Đen - Nâu Cà Phê</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p><strong>Chiều cao:</strong> 1m77<br /><strong>Cân nặng: </strong>68kg<br /><strong>Số đo 3 vòng:</strong> 94-86-98 cm</p>\r\n</div>'),(625,85,0,313,'Áo khoác Blazer nam'),(626,76,0,313,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác blazer cổ 2 ve khoét chữ K. Tay dài. Vai đệm. 2 nắp túi bên tà và 1 viền túi giả bên ngực. Có hàng 6 khuy phía trước. Sau lưng có đai kèm khuy.</p>\r\n<p>Nếu bạn đang tìm kiếm một item sang trọng, thanh lịch, cân bằng giữa sự thời trang và tính ứng dụng thì đây là một gợi ý hoàn toàn không nên bỏ lỡ. Sản phẩm giữ nguyên form dáng áo vest nam, đường cổ 2 ve là điểm nhấn cho tổng thể sản phẩm. Áo sử dụng lớp lót có chất liệu cao cấp, mềm mại cho bạn luôn thoải mái và dễ chịu trong mọi hoạt động.</p>\r\n<p>Màu sắc: Xanh Tím Than - Nude</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br /><strong>Chiều cao:</strong> 1m85<br /><strong>Cân nặng: </strong>75kg<br /><strong>Số đo 3 vòng: </strong>100-78-95 cm</p>\r\n</div>'),(627,85,0,314,'Áo khoác nam dáng lửng'),(628,76,0,314,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác nam cổ đức không chân. Tay dài. Có 2 túi chéo 2 bên. Cài bằng hàng khuy phía trước. 2 túi bên trong. Vải dạ bên trong có lớp lót khác màu. <br />Ngoài việc phối với nhiều đồ, áo khoác này bạn có thể mặc 2 mặt tạo thành 2 áo khác nhau. Vừa tiện dụng vừa hợp thời trang</p>\r\n<p>Màu sắc: Nâu cà phê - Xanh Cổ Vịt</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br /><strong>Chiều cao:</strong> 1m85<br /><strong>Cân nặng: </strong>75kg<br /><strong>Số đo 3 vòng: </strong>100-78-95 cm</p>\r\n</div>'),(629,85,0,315,'Áo khoác chần bông'),(630,76,0,315,'<div class=\"tab-content active showContent\">\r\n<p>- Chất liệu vải Polyester, áo may chần bông nhân tạo tác dụng giữ ấm cực tốt vào những ngày đại hàn</p>\r\n<p>- Áo khoác phao dáng suông, cổ sơ mi, cài bằng hàng khuy phía trước</p>\r\n<p>- Trước ngực phối 2 túi vuông có nắp và 2 túi chéo 2 bên</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 175 cm</p>\r\n<p><strong>Cân nặng:</strong> 70 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>98-75-97 cm</p>\r\n<p>Mẫu mặc size L</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(631,85,0,316,'Áo khoác phao siêu nhẹ'),(632,76,0,316,'<div class=\"tab-content active showContent\">\r\n<p>- Chất liệu vải Polyester, bên trong lót bông tác dụng giữ ấm tốt vào những ngày đại hàn</p>\r\n<p>- Áo khoác phao dáng suông, cổ cao, cài bằng khóa kéo phái trước</p>\r\n<p>- Thiết kế trẻ trung, độ dài vừa phải cùng trọng lượng nhẹ mang lại cảm giác thoải mái, ấm áp nhất khi mặc</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 175 cm</p>\r\n<p><strong>Cân nặng:</strong> 65 kg</p>\r\n<p>Mẫu mặc size S</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(633,85,0,317,'Track Jacket - Áo khoác gió dáng cơ bản'),(634,76,0,317,'<p>- Chất liệu: Polyester tổng hợp dày dặn, tính năng chống gió, chống bụi, giữ ấm cơ thể. </p>\r\n<p>- Áo khoác 2 lớp dáng suông, độ dài ngang hông, sử dụng khóa kéo kín mành (chống gió, chống thấm nước) </p>\r\n<p>- Áo tay dài,  2 túi chéo 2 bên có khóa kéo tiện lợi, gấu áo phối chun bản to co giãn. Phom dáng regular phù hợp với vóc dáng người Việt</p>\r\n<p>- Sản xuất năm 2022 tại Việt Nam</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 175 cm</p>\r\n<p><strong>Cân nặng:</strong> 70 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>98-75-97 cm</p>'),(635,85,0,318,'Áo khoác gió cổ đức'),(636,76,0,318,'<div class=\"tab-content active showContent\">\r\n<p>- Chất liệu: 94% Polyester 6% Spandex tính năng siêu nhẹ, chống gió, chống bụi, giữ ấm cơ thể.</p>\r\n<p>- Áo khoác 2 lớp dáng suông, độ dài ngang hông, sử dụng khóa kéo kín mành (chống gió, chống thấm nước) </p>\r\n<p>- Áo tay dài, cổ đức, 2 túi chéo kéo khóa phía trước tiện lợi. Phom dáng regular phù hợp với vóc dáng người Việt</p>\r\n<p>- Sản xuất năm 2022 tại Việt Nam</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 175 cm</p>\r\n<p><strong>Cân nặng:</strong> 70 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>98-75-97 cm</p>\r\n<p>Mẫu mặc size L</p>\r\n</div>'),(637,85,0,319,'Áo khoác dạ nam dáng dài'),(638,76,0,319,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác dạ cổ 2 ve khoét chữ K. Tay dài có 3 khuy trang trí. 2 túi vuông có nắp 2 bên. Dáng áo suông dài. Cài bằng hàng khuy phía trước. Với chất liệu dạ ép cao cấp, mềm mại, giữ ấm tốt, không bám bụi, thiết kế thời trang, phong cách trang nhã, lịch thiệp. </p>\r\n<p>Một trong những item được ưu tiên hàng đầu đó là áo len cổ lọ. Phong cách “nửa kín nửa hở” với áo khoác dạ bên ngoài nhưng vẫn phô ra được phần cổ áo bên trong cực cool.</p>\r\n<p>Màu sắc: Xanh Tím Than - Kẻ Ghi Khói</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p>Chiều cao: 1m85<br />Cân nặng: 75kg<br />Số đo 3 vòng: 100-78-95 cm</p>\r\n</div>'),(639,85,0,320,'Áo khoác gió cổ mũ lót lông'),(640,76,0,320,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác gió phom xuông rộng, giúp người mặc thoải mái trong từng cử động, nhưng đồng thời vẫn đảm bảo vừa vặn về số đo vai, độ dài tay, áo.</p>\r\n<p>Thiết kế tỉ mỉ đến từng chi tiết đem đến cho những trải nghiệm tuyệt vời nhất trong thời tiết se lạnh với mũ liền kết cấu đặc biệt. Phần tay giắc lăng dáng xuông. Cổ mũ lót lông và dây rút điều chỉnh. 2 túi chéo có dây khóa kéo. Cài bằng dây khóa phía trước.</p>\r\n<p>Chất liệu 100% Polyester cao cấp giúp sản phẩm bền chắc, bền màu và có độ bóng sáng tự nhiên. Đặc biệt, vải nhẹ và thoáng, giữ nhiệt tốt, hạn chế bám bụi, dễ chăm sóc và bảo quản.</p>\r\n<p>Màu sắc: Đen - Xanh Dương Đậm</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p>Chiều cao: 1m85<br />Cân nặng: 75kg<br />Số đo 3 vòng: 100-78-95 cm</p>\r\n</div>'),(641,85,0,321,'Áo khoác gió dáng dài'),(642,76,0,321,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác gió cổ bẻ tạo kiểu có khuy cài, tay áo dài có giắc lăng. Dáng áo suông dài trên gối. Cài bằng dây kéo khóa. Bạn có thể mặc khoác ra ngoài khi trời lạnh, mưa nhỏ...</p>\r\n<p>Được làm từ chất liệu Polyester cao cấp giúp cho những sản phẩm này có được sự chống nước rất tốt. Không bai, xù, nhão,...khi mặc theo thời gian. Khả năng chống tĩnh điện, chống bám bụi và giữ ấm hiệu quả.</p>\r\n<p>Màu sắc: Đen - Gold</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p>Chiều cao: 1m85<br />Cân nặng: 75kg<br />Số đo 3 vòng: 100-78-95 cm</p>\r\n</div>'),(643,85,0,322,'Áo khoác gió cổ mũ II'),(644,76,0,322,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác gió 1 lớp phom suông rộng, giúp người mặc thoải mái trong từng cử động, nhưng đồng thời vẫn đảm bảo vừa vặn về số đo vai, độ dài tay, áo.</p>\r\n<p>Thiết kế tỉ mỉ đến từng chi tiết đem đến cho những trải nghiệm tuyệt vời nhất trong thời tiết se lạnh với mũ liền kết cấu đặc biệt. Phần tay giắc lăng dáng xuông. 2 túi chéo có dây khóa kéo. Cài bằng dây khóa phía trước và miếng dán. </p>\r\n<p>Chất liệu 100% Polyester cao cấp giúp sản phẩm bền chắc, bền màu và có độ bóng sáng tự nhiên. Đặc biệt, vải nhẹ và thoáng, giữ nhiệt tốt, hạn chế bám bụi, dễ chăm sóc và bảo quản.</p>\r\n<p>Màu sắc: Đen - Xanh Tím Than - Xanh Dương</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p>Chiều cao: 1m85<br />Cân nặng: 75kg<br />Số đo 3 vòng: 100-78-95 cm</p>\r\n</div>'),(645,85,0,323,'Áo Polo phối kẻ'),(646,76,0,323,'<p>Chất vải thun cùng form áo tay ngắn dễ mặc sẽ mang lại cho người mặc cảm giác thoải mái, mát mẻ.</p>\r\n<p>Viền trắng được may ở túi áo trước và cổ áo. Màu sắc đơn giản dễ mặc có thể kết hợp với quần dài, quần jeans hay quần lửng đều hợp. Sản phẩm có tính ứng dụng cao khi vừa mặc đi học, đi làm hay đi chơi hẹn hò.</p>\r\n<p>Màu sắc: Xanh Cổ Vịt Đậm - Đen </p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p><strong>Chiều cao:</strong> 1m77<br /><strong>Cân nặng: </strong>68kg<br /><strong>Số đo 3 vòng:</strong> 94-86-98 cm</p>'),(647,85,0,324,'Áo polo suông'),(648,76,0,324,'<div class=\"tab-content active showContent\">\r\n<p>Áo cổ đức tay ngắn với chiều dài vừa phải và chất liệu thun co dãn thoải mái sẽ là lựa chọn lí tưởng cho những buổi hẹn hò, đi chơi, phù hợp cả khi mặc đi làm và đi học.</p>\r\n<p>Form dáng trẻ trung năng động kèm họa tiết kéo dọc từ cổ áo đến thân tạo nên sự mới mẻ nhưng không kém phần lịch sự giúp ghi điểm trong mắt đối phương.</p>\r\n<p>Màu sắc: Bạc Hà - Xanh Tím Than</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p><strong>Chiều cao:</strong> 1m77<br /><strong>Cân nặng: </strong>68kg<br /><strong>Số đo 3 vòng:</strong> 94-86-98 cm</p>\r\n</div>'),(649,85,0,325,'Áo polo nam màu đen'),(650,76,0,325,'<div class=\"tab-content active showContent\">\r\n<p>Được ra đời vào những năm 60, là chiếc áo được dùng trong thể thao “hockey trên lưng ngựa” hay còn gọi là Polo. Và sau này đến năm 1920, nhà thiết kế René Lacoste biến tấu những chiếc áo polo dài tay thành những chiếc polo ngắn tay, và những chiếc áo polo đã sớm trở thành một trong những mẫu áo “kinh điển” luôn hiện diện trong tủ đồ của những quý ông hiện đại – Những chiếc áo polo mang dáng vẻ lịch sự nhưng vẫn vô cùng năng động, cuốn hút.</p>\r\n<p>Chất liệu vải pique dệt - cotton sợi dệt mặt lưới, tạo ra được độ mềm và thoáng cho những người ưa vận động hay chơi thể thao, độ thấm hút mồ hôi tốt và có khả năng co giãn 4 chiều, đem đến cảm giác vô cùng thoải mái, dễ chịu khi sử dụng.</p>\r\n<p>Form áo Regular viền chun co giãn ở tay áo giúp người mặc trở nên khỏe khoắn và năng động hơn. Phần cổ áo được may bằng thun co giãn với 3 khuy cài, viền tay bằng vải từ thân áo tạo nên thiết kế mới mẻ, trẻ trung và đầy sức sống.</p>\r\n<p>Màu sắc: Xanh Nước Biển - Trắng</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br /><strong>Chiều cao:</strong> 1m85<br /><strong>Cân nặng: </strong>75kg<br /><strong>Số đo 3 vòng: </strong>100-78-95 cm</p>\r\n</div>'),(651,85,0,326,'Áo polo phối kẻ II'),(652,76,0,326,'<div class=\"tab-content active showContent\">\r\n<p>Được ra đời vào những năm 60, là chiếc áo được dùng trong thể thao “hockey trên lưng ngựa” hay còn gọi là Polo. Và sau này đến năm 1920, nhà thiết kế René Lacoste biến tấu những chiếc áo polo dài tay thành những chiếc polo ngắn tay, và những chiếc áo polo đã sớm trở thành một trong những mẫu áo “kinh điển” luôn hiện diện trong tủ đồ của những quý ông hiện đại – Những chiếc áo polo mang dáng vẻ lịch sự nhưng vẫn vô cùng năng động, cuốn hút.</p>\r\n<p>Chất liệu vải pique dệt - cotton sợi dệt mặt lưới, tạo ra được độ mềm và thoáng cho những người ưa vận động hay chơi thể thao, độ thấm hút mồ hôi tốt và có khả năng co giãn 4 chiều, đem đến cảm giác vô cùng thoải mái, dễ chịu khi sử dụng.</p>\r\n<p>Form áo Regular Fit viền chun co giãn ở tay áo giúp người mặc trở nên khỏe khoắn và năng động hơn. Phần cổ áo được may bằng thun co giãn với 2 khuy cài, viền tay bằng vải từ thân áo tạo nên thiết kế mới mẻ, trẻ trung và đầy sức sống.</p>\r\n<p>Màu sắc: Xanh Nước Biển - Trắng</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br /><strong>Chiều cao:</strong> 1m85<br /><strong>Cân nặng: </strong>75kg<br /><strong>Số đo 3 vòng: </strong>100-78-95 cm</p>\r\n</div>'),(653,85,0,327,'Áo thun kẻ phối kẻ'),(654,76,0,327,'<div class=\"tab-content active showContent\">\r\n<p>Được ra đời vào những năm 60, là chiếc áo được dùng trong thể thao “hockey trên lưng ngựa” hay còn gọi là Polo. Và sau này đến năm 1920, nhà thiết kế René Lacoste biến tấu những chiếc áo polo dài tay thành những chiếc polo ngắn tay, và những chiếc áo polo đã sớm trở thành một trong những mẫu áo “kinh điển” luôn hiện diện trong tủ đồ của những quý ông hiện đại – Những chiếc áo polo mang dáng vẻ lịch sự nhưng vẫn vô cùng năng động, cuốn hút.</p>\r\n<p>Chất liệu vải pique dệt - cotton sợi dệt mặt lưới, tạo ra được độ mềm và thoáng cho những người ưa vận động hay chơi thể thao, độ thấm hút mồ hôi tốt và có khả năng co giãn 4 chiều, đem đến cảm giác vô cùng thoải mái, dễ chịu khi sử dụng.</p>\r\n<p>Form áo Regular Fit viền chun co giãn ở tay áo giúp người mặc trở nên khỏe khoắn và năng động hơn. Phần cổ áo được may bằng vải từ thân áo với 3 khuy cài tạo nên thiết kế mới mẻ, trẻ trung và đầy sức sống.</p>\r\n<p>Màu sắc: Kẻ Xanh Dương</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m86</li>\r\n<li><em><strong>Cân nặng:</strong></em> 75kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 100-82-98 cm</li>\r\n</ul>\r\n</div>'),(655,85,0,328,'Áo polo kẻ ngang'),(656,76,0,328,'<div class=\"tab-content active showContent\">\r\n<p>Được ra đời vào những năm 60, là chiếc áo được dùng trong thể thao “hockey trên lưng ngựa” hay còn gọi là Polo. Và sau này đến năm 1920, nhà thiết kế René Lacoste biến tấu những chiếc áo polo dài tay thành những chiếc polo ngắn tay, và những chiếc áo polo đã sớm trở thành một trong những mẫu áo “kinh điển” luôn hiện diện trong tủ đồ của những quý ông hiện đại – Những chiếc áo polo mang dáng vẻ lịch sự nhưng vẫn vô cùng năng động, cuốn hút.</p>\r\n<p>Chất liệu vải pique dệt - cotton sợi dệt mặt lưới, tạo ra được độ mềm và thoáng cho những người ưa vận động hay chơi thể thao, độ thấm hút mồ hôi tốt và có khả năng co giãn 4 chiều, đem đến cảm giác vô cùng thoải mái, dễ chịu khi sử dụng.</p>\r\n<p>Thiết kế trở nên đắt giá khi được bo chun co giãn 100% ở cổ, và viền chun ở tay áo giúp bó sát vào bắp tay tạo nên sự nam tính và khỏe khoắn cho người mặc. Các đường kẻ và phối nhiều màu sắc trở nên bắt mắt và hợp xu hướng.</p>\r\n<p>Màu sắc: Kẻ Xanh Dương Đậm</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m86</li>\r\n<li><em><strong>Cân nặng:</strong></em> 75kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 100-82-98 cm</li>\r\n</ul>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(657,85,0,329,'Áo polo phối màu vải sợi modal'),(658,76,0,329,'<div class=\"tab-content active showContent\">\r\n<p>Được ra đời vào những năm 60, là chiếc áo được dùng trong thể thao “hockey trên lưng ngựa” hay còn gọi là Polo. Và sau này đến năm 1920, nhà thiết kế René Lacoste biến tấu những chiếc áo polo dài tay thành những chiếc polo ngắn tay, và những chiếc áo polo đã sớm trở thành một trong những mẫu áo “kinh điển” luôn hiện diện trong tủ đồ của những quý ông hiện đại – Những chiếc áo polo mang dáng vẻ lịch sự nhưng vẫn vô cùng năng động, cuốn hút.<br /><br />Chất liệu vải sợi modal là vật liệu vải sinh học được làm từ cellulose tái chế từ cây sồi. Với chiết xuất hoàn toàn tự nhiên, có sự thuần khiết, bền bỉ và đặc biệt thân thiện với sức khỏe của người dùng, dễ dàng phân hủy trong môi trường tự nhiên. Kết cấu sợi vải chắc chắn, thoáng khí, ít vón cục sau khi bị ma sát. Sợi bóng, bề mặt mịn, mát hơn so với các chất liệu tương tự... Bền màu sau nhiều lần giặt và thời gian sử dụng lâu dài.</p>\r\n<p>Phần cổ áo được may bằng vải từ thân áo với 2 khuy cài tạo nên thiết kế mới mẻ, trẻ trung và đầy sức sống.</p>\r\n<p>Màu sắc: Trắng</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m86</li>\r\n<li><em><strong>Cân nặng:</strong></em> 75kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 100-82-98 cm</li>\r\n</ul>\r\n</div>'),(659,85,0,330,'Áo polo vải sợi Modal'),(660,76,0,330,'<div class=\"tab-content active showContent\">\r\n<p>Được ra đời vào những năm 60, là chiếc áo được dùng trong thể thao “hockey trên lưng ngựa” hay còn gọi là Polo. Và sau này đến năm 1920, nhà thiết kế René Lacoste biến tấu những chiếc áo polo dài tay thành những chiếc polo ngắn tay, và những chiếc áo polo đã sớm trở thành một trong những mẫu áo “kinh điển” luôn hiện diện trong tủ đồ của những quý ông hiện đại – Những chiếc áo polo mang dáng vẻ lịch sự nhưng vẫn vô cùng năng động, cuốn hút.<br /><br />Chất liệu vải sợi modal là vật liệu vải sinh học được làm từ cellulose tái chế từ cây sồi. Với chiết xuất hoàn toàn tự nhiên, có sự thuần khiết, bền bỉ và đặc biệt thân thiện với sức khỏe của người dùng, dễ dàng phân hủy trong môi trường tự nhiên. Kết cấu sợi vải chắc chắn, thoáng khí, ít vón cục sau khi bị ma sát. Sợi bóng, bề mặt mịn, mát hơn so với các chất liệu tương tự... Bền màu sau nhiều lần giặt và thời gian sử dụng lâu dài.<br /><br />Form áo Regular Fit, thiết kế trở nên đắt giá khi được bo chun co giãn 100% ở cổ, và viền chun ở tay áo giúp bó sát vào bắp tay tạo nên sự nam tính và khỏe khoắn cho người mặc.</p>\r\n<p>Màu sắc: Gold - Trắng</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m86</li>\r\n<li><em><strong>Cân nặng:</strong></em> 75kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 100-82-98 cm</li>\r\n</ul>\r\n</div>'),(661,85,0,331,'Áo polo nam cổ bo'),(662,76,0,331,'<div class=\"tab-content active showContent\">\r\n<p>Được ra đời vào những năm 60, là chiếc áo được dùng trong thể thao “hockey trên lưng ngựa” hay còn gọi là Polo. Và sau này đến năm 1920, nhà thiết kế René Lacoste biến tấu những chiếc áo polo dài tay thành những chiếc polo ngắn tay, và những chiếc áo polo đã sớm trở thành một trong những mẫu áo “kinh điển” luôn hiện diện trong tủ đồ của những quý ông hiện đại – Những chiếc áo polo mang dáng vẻ lịch sự nhưng vẫn vô cùng năng động, cuốn hút.</p>\r\n<p>Chất liệu vải pique dệt - cotton sợi dệt mặt lưới, tạo ra được độ mềm và thoáng cho những người ưa vận động hay chơi thể thao, độ thấm hút mồ hôi tốt và có khả năng co giãn 4 chiều, đem đến cảm giác vô cùng thoải mái, dễ chịu khi sử dụng.</p>\r\n<p>Form áo Regular Fit viền chun co giãn ở tay áo giúp người mặc trở nên khỏe khoắn và năng động hơn. Phần cổ áo được may bằng vải từ thân áo với 3 khuy cài tạo nên thiết kế mới mẻ, trẻ trung và đầy sức sống.</p>\r\n<p>Màu sắc: Đen - Xanh Tím Than</p>\r\n</div>'),(663,85,0,332,'Áo polo sợi modal cao cấp II'),(664,76,0,332,'<div class=\"tab-content active showContent\">\r\n<p>Được ra đời vào những năm 60, là chiếc áo được dùng trong thể thao “hockey trên lưng ngựa” hay còn gọi là Polo. Và sau này đến năm 1920, nhà thiết kế René Lacoste biến tấu những chiếc áo polo dài tay thành những chiếc polo ngắn tay, và những chiếc áo polo đã sớm trở thành một trong những mẫu áo “kinh điển” luôn hiện diện trong tủ đồ của những quý ông hiện đại – Những chiếc áo polo mang dáng vẻ lịch sự nhưng vẫn vô cùng năng động, cuốn hút.<br /><br />Chất liệu vải sợi modal là vật liệu vải sinh học được làm từ cellulose tái chế từ cây sồi. Với chiết xuất hoàn toàn tự nhiên, có sự thuần khiết, bền bỉ và đặc biệt thân thiện với sức khỏe của người dùng, dễ dàng phân hủy trong môi trường tự nhiên. Kết cấu sợi vải chắc chắn, thoáng khí, ít vón cục sau khi bị ma sát. Sợi bóng, bề mặt mịn, mát hơn so với các chất liệu tương tự... Bền màu sau nhiều lần giặt và thời gian sử dụng lâu dài.<br /><br />Form áo Regular Fit, thiết kế trở nên đắt giá khi được bo chun co giãn 100% ở cổ, và viền chun ở tay áo giúp bó sát vào bắp tay tạo nên sự nam tính và khỏe khoắn cho người mặc.</p>\r\n<p>Màu sắc: Xanh Tím Than - Trắng</p>\r\n</div>'),(665,85,0,333,'Áo sơ mi họa tiết Monogram'),(666,76,0,333,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi cổ đức, tay dài có khuy cài. Dáng áo Regular. Vải họa tiết momogram chữ IVY moda tạo điểm nhấn. Cài bằng hàng khuy phía trước.</p>\r\n<p>Chất liệu thô co giãn nhẹ, thấm hút mồ hôi, mềm mại giúp bạn nhìn trẻ trung và thanh lịch hơn. Khi mặc áo, bạn cảm thấy sự vừa vặn và thoải mái.</p>\r\n<p>Màu sắc: Họa tiết Xanh Cổ Vịt Nhạt - Họa tiết Xanh Oliu</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br />Chiều cao: 1m85<br />Cân nặng: 75kg<br />Số đo 3 vòng: 100-78-95 cm</p>\r\n</div>'),(667,85,0,334,'Áo sơ mi nam 2 túi'),(668,76,0,334,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi cổ đức. 2 túi có nắp 2 bên. Tay dài bo gấu và cài khuy. Cài bằng hàng khuy phía trước. Vải kẻ caro nổi bật.</p>\r\n<p>Chất liệu thô co giãn nhẹ, thấm hút mồ hôi, mềm mại giúp bạn nhìn trẻ trung và thanh lịch hơn. Khi mặc áo, bạn cảm thấy sự vừa vặn và thoải mái.</p>\r\n<p>Màu sắc: Kẻ Đỏ - Kẻ Gold</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br /><strong>Chiều cao:</strong> 1m85<br /><strong>Cân nặng: </strong>75kg<br /><strong>Số đo 3 vòng: </strong>100-78-95 cm</p>\r\n</div>'),(669,85,0,335,'Áo sơ mi Khaki túi ngực'),(670,76,0,335,'<div class=\"tab-content active showContent\">\r\n<p>- Áo sơ mi tay dài, dáng regular trẻ trung, hiện đại. </p>\r\n<p>- Thiết kế áo cơ bản, cổ áo và cổ tay đứng phom, cài bằng hàng khuy nhựa tinh tế.</p>\r\n<p>- Chất liệu Khaki thoáng mát, ít nhăn, phù hợp diện trong nhiều hoàn cảnh khác nhau. </p>\r\n</div>'),(671,85,0,336,'Áo sơ mi Regular fit'),(672,76,0,336,'<div class=\"tab-content active showContent\">\r\n<p>- Thiết kế áo sơ mi cổ đức với kiểu dáng tay ngắn trẻ trung và hiện đại.</p>\r\n<p>- Lựa chọn vải kẻ có gam màu sáng, phù hợp gam màu hè. </p>\r\n<p>- Chất liệu thô cao cấp, chống nhăn, thấm hút tốt, đem lại cảm giác thư thái cho người mặc.</p>\r\n</div>'),(673,85,0,337,'Áo sơ mi Bodyfit'),(674,76,0,337,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi dáng Bodyfit, ống tay và vạt áo có độ ôm nhẹ. Cổ đức, dáng mềm. Cổ tay áo có 2 nấc khuy để người mặc điều chỉnh.</p>\r\n<p>Một thiết kế Bodyfit chắc chắn sẽ tôn lên vẻ đẹp nam tính của quý anh. Dáng áo có độ rộng nhẹ nên khi sơ vin không khiến người mặc cảm thấy bí bách. Form áo vuông vắn giúp quý ông trông phong độ hơn.</p>\r\n</div>'),(675,85,0,338,'Áo sơ mi viền cổ'),(676,76,0,338,'<p>Áo sơ mi cổ đức, tay dài, dáng slim fit ôm nhẹ. Phần cổ có đường viền. </p>\r\n<p>Mẫu áo thích hợp mặc đi làm cho các chàng trai công sở. Thiết kế dài tay, lịch sự. Form slim fit gọn gàng. Màu sắc dễ mặc, trẻ trung. Chàng có thể sơ vin hay thả dáng đều đẹp. Phù hợp phối cùng quần tối màu.</p>'),(677,85,0,339,'Áo sơ mi phối line cổ'),(678,76,0,339,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi dáng slim fit với độ dài vừa phải. Ống tay và thân áo ôm nhẹ. Cổ áo là dáng cổ đức được phối cùng một đường line dọc. Cổ tay sử dụng 2 khuy để cố định.</p>\r\n<p>Một chiếc sơ mi lịch sự, sang trọng nhưng không kém phần trẻ trung là lựa chọn tuyệt vời dành cho những chàng trai thành thị. Dáng slim fit ôm nhẹ tôn lên hoàn hảo vóc dáng của người mặc. Bạn trông sẽ rất gọn gàng và chỉn chu khi sơ vin chiếc áo sơ mi này cùng quần tây. Phần cổ đức được phối cùng một line thẳng khác màu chính là điểm nhấn giúp tăng độ trẻ trung và thời thượng.</p>\r\n<p>Màu sắc: Nude - Xanh lơ</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br /><strong>Chiều cao:</strong> 1m85<br /><strong>Cân nặng: </strong>75kg<br /><strong>Số đo 3 vòng: </strong>100-78-95 cm</p>\r\n</div>'),(679,85,0,340,'Áo sơ mi Regular Fit Basic'),(680,76,0,340,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi dáng Regular fit, ống tay và vạt áo có độ thụng nhẹ. Cổ đức, dáng mềm. Cổ tay áo có 2 nấc khuy để người mặc điều chỉnh.</p>\r\n<p>Một thiết kế Regular fit chắc chắn sẽ phù hợp với mọi vóc người khác nhau. Dáng áo có độ rộng nhẹ nên khi sơ vin không khiến người mặc cảm thấy bí bách. Form áo vuông vắn giúp quý ông trông phong độ hơn.</p>\r\n<p>Màu sắc: Trắng - Xanh lơ - Xanh tím than</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br /><strong>Chiều cao:</strong> 1m85<br /><strong>Cân nặng: </strong>75kg<br /><strong>Số đo 3 vòng: </strong>100-78-95 cm</p>\r\n</div>'),(681,85,0,341,'Áo sơ mi nam Dáng Regular'),(682,76,0,341,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi cổ đức, có 2 bên giả túi vuông có khuy trước ngực. Tay dài bo gấu và cài khuy. Cài bằng hàng khuy phía trước.</p>\r\n<p>Chất liệu thô co giãn nhẹ, thấm hút mồ hôi, mềm mại giúp bạn nhìn trẻ trung và thanh lịch hơn. Khi mặc áo, bạn cảm thấy sự vừa vặn và thoải mái.</p>\r\n<p>Màu sắc: Nude - Bạc</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br /><strong>Chiều cao:</strong> 1m85<br /><strong>Cân nặng: </strong>75kg<br /><strong>Số đo 3 vòng: </strong>100-78-95 cm</p>\r\n</div>'),(683,85,0,342,'Áo sơ mi nam kẻ Caro'),(684,76,0,342,'<div class=\"tab-content active showContent\">\r\n<p>Áo sơ mi nam cổ đức, tay dài có khuy ở gấu. 2 túi có nắp (cài khuy) trước ngực. Họa tiết kẻ caro, phối màu ở cổ và nắp túi làm điểm nhấn. Cài bằng hàng khuy phía trước.</p>\r\n<p>Màu sắc: Kẻ Xanh Cổ Vịt Đậm - Kẻ Nude</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p>Chiều cao: 1m85<br />Cân nặng: 75kg<br />Số đo 3 vòng: 100-78-95 cm</p>\r\n</div>'),(685,85,0,343,'Áo phao nam siêu nhẹ'),(686,76,0,343,'<div class=\"tab-content active showContent\">\r\n<p>Áo phao chần bông dáng suông. Cổ mũ, dài tay. Có 2 túi khóa kéo phía trước. Cài bằng dây khóa kéo cùng màu phía trước. Vải chần bông cách đều.</p>\r\n<p>Bên trong nhồi bông dày dặn với phom dáng chuẩn cùng đường may tỉ mỉ. Tính năng giữ nhiệt, chống nước, độ bền cao.</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p>Chiều cao: 1m85<br />Cân nặng: 75kg<br />Số đo 3 vòng: 100-78-95 cm</p>\r\n</div>'),(687,85,0,344,'Áo khoác chần bông II'),(688,76,0,344,'<div class=\"tab-content active showContent\">\r\n<p>- Chất liệu vải Polyester, áo may chần bông nhân tạo tác dụng giữ ấm cực tốt vào những ngày đại hàn</p>\r\n<p>- Áo khoác phao dáng suông, cổ sơ mi, cài bằng hàng khuy phía trước</p>\r\n<p>- Trước ngực phối 2 túi vuông có nắp và 2 túi chéo 2 bên</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 175 cm</p>\r\n<p><strong>Cân nặng:</strong> 70 kg</p>\r\n<p><strong>Số đo 3 vòng:</strong>98-75-97 cm</p>\r\n<p>Mẫu mặc size L</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(689,85,0,345,'Áo khoác phao siêu nhẹ II'),(690,76,0,345,'<div class=\"tab-content active showContent\">\r\n<p>- Chất liệu vải Polyester, bên trong lót bông tác dụng giữ ấm tốt vào những ngày đại hàn</p>\r\n<p>- Áo khoác phao dáng suông, cổ cao, cài bằng khóa kéo phái trước</p>\r\n<p>- Thiết kế trẻ trung, độ dài vừa phải cùng trọng lượng nhẹ mang lại cảm giác thoải mái, ấm áp nhất khi mặc</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 175 cm</p>\r\n<p><strong>Cân nặng:</strong> 65 kg</p>\r\n<p>Mẫu mặc size S</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(691,85,0,346,'Áo khoác phao nam lông vũ'),(692,76,0,346,'<div class=\"tab-content active showContent\">\r\n<p>Áo phao lông vũ dáng xuông. Cổ mũ, dài tay. Có 2 túi chéo có khóa kéo. Cài bằng dây khóa kéo cùng màu phía trước. Vải chần bông cách đều.</p>\r\n<p>Chất liệu được làm từ 90% lông tơ + 10% lông vũ. Từ loại lông ngỗng cao cấp có khả năng giữ ấm vượt trội. Kỹ thuật trần lông độc quyền tạo sự nhẹ nhàng tuyệt đối. Dễ dàng nén và cất gói mà không bị biến dạng. Tính năng giữ nhiệt, chống nước, độ bền cao.</p>\r\n<p>Màu sắc: Nhiều màu</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p>Chiều cao: 1m85<br />Cân nặng: 75kg<br />Số đo 3 vòng: 100-78-95 cm</p>\r\n</div>'),(693,85,0,347,'Áo phao nam dáng gile'),(694,76,0,347,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác phao gile dáng suông. Tay sát nách. Cài bằng khóa kéo phía trước. Vải chần bông cách đều.</p>\r\n<p>Bên trong nhồi bông dày dặn với phom dáng chuẩn cùng đường may tỉ mỉ. Tính năng giữ nhiệt, chống nước, độ bền cao.</p>\r\n<p>Màu sắc: Nude - Xanh Dương Đậm - Đen</p>\r\n</div>'),(695,85,0,348,'Áo phao nam lông vũ'),(696,76,0,348,'<div class=\"tab-content active showContent\">\r\n<p>Áo phao lông vũ dáng suông. Cổ cao, dài tay. Có 2 túi phía trước. Cài bằng dây khóa kéo cùng màu phía trước. Vải chần bông cách đều.</p>\r\n<p>Chất liệu được làm từ 90% lông tơ + 10% lông vũ. Từ loại lông ngỗng cao cấp có khả năng giữ ấm vượt trội. Kỹ thuật trần lông độc quyền tạo sự nhẹ nhàng tuyệt đối. Dễ dàng nén và cất gói mà không bị biến dạng. Tính năng giữ nhiệt, chống nước, độ bền cao.</p>\r\n<p>Màu sắc: Nhiều màu</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p>Chiều cao: 1m85<br />Cân nặng: 75kg<br />Số đo 3 vòng: 100-78-95 cm</p>\r\n</div>'),(697,85,0,349,'Áo len cổ đức'),(698,76,0,349,'<div class=\"tab-content active showContent\">\r\n<p>Áo len cổ đức có 3 khuy cài. Tay cộc bo gấu vải gân.</p>\r\n<p>Với vải len với khả năng cách nhiệt, mặt vải mềm mại cùng sự bền bỉ với thời gian. Kiểu dáng năng động mix cùng với quần jean, quần âu các loại.</p>\r\n<p>Màu sắc: Ghi Khói</p>\r\n</div>'),(699,85,0,350,'Áo vest cổ hai ve'),(700,76,0,350,'<div class=\"tab-content active showContent\">\r\n<p>Áo vest cổ hai ve cách điệu. Tay dài có 4 khuy. Có 1 túi trước ngực, 2 vuông có nắp 2 bên, có 3 túi lót bên trong. Có 2 khuy cài mặt trước. Xẻ tà ở giữa phía sau.</p>\r\n<p>Để tạo nên những bộ suit đẳng cấp, các nhà thiết kế tài ba của IVY Men tỉ mỉ trong từng đường chỉ, phom dáng cứng cáp từ cầu vai, vạt áo cho đến chiều dài chuẩn của ống tay đều được IVY Men chú trọng.<br />Đi cùng là chất liệu cao cấp nhập khẩu từ Nhật Bản. Tất cả tạo nên những bộ Suit hoàn hảo - Chuẩn mực tối thượng của sự lịch lãm đầy nam tính.</p>\r\n<p>Màu sắc: Kẻ Đen - Kẻ Bạc - Kẻ Trắng - Ghi Khói - Gold</p>\r\n</div>'),(701,85,0,351,'Áo vest kẻ'),(702,76,0,351,'<div class=\"tab-content active showContent\">\r\n<p>Áo vest cổ hai ve cách điệu. Tay dài có 4 khuy. Có 1 túi trước ngực, 2 vuông có nắp 2 bên, có 3 túi lót bên trong. Có 2 khuy cài mặt trước. Xẻ tà 2 bên phía sau.</p>\r\n<p>Để tạo nên những bộ suit đẳng cấp, các nhà thiết kế tài ba của IVY Men tỉ mỉ trong từng đường chỉ, phom dáng cứng cáp từ cầu vai, vạt áo cho đến chiều dài chuẩn của ống tay đều được IVY Men chú trọng.<br />Đi cùng là chất liệu cao cấp nhập khẩu từ Nhật Bản. Tất cả tạo nên những bộ Suit hoàn hảo - Chuẩn mực tối thượng của sự lịch lãm đầy nam tính.</p>\r\n<p>Màu sắc: Họa tiết Chì - Họa tiết Xanh Dương Đậm - Họa tiết Nâu Đen - Họa tiết Xanh Tím Than</p>\r\n</div>'),(703,85,0,352,'Áo vest nam'),(704,76,0,352,'<div class=\"tab-content active showContent\">\r\n<p>Áo vest cổ hai ve khoét chữ V. Tay dài có 4 khuy. Có 1 túi trước ngực, 2 vuông có nắp 2 bên, có 3 túi lót bên trong. Có 2 khuy cài mặt trước. Xẻ tà 2 bên phía sau.</p>\r\n<p>Để tạo nên những bộ suit đẳng cấp, các nhà thiết kế tài ba của IVY Men tỉ mỉ trong từng đường chỉ, phom dáng cứng cáp từ cầu vai, vạt áo cho đến chiều dài chuẩn của ống tay đều được IVY Men chú trọng.<br />Đi cùng là chất liệu cao cấp nhập khẩu từ Nhật Bản. Tất cả tạo nên những bộ Suit hoàn hảo - Chuẩn mực tối thượng của sự lịch lãm đầy nam tính.</p>\r\n<p>Màu sắc: Đen - Xanh Đậm - Xanh Tím Than - Ghi Khói</p>\r\n</div>'),(705,85,0,353,'Áo vest dạ cổ 2 ve'),(706,76,0,353,'<div class=\"tab-content active showContent\">\r\n<p>Chất liệu dạ cao cấp, form dáng vừa vặn phù hợp với dáng người. Túi áo nắp hộp, có túi ngực, bên trong áo có túi sơ cua tiện lợi. Cánh tay áo đính thêm cúc tạo điểm nhấn, áo 2 lớp dày dặn ấm áp.</p>\r\n<p>Màu sắc: Họa tiết Ghi Khói</p>\r\n</div>'),(707,85,0,354,'Áo vest'),(708,76,0,354,'<div class=\"tab-content active showContent\">\r\n<p>Áo Vest nam kiểu dáng trẻ trung - lịch lãm - sang trọng, không chỉ giành riêng cho các quý ông thành đạt mà còn phù hợp với các chàng trai trẻ đang đi tìm cho mình 1 phong thái đĩnh đạc, nam tính.</p>\r\n<p>Chất liệu vải co giãn nhẹ tạo cảm giác thoải mái, khỏe khoắn khi mặc. Thiết kế ôm dáng, tôn body, 2 túi trước có nắp túi, có 2 cúc cài. Các phụ kiện từ chỉ may đến khuy đều được chọn lựa tinh tế, phối màu hoàn hảo cho một bộ Vest đẳng cấp.</p>\r\n</div>'),(709,85,0,355,'Áo vest xanh lơ'),(710,76,0,355,'<div class=\"tab-content active showContent\">\r\n<p>Áo Vest nam kiểu dáng trẻ trung - lịch lãm - sang trọng, không chỉ giành riêng cho các quý ông thành đạt mà còn phù hợp với các chàng trai trẻ đang đi tìm cho mình 1 phong thái đĩnh đạc, nam tính.</p>\r\n<p>Chất liệu vải co giãn nhẹ tạo cảm giác thoải mái, khỏe khoắn khi mặc. Thiết kế ôm dáng, tôn body, 2 túi trước có nắp túi, có 1 cúc cài. Các phụ kiện từ chỉ may đến khuy đều được chọn lựa tinh tế, phối màu hoàn hảo cho một bộ Vest đẳng cấp.</p>\r\n</div>'),(711,85,0,356,'Áo vest xanh dương'),(712,76,0,356,'<div class=\"tab-content active showContent\">\r\n<p>Áo Vest nam kiểu dáng trẻ trung - lịch lãm - sang trọng, không chỉ giành riêng cho các quý ông thành đạt mà còn phù hợp với các chàng trai trẻ đang đi tìm cho mình 1 phong thái đĩnh đạc, nam tính.</p>\r\n<p>Chất liệu vải co giãn nhẹ tạo cảm giác thoải mái, khỏe khoắn khi mặc. Thiết kế ôm dáng, tôn body, 2 túi trước có nắp túi, có 1 cúc cài. Các phụ kiện từ chỉ may đến khuy đều được chọn lựa tinh tế, phối màu hoàn hảo cho một bộ Vest đẳng cấp.</p>\r\n</div>'),(713,85,0,357,'Áo vest dạ'),(714,76,0,357,'<div class=\"tab-content active showContent\">\r\n<p>Áo Vest nam kiểu dáng trẻ trung - lịch lãm - sang trọng, ve áo nhọn, dài tay, đính khuy ở cổ tay. Có 2 túi có nắp hai bên hông. Có túi ở lớp vải lót bên trong. Cài khuy phía trước.</p>\r\n<p>Không chỉ giành riêng cho các quý ông thành đạt mà còn phù hợp với các chàng trai trẻ đang đi tìm cho mình 1 phong thái đĩnh đạc, nam tính.</p>\r\n<p>Chất liệu vải co giãn nhẹ tạo cảm giác thoải mái, khỏe khoắn khi mặc. Thiết kế ôm dáng, tôn body, 2 túi trước có nắp túi, có 1 cúc cài. Các phụ kiện từ chỉ may đến khuy đều được chọn lựa tinh tế, phối màu hoàn hảo cho một bộ Vest đẳng cấp.</p>\r\n</div>'),(715,85,0,358,'Áo vest kẻ II'),(716,76,0,358,'<div class=\"tab-content active showContent\">\r\n<p>Áo vest cổ hai ve cách điệu. Tay dài có 4 khuy. Có 1 túi trước ngực, 2 vuông có nắp 2 bên, có 3 túi lót bên trong. Có 2 khuy cài mặt trước. Xẻ tà 2 bên phía sau.</p>\r\n<p>Để tạo nên những bộ suit đẳng cấp, các nhà thiết kế tài ba của IVY Men tỉ mỉ trong từng đường chỉ, phom dáng cứng cáp từ cầu vai, vạt áo cho đến chiều dài chuẩn của ống tay đều được IVY Men chú trọng.<br />Đi cùng là chất liệu cao cấp nhập khẩu từ Nhật Bản. Tất cả tạo nên những bộ Suit hoàn hảo - Chuẩn mực tối thượng của sự lịch lãm đầy nam tính.</p>\r\n<p>Màu sắc: Kẻ Ghi Khói - Kẻ Chì - Kẻ Nâu Cà Phê - Kẻ Xanh Tím Than - Kẻ Đen</p>\r\n</div>'),(717,85,0,359,'Áo vest dạ cổ 2 ve II'),(718,76,0,359,'<div class=\"tab-content active showContent\">\r\n<p>Chất liệu dạ cao cấp, form dáng vừa vặn phù hợp với dáng người. Túi áo nắp hộp, có túi ngực, bên trong áo có túi sơ cua tiện lợi. Cánh tay áo đính thêm cúc tạo điểm nhấn, áo 2 lớp dày dặn ấm áp.</p>\r\n<p>Màu sắc: Họa tiết Ghi Khói</p>\r\n</div>'),(719,85,0,360,'Quần lửng nam Khaki'),(720,76,0,360,'<div class=\"tab-content active showContent\">\r\n<p>Quần lửng khaki ngang gối. Cạp có đỉa. Có 2 túi phía trước và 2 túi có khuy cài phía sau. Thêu chữ IVY men 1 bên viền túi. Cài phía trước bằng khóa kéo và khuy.</p>\r\n<p>Thiết kế ấn tượng nhưng không kém phần ấn tượng cho nam giới diện mạo cuốn hút. Màu sắc cơ bản, độ dài ngang gối, có thể linh hoạt phối hợp với nhiều trang phục khác nhau trong mùa hè.</p>\r\n<p>Màu sắc: Gold - Xanh Nước Biển </p>\r\n<p><strong>Mẫu mặc size 31:</strong></p>\r\n<ul>\r\n<li><em><strong>Chiều cao:</strong></em> 1m86</li>\r\n<li><em><strong>Cân nặng:</strong></em> 75kg</li>\r\n<li><em><strong>Số đo 3 vòng</strong></em>: 100-82-98 cm</li>\r\n</ul>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(721,85,0,361,'Quần lửng'),(722,76,0,361,'<div class=\"tab-content active showContent\">\r\n<p>Quần lửng thiết kế độc quyền bởi thương hiệu IVY moda. Cạp sử dụng khóa và khuy kim loại, thiết kế túi vuông có nắp, xung quanh pha viền đen nổi bật. Chất liệu co dãn nhẹ tạo cảm giác vô cùng thoái mái. </p>\r\n<p>Chất liệu tạo nên sản phẩm chính là Vải khaki có tính chất chung là bền, mát, không nhăn, hút ẩm tốt, có co giãn.</p>\r\n</div>'),(723,85,0,362,'Quần Sooc Jean Nam'),(724,76,0,362,'<p>Quần sooc bò dáng regular fit. Có 2 túi chéo phía trước và 2 túi vuông phía sau. Cạp sử dụng khóa và khuy kim loại, mặt trước tạo vạch bạc cá tính. </p>'),(725,85,0,363,'Quần sooc thun cạp dây kéo rút'),(726,76,0,363,'<div class=\"tab-content active showContent\">\r\n<p>Quần sooc ngang gối dáng Regular. Có 2 túi chéo, 2 túi vuông có nắp bên ống quần. Có dây kéo rút, cạp chun co giãn.</p>\r\n<p>Dễ dàng kết hợp cùng nhiều trang phục như áo thun, sơ mi,... mát mẻ. Gam màu lạ mắt trẻ trung dễ dàng phối với nhiều trang phục. Thiết kế thời trang, mang lại vẻ năng động và trẻ trung</p>\r\n<p>Màu sắc: Đen - Gold</p>\r\n<p><strong>Mẫu mặc size L:</strong></p>\r\n<p>Chiều cao: 1m85<br />Cân nặng: 75kg<br />Số đo 3 vòng: 100-78-95 cm</p>\r\n</div>'),(727,85,0,364,'Quần lửng khaki'),(728,76,0,364,'<div class=\"tab-content active showContent\">\r\n<p>Quần lửng khaki cạp chun co giãn có dây kéo rút. 2 túi chéo và 2 túi vuông có nắp phía sau. Thiết kế ấn tượng nhưng không kém phần ấn tượng cho nam giới diện mạo cuốn hút. Màu sắc cơ bản, độ dài ngang gối, có thể linh hoạt phối hợp với nhiều trang phục khác nhau.</p>\r\n<p>Màu sắc: Ghi Khói - Xanh Lơ</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br /><strong>Chiều cao:</strong> 1m85<br /><strong>Cân nặng: </strong>75kg<br /><strong>Số đo 3 vòng: </strong>100-78-95 cm</p>\r\n</div>'),(729,85,0,365,'Quần lửng kẻ khuy lệch'),(730,76,0,365,'<div class=\"tab-content active showContent\">\r\n<p>Quần lửng cạp cao có đỉa, khuy cài lệch 1 bên. 2 túi chéo và 2 túi vuông phía sau. Chiều dài ngang gối. Cài bằng dây khóa kéo và khuy</p>\r\n<p>Là chiếc quần lửng nam là must-have-item (món đồ không thể thiếu) của bất cứ quý ông nào. Sử dụng chất vải thô cotton họa tiết kẻ với độ thông thoáng, thoải mái phù hợp với tất cả các mùa, đặc biệt là mùa hè với tính ứng dụng cao trong đời sống hàng ngày. Đây cũng là chiếc quần tương đối dễ phối nên cánh màu râu có thể tự tin mix &amp; match.</p>\r\n<p>Màu sắc: Kẻ Xanh Lơ</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br /><strong>Chiều cao:</strong> 1m85<br /><strong>Cân nặng: </strong>75kg<br /><strong>Số đo 3 vòng: </strong>100-78-95 cm</p>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(731,85,0,366,'Quần lửng 2 túi'),(732,76,0,366,'<div class=\"tab-content active showContent\">\r\n<p>Quần lửng ngang đùi. Có 2 túi chéo phía trước và túi phía sau. Đáp túi vuông có nắp hai bên ống quần. Cài phía trước bằng khóa kéo và khuy. Vải khaki thun với độ bền chắc, không phai màu, ít bị nhăn và đặc biệt không bị xù lông trong quá trình sử dụng hay sau khi giặt.</p>\r\n<p>Thiết kế ấn tượng nhưng không kém phần ấn tượng cho nam giới diện mạo cuốn hút. Màu sắc cơ bản, độ dài ngang gối, có thể linh hoạt phối hợp với nhiều trang phục khác nhau trong mùa hè.</p>\r\n<p>Màu sắc: Đen - Trắng</p>\r\n</div>'),(733,85,0,367,'Quần lửng cạp chun co giãn'),(734,76,0,367,'<div class=\"tab-content active showContent\">\r\n<p>Quần lửng cạp chun co giãn. Có 2 túi chéo có dây kéo khóa, 2 túi may viền phía sau. Chất liệu thun co dãn nhẹ tạo cảm giác vô cùng thoái mái.</p>\r\n<p>Màu sắc: Xanh Dương Đậm - Gold - Đen</p>\r\n</div>'),(735,85,0,368,'Quần lửng thun ngang gối'),(736,76,0,368,'<div class=\"tab-content active showContent\">\r\n<p>Quần lửng thun cạp cao có dây kéo rút. 2 túi chéo và 2 túi vuông phía sau. Cài bằng dây kéo khóa và khuy cài. </p>\r\n<p>Chất liệu thun co dãn nhẹ tạo cảm giác vô cùng thoái mái.</p>\r\n<p>Màu sắc: Bạc Hà - Ghi Khói - Xanh Dương Đậm</p>\r\n</div>'),(737,85,0,369,'Quần lửng II'),(738,76,0,369,'<p>Quần lửng thiết kế độc quyền bởi thương hiệu IVY moda. Cạp sử dụng khóa và khuy kim loại, thiết kế túi vuông có nắp, xung quanh pha viền đen nổi bật. Chất liệu co dãn nhẹ tạo cảm giác vô cùng thoái mái. </p>\r\n<p>Chất liệu tạo nên sản phẩm chính là Vải khaki có tính chất chung là bền, mát, không nhăn, hút ẩm tốt, có co giãn.</p>'),(739,85,0,370,'Quần bò nam slim fit'),(740,76,0,370,'<div class=\"tab-content active showContent\">\r\n<p>- Quần jeans dài chạm mắt cá chân</p>\r\n<p>- Dáng quần ôm nhẹ, ống đứng</p>\r\n<p>- Đằng trước có khuy cài và khóa kéo. Phía sau có túi ngang, phía trước có 2 túi chéo.</p>\r\n</div>'),(741,85,0,371,'Quần Sooc Jeans Regular'),(742,76,0,371,'<div class=\"tab-content active showContent\">\r\n<p>Quần sooc jeans nam ngang gối. Cạp có đỉa. Có 5 túi. Mặt trước mài sáng.</p>\r\n<p>- Thành phần chủ yếu cotton: Mềm mại, an toàn cho da nhạy cảm nhất<br />- Không sử dụng các chất làm màu, hóa chất độc. Khi mua jeans, khách hàng được tặng gói hút ẩm để bảo quản sp tối ưu<br />- Có độ bền cao, hạn chế phai, bạc màu: Khóa YKK, cúc được sản xuất riêng. Quá trình giặt cầm màu cho màu bền hơn.</p>\r\n<p>Màu sắc: Xanh Lơ</p>\r\n</div>'),(743,85,0,372,'Quần bò Regular fit'),(744,76,0,372,'<div class=\"tab-content active showContent\">\r\n<p>Quần jeans ống suông, dài qua mắt cá chân. Kiểu bạc màu. Gấu lật. Có 5 túi. Cài phía trước bằng khóa kéo và khuy.</p>\r\n<p>- Thành phần chủ yếu cotton: Mềm mại, an toàn cho da nhạy cảm nhất<br />- Không sử dụng các chất làm màu, hóa chất độc. Khi mua jeans, khách hàng được tặng gói hút ẩm để bảo quản sp tối ưu<br />- Có độ bền cao, hạn chế phai, bạc màu: Khóa YKK, cúc được sản xuất riêng. Quá trình giặt cầm màu cho màu bền hơn.</p>\r\n<p>Màu sắc: Xanh Lơ</p>\r\n</div>'),(745,85,0,373,'Quần bò Slim fit'),(746,76,0,373,'<div class=\"tab-content active showContent\">\r\n<p>Quần jeans ống đứng. Gấu lật. Có 5 túi. Mặt trước mài sáng. Cài phía trước bằng khóa kéo và khuy. Dáng quần Slim fit là sản phẩm must-have trong tủ đồ của bạn vì tính ứng dụng rất cao. Phù hợp với mọi tỉ lệ cơ thể cũng như biến hóa với gần như tất cả outfit của bạn. </p>\r\n<p>- Thành phần chủ yếu cotton: Mềm mại, an toàn cho da nhạy cảm nhất<br />- Không sử dụng các chất làm màu, hóa chất độc. Khi mua jeans, khách hàng được tặng gói hút ẩm để bảo quản sp tối ưu<br />- Có độ bền cao, hạn chế phai, bạc màu: Khóa YKK, cúc được sản xuất riêng. Quá trình giặt cầm màu cho màu bền hơn.</p>\r\n<p>Màu sắc: Xanh Lơ</p>\r\n</div>'),(747,85,0,374,'Quần bò đen dáng Slim fit'),(748,76,0,374,'<div class=\"tab-content active showContent\">\r\n<p>Quần bò cạp sử dụng khóa và khuy kim loại. Có 5 túi. Ống quần đứng.</p>\r\n<p>- Thành phần chủ yếu cotton: Mềm mại, an toàn cho da nhạy cảm nhất<br />- Không sử dụng các chất làm màu, hóa chất độc. Khi mua jeans, khách hàng được tặng gói hút ẩm để bảo quản sp tối ưu<br />- Có độ bền cao, hạn chế phai, bạc màu: Khóa YKK, cúc được sản xuất riêng. Quá trình giặt cầm màu cho màu bền hơn.</p>\r\n<p>Màu sắc: Đen</p>\r\n</div>'),(749,85,0,375,'Quần jeans nam ống suông cao cấp'),(750,76,0,375,'<p>Thuộc phong cách Casual đơn giản, quần jean nam đẹp ống suông đang nhận được nhiều sự quan tâm và trở thành items ưa thích của phái nam, đặc biệt là những tín đồ thời trang trẻ. <br />Kiểu dáng sang trọng, sành điệu cùng với sự rộng rãi thoải mái của chiếc <a href=\"https://ivymoda.com/danh-muc/quan-lung-nam\">quần lửng nam</a> này sẽ khiến các chàng trai mê mẩn và là một items tạo nên set đồ cực kỳ thời trang và chắc chắn được nhiều chàng trai muốn sở hữu nó trong tủ đồ của mình. Với nhiều cách phối đồ cực chất và năng động với quần bò nam, cùng các gam màu cực trend phù hợp với mọi lứa tuổi khác nhau.</p>'),(751,85,0,376,'Quần jeans nam skinny'),(752,76,0,376,'<p>Với các chàng trai thì quần jeans skinny là một trong những biểu tượng thời trang cực kỳ quen thuộc và không thể thiếu trong tủ đồ với thiết kế nhẹ nhàng, basic, không quá ôm sát vào cơ thể nên cực kỳ tôn dáng nhằm đem lại cảm giác thoải mái cho người mặc. <br />Quần jeans nam skinny được thiết kế với dáng suông mềm mại, chất liệu vải co giãn tốt hơn, ôm sát nên dễ dàng di chuyển vận động. Jeans skinny sẽ đem lại một cảm giác nhẹ nhàng và thoải mái nhất có thể.</p>'),(753,85,0,377,'Quần bò nam rách'),(754,76,0,377,'<p>Quần bò nam rách là một trong những xu hướng mới rất trend được giới trẻ cực kỳ ưa chuộng nên rất thích hợp với các mùa trong năm. <br />Với chất liệu bò dày dặn và được mài rách nên các chàng trai sẽ trở nên rất năng động, trẻ trung, cuốn hút. Phong cách của bạn sẽ trở nên cuốn hút hơn khi bạn mix cùng các phụ kiện thời trang như kính mắt, đồng hồ, sneaker...như vậy đã giúp bạn tạo nên một set đồ hoàn hảo tự tin dạo chơi xuống phố.</p>'),(755,85,0,378,'Quần bò đen nam'),(756,76,0,378,'<p>Dù xuất hiện đã khá là lâu nhưng quần jeans đen vẫn luôn là một lựa chọn hàng đầu được phái mạnh yêu thích vì phong cách đa dạng cùng với sự thoải mái. <br />Đây được coi là một trong những items nên có trong tủ đồ của mỗi người. Quần jeans nam đen giúp người mặc dễ dàng phối đồ, trước khi phối đồ sao cho thật chất thì bạn nên chọn cho mình dáng quần phù hợp với cơ thể. <br />Với những chàng trai ưa chuộng sự thoải mái thì quần jean đen là một sự lựa chọn nổi bật dành cho bạn.</p>'),(757,85,0,379,'Quần jean nam đẹp co giãn – body'),(758,76,0,379,'<p>Dáng quần co giãn body hay còn gọi là quần skinny jean được thiết kế ôm sát với cơ thể nên rất vừa vặn, tuy nhiên quần co giãn body nam không quá bó sát cơ thể nam giới.</p>\r\n<p>Tạo cảm giác thoải mái và khiến người mặc trẻ trung hơn rất nhiều, quần jeans body đang trở nên cực kỳ thịnh hành và trở thành trendy hiện nay. Dáng quần này được phối với nhiều kiểu áo và các phong cách nổi bật khác nhau.</p>'),(759,85,0,380,'Quần bò nam ống côn'),(760,76,0,380,'<p>Quần bò nam ống côn với thiết kế trẻ trung năng động, mạnh mẽ nên khi xuất hiện quần jeans nam được hưởng ứng và rất được ưa chuộng nhận được sự quan tâm của phái nam. Items này không quá ôm sát đôi chân nhưng phần cuối ống quần có độ ôm vừa phải tạo nên form dáng cực đẹp.</p>\r\n<p>Quần ống côn với các gam màu trend như xanh đậm, xanh nhat, đen.</p>\r\n<h3> </h3>'),(761,85,0,381,'Quần bò nam phong cách Hàn Quốc'),(762,76,0,381,'<p>Mẫu quần jean theo phong cách Hàn Quốc đang trở thành hot trend trong những năm trở lại đây hay còn được gọi là quần jean 9 tấc bởi chiều dài rất đặc biệt của chiếc quần này.</p>\r\n<p>Khác với quần skinny ôm, quần baggy có thiết kế khá là thụng. Quần jean baggy có form dáng giống với quần suông nhưng không rộng thùng thình mà đến phần bắp chân sẽ nhỏ lại, tạo nên một cảm giác thoải mái tới người mặc nên quần jean nam theo phong cách Hàn Quốc rất được ưa chuộng.</p>\r\n<h3> </h3>'),(763,85,0,382,'Quần jeans nam ống rộng'),(764,76,0,382,'<p>Được xuất hiện từ khá là lâu nhưng rất được các chàng trai ưu tiên lựa chọn , thay đổi phong cách ăn mặc của mình. Quần jean ống rộng còn được coi là mốt thời trang hiphop với thiết kế nhẹ nhàng, basic, items này chỉ rộng và lỏng hơn một chút với quần jean xanh thiết kế truyền thống.</p>\r\n<p>Quần jean ống rộng là kiểu dáng chủ yếu được các chàng trai ưa chuộng và chọn lựa. Bên cạnh đó, hiện nay quần jean nam đẹp ống rộng còn có thiết kế túi hộp có dây kéo và vòng đai cùng chất liệu làm từ denim cotton.</p>'),(765,85,0,383,'Quần Âu kẻ caro'),(766,76,0,383,'<div class=\"tab-content active showContent\">\r\n<p>Quần Âu Kẻ caro có 2 túi chéo phía trước, 2 túi viền có 1 khuy phía sau. Đai quần có đỉa. Cài phía trước bằng khóa kéo và khuy.</p>\r\n<p>Form dáng Slim kết hợp kẻ caro tạo phong cách trẻ trung. Kiểu dáng hoàn hảo dành cho các chàng trai văn phòng, công sở. Bạn có thể thoải mái mặc từ những ngày đi làm bình thường hay những buổi họp hành cần sự chỉnh chu. Chất vải mềm mịn cùng lót trong sắc nét, tạo cảm giác thoải mái khi di chuyển và làm việc. </p>\r\n<p>Kết hợp với vest cùng set tạo nên 1 bộ trang phục lịch lãm, sang trọng.</p>\r\n<p>Màu sắc: Kẻ Ghi Khói - Kẻ Đen - Kẻ Xanh Dương Đậm</p>\r\n</div>'),(767,85,0,384,'Quần Tây kẻ caro'),(768,76,0,384,'<div class=\"tab-content active showContent\">\r\n<p>Quần Âu Kẻ caro có 2 túi chéo phía trước, 2 túi viền có 1 khuy phía sau. Đai quần có đỉa. Cài phía trước bằng khóa kéo và khuy.</p>\r\n<p>Form dáng Slim kết hợp kẻ caro tạo phong cách trẻ trung. Kiểu dáng hoàn hảo dành cho các chàng trai văn phòng, công sở. Bạn có thể thoải mái mặc từ những ngày đi làm bình thường hay những buổi họp hành cần sự chỉnh chu. Chất vải mềm mịn cùng lót trong sắc nét, tạo cảm giác thoải mái khi di chuyển và làm việc. </p>\r\n<p>Kết hợp với vest cùng set tạo nên 1 bộ trang phục lịch lãm, sang trọng.</p>\r\n<p>Màu sắc: Kẻ Ghi Khói - Kẻ Đen - Kẻ Xanh Dương Đậm</p>\r\n</div>'),(769,85,0,385,'Quần Âu Nam Đẹp Dáng Slim'),(770,76,0,385,'<div class=\"tab-content active showContent\">\r\n<p>Quần Âu Kẻ caro có 2 túi chéo phía trước, 2 túi viền có 1 khuy phía sau. Đai quần có đỉa. Cài phía trước bằng khóa kéo và khuy.</p>\r\n<p>Form dáng Slim kết hợp kẻ caro tạo phong cách trẻ trung. Kiểu dáng hoàn hảo dành cho các chàng trai văn phòng, công sở. Bạn có thể thoải mái mặc từ những ngày đi làm bình thường hay những buổi họp hành cần sự chỉnh chu. Chất vải mềm mịn cùng lót trong sắc nét, tạo cảm giác thoải mái khi di chuyển và làm việc. </p>\r\n<p>Kết hợp với áo sơ mi và vest cùng set tạo nên 1 bộ trang phục lịch lãm, sang trọng.</p>\r\n<p>Màu sắc: Họa tiết Chì - Họa tiết Xanh Dương Đậm - Họa tiết Nâu Đen - Họa tiết Xanh Tím Than</p>\r\n</div>'),(771,85,0,386,'Quần dài kẻ dáng Slim'),(772,76,0,386,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài đai khuy lệch có đỉa. Có 2 túi chéo. 2 túi sau may viền có khuy cài. Gấu quần may sẵn kiểu lật.</p>\r\n<p>Với độ ôm vừa phải, tôn dáng và che khuyết điểm rất tốt mang lại vẻ hiện đại, đẳng cấp. Được làm bằng chất liệu Tuysi có độ thấm hút cao, hạn chế nhăn nhàu giữ cho dáng quần luôn như mới.</p>\r\n<p>Màu sắc: Kẻ Đen - Kẻ Xanh Tím Than - Kẻ Ghi Khói - Kẻ Chì - Kẻ Nâu Cà Phê</p>\r\n</div>'),(773,85,0,387,'Quần tây kẻ dáng Slim'),(774,76,0,387,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài đai khuy lệch có đỉa. Có 2 túi chéo. 2 túi sau may viền có khuy cài. Gấu quần may sẵn kiểu lật.</p>\r\n<p>Với độ ôm vừa phải, tôn dáng và che khuyết điểm rất tốt mang lại vẻ hiện đại, đẳng cấp. Được làm bằng chất liệu Tuysi có độ thấm hút cao, hạn chế nhăn nhàu giữ cho dáng quần luôn như mới.</p>\r\n<p>Màu sắc: Kẻ Đen - Kẻ Xanh Tím Than - Kẻ Ghi Khói - Kẻ Chì - Kẻ Nâu Cà Phê</p>\r\n</div>'),(775,85,0,388,'Quần tây nam'),(776,76,0,388,'<table width=\"70%\">\r\n<tbody>\r\n<tr>\r\n<td style=\"padding-bottom: 5px;\"><strong>Dòng sản phẩm</strong></td>\r\n<td style=\"padding-bottom: 5px;\">Men</td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding-bottom: 5px;\"><strong>Nhóm sản phẩm</strong></td>\r\n<td style=\"padding-bottom: 5px;\">Quần</td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding-bottom: 5px;\"><strong>Kiểu dáng</strong></td>\r\n<td style=\"padding-bottom: 5px;\">Regular</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Chi tiết bảo quản sản phẩm : </p>\r\n<p><strong>* Các sản phẩm thuộc dòng cao cấp (Senora) và áo khoác (dạ, tweed, lông, phao) chỉ giặt khô, tuyệt đối không giặt ướt.</strong></p>'),(777,85,0,389,'Quần tây nam vải kẻ'),(778,76,0,389,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài ống suông. Cài phía trước bằng khóa kéo và khuy. Họa tiết kẻ trẻ trung, năng động.</p>\r\n<p>Chất liệu thô thấm mồ hôi rất tốt. Với độ dày vừa phải và ưu thế thấm hút mồ hôi vượt trội. Khi mặc lên cơ thể, bạn sẽ có cảm giác thoải mái, rất dễ chịu vì có độ mát, thông thoáng mà không bị nóng, bí hay ngột ngạt khó chịu.<br />Form ống đứng cổ điển, nam tính, không kén dáng người và thích hợp nhiều độ tuổi. Dễ dàng kết hợp cùng nhiều trang phục như áo thun, sơ mi, blazer...</p>\r\n</div>'),(779,85,0,390,'Quần tây nam kẻ'),(780,76,0,390,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài ống suông. Cài phía trước bằng khóa kéo và khuy. Họa tiết kẻ trẻ trung, năng động.</p>\r\n<p>Chất liệu thô thấm mồ hôi rất tốt. Với độ dày vừa phải và ưu thế thấm hút mồ hôi vượt trội. Khi mặc lên cơ thể, bạn sẽ có cảm giác thoải mái, rất dễ chịu vì có độ mát, thông thoáng mà không bị nóng, bí hay ngột ngạt khó chịu.<br /><br />Form ống đứng cổ điển, nam tính, không kén dáng người và thích hợp nhiều độ tuổi. Dễ dàng kết hợp cùng nhiều trang phục như áo thun, sơ mi, blazer...</p>\r\n</div>'),(781,85,0,391,'Quần dài fit dáng'),(782,76,0,391,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài, ống ôm nhẹ. Độ dài chạm mắt cá chân. Đai quần có khuy cài và đỉa. Khóa dạng kéo. Đằng sau có 2 túi giả.</p>\r\n<p>Một chiếc quần fit dáng là item mà mọi chàng trai không thể bỏ qua. Thiết kế ôm nhẹ tôn dáng khiến đôi chân người mặc trông dài và thon hơn rất nhiều. Sắc tối dễ mix-match cùng nhiều thiết kế áo khác. Với những chàng trai trẻ trung, đây sẽ là chiếc quần phù hợp cho cả ngày đi chơi và đi làm.</p>\r\n<p>Màu sắc: Kẻ chì - Kẻ xanh tím than</p>\r\n<p><strong>Mẫu mặc size L:</strong><br /><br /><strong>Chiều cao:</strong> 1m85<br /><strong>Cân nặng: </strong>75kg<br /><strong>Số đo 3 vòng: </strong>100-78-95 cm</p>\r\n</div>'),(783,85,0,392,'Quần âu nam dáng Slim'),(784,76,0,392,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài đai khuy lệch có đỉa. Có 2 túi chéo. 2 túi sau may viền có khuy cài. Quần dáng Slim.</p>\r\n<p>Với độ ôm vừa phải, tôn dáng và che khuyết điểm rất tốt mang lại vẻ hiện đại, đẳng cấp. Được làm bằng chất liệu Tuysi có độ thấm hút cao, hạn chế nhăn nhàu giữ cho dáng quần luôn như mới.</p>\r\n<p>Màu sắc: Chì - Ghi Khói</p>\r\n</div>'),(785,85,0,393,'Giày lười nam da thật'),(786,76,0,393,'<div class=\"tab-content active showContent\">\r\n<p>Giày nam thiết kế kiểu giày lười, quai ngang có dây. Đế giày cao 3cm chắc chắn, chống trơn trượt. Đường may chi tiết, tỉ mỉ theo tiêu chuẩn. </p>\r\n<p>Chất liệu da bò thật vẫn giữ được độ sáng nhẹ sang trọng và đường nét hiện đại mạnh mẽ. Block nguyên cao su đế có độ cao hồi, giảm xóc tốt giúp chuyển đổi dễ dàng hơn. Đế lót dày chú trọng vào sự bảo đảm thoải mái cho ngày dài bận rộn.  Kết hợp cùng quần âu, kaki, trang phục lịch sự.</p>\r\n<p>Màu sắc: Đen</p>\r\n</div>'),(787,85,0,394,'Giày lười quai ngang'),(788,76,0,394,'<div class=\"tab-content active showContent\">\r\n<p>Giày nam thiết kế kiểu giày lười, quai ngang có dây đan và khóa kim loại. Đế giày cao 3cm chắc chắn, chống trơn trượt. Đường may chi tiết, tỉ mỉ theo tiêu chuẩn. </p>\r\n<p>Chất liệu da bò thật vẫn giữ được độ sáng nhẹ sang trọng và đường nét hiện đại mạnh mẽ. Block nguyên cao su đế có độ cao hồi, giảm xóc tốt giúp chuyển đổi dễ dàng hơn. Đế lót dày chú trọng vào sự bảo đảm thoải mái cho ngày dài bận rộn.  Kết hợp cùng quần âu, kaki, trang phục lịch sự.</p>\r\n<p>Màu sắc: Đen</p>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(789,85,0,395,'Dép nam xỏ ngón'),(790,76,0,395,'<div class=\"tab-content active showContent\">\r\n<p>Dép nam xỏ ngón dây đôi với sự tối giản trong thiết kế, quai bảng vừa ôm chân với họa tiết cách điệu, phần thanh kẹp được bọc da thật cao cấp giảm thiểu sự ma sát. Phần quai và lót được cắt may bằng da thật cao cấp đảm bảo sự êm ái trong suốt ngày dài bận rộn.</p>\r\n<p>Màu sắc: Đen - Nâu cà phê</p>\r\n</div>'),(791,85,0,396,'Giầy lười nam đục lỗ'),(792,76,0,396,'<div class=\"tab-content active showContent\">\r\n<p>Giày lười nam họa tiết lỗ. Đế giày chắc chắn, chống trơn trượt. Từng đường may kép tỉ mỉ, chắc chắn chạy quanh giày. Chất liệu da bò thật cùng thiết kế cách điệu với họa tiết lỗ ở thân giày tạo cảm giác nam tính. Mũi giày tròn, bo viền chắc chắn</p>\r\n<p>Màu sắc: Đen - Xanh Dương Đậm</p>\r\n</div>'),(793,85,0,397,'Dép quai ngang nam da bò cao cấp'),(794,76,0,397,'<div class=\"tab-content active showContent\">\r\n<p>Dép xăng đan nam có kiểu dáng đơn giản để bạn dễ dàng mang vào chân nhanh chóng và tiện lợi. Dễ dàng kết hợp với nhiều loại trang phục như quần jeans, quần kaki, quần vải đũi... để xuống phố cùng bạn bè. </p>\r\n<ul>\r\n<li>Quai da bò chắc chắn, nhanh khô.</li>\r\n<li>Keo dán chống nước bền bỉ và chắc chắn.</li>\r\n<li>Đế cao su nguyên chất chống trơn trợt.</li>\r\n<li>Dễ dàng lau chùi và vệ sinh.</li>\r\n<li>Kiểu dáng thời trang, hợp phong cách giới trẻ.</li>\r\n</ul>\r\n<p>Thích hợp mang đi mưa, đi biển, dạo phố, đi chơi,...</p>\r\n</div>'),(795,85,0,398,'Giày da trơn buộc dây'),(796,76,0,398,'<div class=\"tab-content active showContent\">\r\n<p>Giày nam thiết kế thắt dây. Đế giày cao 3cm chắc chắn, chống trơn trượt. Đường may chi tiết, tỉ mỉ theo tiêu chuẩn.</p>\r\n<p>Chất liệu da thật cùng thiết kế hiện đại, trẻ trung phù hợp với các quý ông năng động. Kết hợp cùng quần âu, kaki, trang phục lịch sự.</p>\r\n<p>Màu sắc: Đen - Nâu Cà Phê</p>\r\n</div>'),(797,85,0,399,'Giầy thể thao da PU'),(798,76,0,399,'<table width=\"70%\">\r\n<tbody>\r\n<tr>\r\n<td style=\"padding-bottom: 5px;\"><strong>Dòng sản phẩm</strong></td>\r\n<td style=\"padding-bottom: 5px;\">Accessories</td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding-bottom: 5px;\"><strong>Nhóm sản phẩm</strong></td>\r\n<td style=\"padding-bottom: 5px;\">Giày</td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding-bottom: 5px;\"><strong>Kiểu dáng</strong></td>\r\n<td style=\"padding-bottom: 5px;\">Giày thể thao</td>\r\n</tr>\r\n</tbody>\r\n</table>'),(799,85,0,400,'Giầy thể thao'),(800,76,0,400,'<div class=\"tab-content hideContent active\">\r\n<ul>\r\n<li>Thân giày được làm từ chất liệu Da Microfiber, vải</li>\r\n<li>Lớp lót bằng vải chuyên dụng giúp thoáng mát đôi chân</li>\r\n<li>Đế giày được làm từ cao su non tự nhiên</li>\r\n</ul>\r\n</div>'),(801,85,0,401,'Giầy'),(802,76,0,401,'<div class=\"tab-content hideContent active\">\r\n<ul>\r\n<li>Thân giày được làm từ chất liệu Da Microfiber, vải</li>\r\n<li>Lớp lót bằng vải chuyên dụng giúp thoáng mát đôi chân</li>\r\n<li>Đế giày được làm từ cao su non tự nhiên</li>\r\n</ul>\r\n</div>'),(803,85,0,402,'Giày lười quai ngang - II'),(804,76,0,402,'<p>Giày nam thiết kế kiểu giày lười, quai ngang có dây đan và khóa kim loại. Đế giày cao 3cm chắc chắn, chống trơn trượt. Đường may chi tiết, tỉ mỉ theo tiêu chuẩn. </p>\r\n<p>Chất liệu da bò thật vẫn giữ được độ sáng nhẹ sang trọng và đường nét hiện đại mạnh mẽ. Block nguyên cao su đế có độ cao hồi, giảm xóc tốt giúp chuyển đổi dễ dàng hơn. Đế lót dày chú trọng vào sự bảo đảm thoải mái cho ngày dài bận rộn.  Kết hợp cùng quần âu, kaki, trang phục lịch sự.</p>'),(805,85,0,403,'Kẹp cà vạt XV.IVY'),(806,76,0,403,'<div class=\"tab-content active showContent\">\r\n<p>Kẹp cà vạt IVY men  được làm bằng hợp kim cao cấp, chống rỉ sét, mang lại sự sang trọng và đẳng cấp cho các quý ông. Mẫu thiết kế với các họa tiết độc đáo và tinh tế. Sản phẩm được chúng tôi nghiên cứu và lựa chọn phù hợp với nhiều loại cà vạt, áo vest, ghi lê, sơ mi…</p>\r\n<p>Chiều dài: 5cm</p>\r\n<p>Màu sắc: Đen - Bạc</p>\r\n</div>'),(807,85,0,404,'Tất nam dáng dài Ultra Slim'),(808,76,0,404,'<div class=\"tab-content active showContent\">\r\n<p>Tất trơn cotton, hạn chế vi khuẩn: Hút ẩm - Giữ ấm - Thoải mái - Mềm mại. Thành phần cotton tự nhiên có khả năng giữ nhiệt cao tạo cảm giác thư giãn khi mang. Bảo vệ và cải thiện sức khỏe khi sử dụng.</p>\r\n<p>Màu sắc: Kẻ Ghi Khói</p>\r\n</div>'),(809,85,0,405,'Cà vạt nam'),(810,76,0,405,'<div class=\"tab-content active showContent\">\r\n<p>Họa tiết thanh lịch màu sắc đa dạng, Cà vạt đẹp sẽ là phụ kiện giúp các quý ông nổi bật đầy nam tính. Chất liệu lụa cao cấp mềm mịn tạo cảm giác thoải mái khi sử dụng.</p>\r\n<p>Phối hợp cùng với vest tạo nên một phong cách thời trang mới mẻ, lịch sự và trang trọng.</p>\r\n<p>Màu sắc: Bạc Hà - Xanh Cổ Vịt Đậm - Xanh Dương Đậm - Họa tiết Ghi Khói</p>\r\n</div>'),(811,85,0,406,'Thắt lưng'),(812,76,0,406,'<div class=\"tab-content active showContent\">\r\n<p>Thắt lưng bằng da. Có Khóa cài bằng kim loại. Mặt khóa trượt linh hoạt với các size quần. Dễ dàng kết hợp với các trang phục công sở, lịch sự. Đường chỉ may tinh tế ẩn phía trong, ray nhựa cứng bền bỉ.</p>\r\n<p><strong>Kích thước:</strong> Bản dây 4cm (thông dụng) Chiều dài khoảng 125 cm</p>\r\n<p>Màu sắc: Đen</p>\r\n</div>'),(813,85,0,407,'Kính râm nam cao cấp'),(814,76,0,407,'<div class=\"tab-content active showContent\">\r\n<p>Kính râm nam cao cấp. Gọng sử dụng chất liệu kim loại cao cấp, mang đến các đặc tính ưu việt cho sản phẩm như: độ cứng cơ học cao, chịu nhiệt tốt, không bị tác động trước các điều kiện môi trường, bề mặt đen nhám trơn…</p>\r\n<p>Ngoài ra, kích thước mắt kính bản to càng tô lên vẻ thời trang cho người sử dụng. Tròng râm được trang bị đầy đủ tính năng của một chiếc kính râm chất lượng, chống chói lóa, chống tia cực tím UV400 gây hại cho mắt, tạo cảm giác thoải mái cho mắt khi tiếp xúc với ánh nắng mặt trời.</p>\r\n<p>Màu sắc: Gold - Đen</p>\r\n</div>'),(815,85,0,408,'Mũ lưỡi trai nam'),(816,76,0,408,'<div class=\"tab-content active showContent\">\r\n<p>Mũ lưỡi trai trơn. Có khóa cài điều chỉnh được.</p>\r\n<p>Phần đỉnh lưỡi trai dài: 7cm</p>\r\n<p>Màu sắc: Đen - Gold</p>\r\n</div>'),(817,85,0,409,'Túi xách nam công sở da PU'),(818,76,0,409,'<div class=\"tab-content active showContent\">\r\n<p>Túi xách, cặp da đeo ngang vai, Đựng được máy tính xách tay 14″, Ipad 9.7″, 7.9″ &amp; Máy tính bảng các loại. Kiểu dáng trẻ trung thời thượng. Có 2 ngăn phụ kéo khóa + 1 ngăn chính (bên trong có 2 ngăn nhỏ và các ngăn phụ)</p>\r\n<p><strong>Kích thước:</strong> Rộng 39 * Cao 29 * Dày 5 cm</p>\r\n<p><strong>Màu sắc: </strong>Đen - Nâu cafe</p>\r\n</div>'),(819,85,0,410,'Áo thun nàng tiên cá'),(820,76,0,410,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ tròn, tay ngắn. Dáng xuông. In hình và đính hạt bắt sáng tạo điểm nhấn.</p>\r\n<p>Màu sắc: Trắng</p>\r\n<p><em><strong>Mẫu mặc size 8-9:</strong></em></p>\r\n<ul>\r\n<li><em><strong>Chiều cao</strong> 1m29 </em></li>\r\n<li><em><strong>Cân nặng</strong> 29,5kg</em></li>\r\n</ul>\r\n</div>'),(821,85,0,411,'Áo khoác tweed thắt nơ'),(822,76,0,411,'<div class=\"tab-content active showContent\">\r\n<p>Áo khoác vải tweed cho bé gái. Cổ tròn có dây voan thắt nơ, tay dài viền vải dập tua rua. Có 2 túi vuông có nắp. Cài bằng hàng khuy phía trước.</p>\r\n<p>Màu sắc: Tím Lavender</p>\r\n<p><em><strong>Mẫu mặc size 8-9:</strong></em></p>\r\n<ul>\r\n<li><em><strong>Chiều cao</strong> 1m29 </em></li>\r\n<li><em><strong>Cân nặng</strong> 29,5kg</em></li>\r\n</ul>\r\n</div>'),(823,85,0,412,'Bộ đồ áo & chân váy - Have Fun'),(824,76,0,412,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ tròn, tay dài diềm bèo, bo gấu tạo bồng. In hình và chữ phía trước tạo điểm nhấn. Cổ, tay áo và gấu viền thun gân co giãn. Zuýp chữ A cạp chun co giãn có 2 túi chéo tiện lợi cho bé.</p>\r\n<p>Màu sắc: Đỏ - Trắng</p>\r\n<p><strong>Mẫu nhí mặc size 6-7:</strong> <strong>1m20 - 20kg</strong></p>\r\n</div>'),(825,85,0,413,'Áo len Your Queen'),(826,76,0,413,'<div class=\"tab-content active showContent\">\r\n<p>Lựa chọn kiểu dáng Peplum điệu đà làm điểm nhấn để tạo nên thiết kế áo xinh xắn cho bé yêu. Áo cổ tròn, tay ngắn và hơi bồng nhẹ. Trước ngực có thêu logo Queen bắt mắt. </p>\r\n<p>Áo sử dụng chất liệu len gân, mềm nhẹ, thích hợp để bé diện dưới tiết trời sang Thu - đầu Đông. </p>\r\n<p>Màu sắc: Áo có 2 màu </p>\r\n</div>'),(827,85,0,414,'Áo len Your Queen II'),(828,76,0,414,'<p>Lựa chọn kiểu dáng Peplum điệu đà làm điểm nhấn để tạo nên thiết kế áo xinh xắn cho bé yêu. Áo cổ tròn, tay ngắn và hơi bồng nhẹ. Trước ngực có thêu logo Queen bắt mắt. </p>\r\n<p>Áo sử dụng chất liệu len gân, mềm nhẹ, thích hợp để bé diện dưới tiết trời sang Thu - đầu Đông. </p>'),(829,85,0,415,'Áo thun in hoa có mũ'),(830,76,0,415,'<div class=\"tab-content active showContent\">\r\n<p>Áo hoodie với hình hoa in xinh xắn ở thân trước sẽ là một sự lựa chọn dễ thương và phù hợp cho bé gái trong mùa lạnh này.</p>\r\n<p>Thiết kế thân áo dáng hoodie, có mũ và dây kéo giúp bảo vệ bé khỏi gió lạnh, mưa nhẹ. Mặt trước của áo trang trí bằng hình in hoa tươi sáng, tạo nên sự ngọt ngào và dễ thương.</p>\r\n<p>Đặc biệt, Áo sử dụng chất liệu thun giữ nhiệt tốt nên bé sẽ luôn cảm thấy dễ chịu, tự tin khi mặc</p>\r\n</div>'),(831,85,0,416,'Áo thun xoắn eo'),(832,76,0,416,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun xoắn eo là một lựa chọn thời trang, xu hướng, hiện đại cho bé yêu. Áo thun có thiết kế xoắn ốc ở phần eo để tạo điểm nhấn, giúp áo trở nên nữ tính, dễ thương hơn. </p>\r\n<p>Mẹ lựa chọn mix áo cho con với quần jogger, quần shorts hoặc quần jean để tạo nên các outfits đẹp mắt, phù hợp nhiều dịp khác nhau.</p>\r\n</div>'),(833,85,0,417,'Áo thun Paint - Có mũ'),(834,76,0,417,'<div class=\"tab-content active showContent\">\r\n<p>Thiết kế áo thun cho bé phù hợp với thời tiết sang Thu, đầu Đông. Áo tay ngắn, cổ có mũ, kiểu dáng bo gấu vô cùng thoải mái. Trước áo được in hoạt hình đáng yêu, ngộ nghĩnh. </p>\r\n<p>Áo lựa chọn chất liệu thun cao cấp, mang đến cảm giác mặc nhẹ nhàng, dịu nhẹ cho làn da của bé. </p>\r\n<p>Màu sắc: Áo có vàng và tím</p>\r\n</div>'),(835,85,0,418,'Set bộ Feeling Happy'),(836,76,0,418,'<div class=\"tab-content active showContent\">\r\n<p>Bộ thun cho bé gái gồm áo dài tay và chân váy là một lựa chọn thời trang, xu hướng và thoải mái cho trẻ em trong mùa Thu/ Đông này. </p>\r\n<p>Set bộ lựa chọn chất liệu thun mềm, nhẹ nhàng và thoáng mát để đảm bảo sự thoải mái cho bé trong mọi tình huống. Áo được in họa tiết ngộ nghĩnh, sắc nét đảm bảo tính bền màu cao. </p>\r\n<p>Áo thun dài tay với thiết kế dễ thương, chân váy thiết kế ôm nhé giúp bé dễ vận động, cảm thấy thoải mái khi chơi đùa.</p>\r\n</div>'),(837,85,0,419,'Áo thun Hawaii'),(838,76,0,419,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ tròn, sau có khóa kéo và bo gấu. Áo độ dài thường, thân trước in hình nữ vũ động đang trình diễn vũ điệu Hawaii lôi cuốn. Áo có thể mix với quần shorts, chân váy hoặc quần legging để tạo nên trang phục phù hợp với nhiều hoàn cảnh và sở thích của bé.</p>\r\n<p>Áo thun Hawaii dài tay là một thiết kế vui nhộn và thoải mái cho bé trong mùa thu/ đông, giúp bé vừa tận hưởng không khí vui nhộn, vừa thỏa sức khám phái, vận động, giải trí.</p>\r\n</div>'),(839,85,0,420,'Quần sooc hoa thắt nơ'),(840,76,0,420,'<div class=\"tab-content active showContent\">\r\n<p>Quần sooc hoa cạp chun co giãn. Ống dài ngang đùi. 2 túi chéo 2 bên. Dây kéo rút 2 bên có dây thắt nơ.</p>\r\n<p>Màu sắc: Họa tiết Hồng san hô - Họa tiết Xanh Tím Than - Họa tiết Hồng Phấn</p>\r\n</div>'),(841,85,0,421,'Quần thun túi phối viền'),(842,76,0,421,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài dáng, bo gấu, cạp chun co giãn. Quần thiết kế 2 túi sườn nổi, có viền túi khác màu, tạo hiệu ứng bắt sáng. </p>\r\n<p>Đặc biệt, quần sử dụng chất liệu thun mềm mịn, giữ nhiệt tốt, an toàn cho da và phù hợp khi trẻ tham gia nhiều hoạt động. </p>\r\n</div>'),(843,85,0,422,'Quần suông thun gân'),(844,76,0,422,'<div class=\"tab-content active showContent\">\r\n<p>Mẫu quần thun gân rất thích hợp cho bé trong thiết trời vào thu se lạnh. Quần sử dụng chất liệu thun gân mềm mịn, giữ nhiệt tốt và đặc biệt an toàn cho da bé. </p>\r\n<p>Thiết kế quần suông, cạp chun co giãn, giúp bé thoải mái, dễ chịu khi làm gia các hoạt động. </p>\r\n</div>'),(845,85,0,423,'Quần sooc nhung tăm bé gái'),(846,76,0,423,'<div class=\"tab-content active showContent\">\r\n<p>Quần sooc độ dài trên đầu gối, cạp chun co giãn thoải mái. Thiết kế xếp ly trước tạo kiểu xòe nữ tính. Chất vải nhung gân dày dặn, mềm mịn.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 128 cm</p>\r\n<p><strong>Cân nặng:</strong> 28 kg</p>\r\n<p><strong>Mẫu mặc size 8-9</strong></p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua màn hình máy tính/ điện thoại.</p>\r\n</div>'),(847,85,0,424,'Quần nhung dài eo chun'),(848,76,0,424,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài dáng baggy cạp chun co giãn thoải mái, 2 túi chéo 2 bên. Vải nhung gân dày dặn, mềm mịn thích hợp diện khi trời lạnh.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 128 cm</p>\r\n<p><strong>Cân nặng:</strong> 28 kg</p>\r\n<p><strong>Mẫu mặc size 8-9</strong></p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(849,85,0,425,'Quần thun ống suông'),(850,76,0,425,'<div class=\"tab-content active showContent\">\r\n<p>Quần thun bé gái dáng dài, ống suông, cạp chun thoải mái. Điểm nhấn là 2 túi vuông phía trước. Chất liệu vải thun nỉ mềm mịn, thoải mái, giữ ấm tốt phù hợp cho bé mặc ở nhà, đi chơi. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 128 cm</p>\r\n<p><strong>Cân nặng:</strong> 28 kg</p>\r\n<p><strong>Mẫu mặc size 8-9</strong></p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(851,85,0,426,'Quần sooc khaki giả váy bé gái'),(852,76,0,426,'<div class=\"tab-content active showContent\">\r\n<p>Quần sooc giả váy dáng ngắn, xòe rộng. Cạp chun co giãn thoải mái. Chất liệu vải khaki cao cấp dày dặn, mềm mịn. Một thiết kế vừa xinh xắn nữ tính vừa kín đáo thoải mái giúp bé thỏa sức chạy nhảy vui chơi. Quần dễ dàng mix với nhiều kiểu áo, phù hợp cho bé diện đi học và đi chơi.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 128 cm</p>\r\n<p><strong>Cân nặng:</strong> 28 kg</p>\r\n<p><strong>Mẫu mặc size 8-9</strong></p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(853,85,0,427,'Quần nỉ túi phối viền'),(854,76,0,427,'<div class=\"tab-content active showContent\">\r\n<p>Quần nỉ bé gái dáng dài, bo gấu, cạp chun, 2 bên có 2 túi vuông phối viền màu nổi bật. Chất liệu vải thun nỉ mềm mịn, thoải mái, giữ ấm tốt phù hợp cho bé mặc ở nhà, đi chơi. </p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 128 cm</p>\r\n<p><strong>Cân nặng:</strong> 28 kg</p>\r\n<p><strong>Mẫu mặc size 8-9</strong></p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(855,85,0,428,'Quần sooc giả váy II'),(856,76,0,428,'<div class=\"tab-content active showContent\">\r\n<p>- Quần sooc bé gái dáng suông rộng, độ dài ngang đùi</p>\r\n<p>- Eo chun co giãn. 2 tà phía trước tạo kiểu giả váy</p>\r\n<p>- Chất liệu linen thoáng mát, mềm nhẹ</p>\r\n<p>- MIx cùng nhiều kiểu áo khác nhau. Phù hợp cho bé diện hằng ngày</p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 128 cm</p>\r\n<p><strong>Cân nặng:</strong> 28 kg</p>\r\n<p><strong>Mẫu mặc size 8-9</strong></p>\r\n</div>'),(857,85,0,429,'Set áo 2 dây phối bèo xếp tầng'),(858,76,0,429,'<div class=\"tab-content active showContent\">\r\n<p>Áo 2 dây vải thô, thiết kế phối bèo xếp tầng xòe rộng.</p>\r\n<p>Quần dài dáng lửng, eo chun co giãn.</p>\r\n<p>Set đồ màu sắc tươi tắn, chất liệu vải thô mềm nhẹ thấm hút mồ hôi tốt giúp bé có một mùa hè vui chơi thoải mái mà vẫn dễ chịu ngay cả khi thời tiết nóng bức nhất.</p>\r\n</div>'),(859,85,0,430,'Đầm tweed dáng suông'),(860,76,0,430,'<div class=\"tab-content active showContent\">\r\n<p>Đầm tweed cổ tròn, đính nơ phụ kiện. Dáng không tay. Đầm suông, diềm bèo dưới gấu. Cài bằng khóa kéo ẩn sau lưng.</p>\r\n<p>Màu sắc: Đỏ Ruby - Đỏ</p>\r\n<p><strong>Mẫu nhí mặc size 8-9:</strong></p>\r\n<p>Cao 1m29 nặng 29,5kg</p>\r\n</div>'),(861,85,0,431,'Đầm lông bé mèo'),(862,76,0,431,'<div class=\"tab-content active showContent\">\r\n<p>Đầm lông cổ mũ có dây kéo rút. Tay dài bo gấu. Dáng đầm suông được bo gấu. Bằng vải lông chần và được thêu hình bé mèo khác màu độc đáo.</p>\r\n<p>Màu sắc: Be - Hồng san hô</p>\r\n</div>'),(863,85,0,432,'Đầm 2 dây'),(864,76,0,432,'<div class=\"tab-content active showContent\">\r\n<p>Đầm 2 dây bé gái. Diềm bèo. Phần áo được chần chun co giãn đều. Tùng xòe, có 2 túi vuông. Chất vải thô, có lớp lót rời bên trong.</p>\r\n<p>Màu sắc: Họa tiết Tím Đậm - Kẻ trắng</p>\r\n<p><em><strong>Mẫu mặc size 8-9:</strong></em></p>\r\n<ul>\r\n<li><em><strong>Chiều cao</strong> 1m29 </em></li>\r\n<li><em><strong>Cân nặng</strong> 29,5kg</em></li>\r\n</ul>\r\n</div>'),(865,85,0,433,'Đầm thun tay hến'),(866,76,0,433,'<div class=\"tab-content active showContent\">\r\n<p>Đầm thun cổ tròn, tay hến viền bèo xếp. Eo có dây kéo rút thắt nơ. Tùng váy xòe. Cài bằng khuy giọt lệ phía sau. 2 túi vuông 2 bên. Vải họa tiết bắt mắt.</p>\r\n<p>Màu sắc: Họa tiết Trắng</p>\r\n<p><em><strong>Mẫu mặc size 8-9:</strong></em></p>\r\n<ul>\r\n<li><em><strong>Chiều cao</strong> 1m29 </em></li>\r\n<li><em><strong>Cân nặng</strong> 29,5kg</em></li>\r\n</ul>\r\n</div>'),(867,85,0,434,'Đầm thun Stay Yourself'),(868,76,0,434,'<div class=\"tab-content active showContent\">\r\n<p>Đầm mang lại sự duyên dáng và nữ tính cho bé gái. Lựa chọn thiết kế cổ sen (cổ tròn có phần nếp gấp) tạo điểm nhấn tăng sự dịu dàng cho đầm. Thân dưới với phần xòe bồng bềnh, giúp bé yêu trông thật dễ thương. </p>\r\n<p>Đầm lựa chọn chất liệu thun cotton cao cấp, nhẹ, mềm mịn, đảm bảo sự thoải mái cho bé trong mọi hoàn cảnh.</p>\r\n<p>Mẹ có thể mix đầm cho bé với giày búp bê và một chiếc băng đô xinh xắn để hoàn thiện bộ trang phục. </p>\r\n</div>'),(869,85,0,435,'Đầm kẻ đuôi cá'),(870,76,0,435,'<div class=\"tab-content active showContent\">\r\n<p>Lựa chọn kiểu dáng đầm đuôi cá cho bé yêu sẽ giúp bé trông thật dễ thương và xinh xắn trong mọi dịp.</p>\r\n<p>Đầm cổ tròn, tay ngắn, kiểu dáng đuôi cá cùng họa tiết kẻ cá tính. Đầm nổi bật với phần đuôi cá ở phía sau, tạo điểm nhấn và mang lại vẻ nữ tính cho bé yêu.</p>\r\n<p>Đầm lựa chọn chất liệu thun cotton cao cấp, nhẹ, mềm mịn, đảm bảo sự thoải mái cho bé trong mọi hoàn cảnh.</p>\r\n<p>Mẹ có thể mix đầm đuôi cá cho bé với giày búp bê, vòng cổ nhỏ, và một chiếc băng đô xinh xắn để hoàn thiện bộ trang phục. </p>\r\n</div>'),(871,85,0,436,'Đầm thun Hoodie'),(872,76,0,436,'<div class=\"tab-content active showContent\">\r\n<p>Đầm hoodie dáng suông cho bé là một lựa chọn thoải mái cho các bé gái trong mùa Thu/ Đông này. Thiết kế hoodie mang lại sự ấm áp, giúp bé linh hoạt trong mọi hoạt động hằng ngày. </p>\r\n<p>Thiết kế có hai phiên bản màu đỏ và tím, tất cả đều là gam màu tươi sáng, bắt mắt thích hợp với trẻ nhỏ. Trước ngực, đầm được thêu chữ dễ thương, tăng phần sinh động. </p>\r\n</div>'),(873,85,0,437,'Đầm CUTE đuôi cá'),(874,76,0,437,'<div class=\"tab-content active showContent\">\r\n<p>Lựa chọn kiểu dáng đầm đuôi cá cho bé yêu sẽ giúp bé trông thật dễ thương và xinh xắn trong mọi dịp. Đầm cổ tròn, tay dài, kiểu dáng đuôi cá cùng họa tiết ngộ nghĩnh. Đầm nổi bật với phần đuôi cá ở phía sau, tạo điểm nhấn và mang lại vẻ nữ tính cho bé yêu.</p>\r\n<p>Đầm lựa chọn chất liệu thun cotton cao cấp, nhẹ, mềm mịn, đảm bảo sự thoải mái cho bé trong mọi hoàn cảnh.</p>\r\n<p>Mẹ có thể mix đầm đuôi cá cho bé với giày búp bê, vòng cổ nhỏ, và một chiếc băng đô xinh xắn để hoàn thiện bộ trang phục. </p>\r\n</div>'),(875,85,0,438,'Đầm thun dài tay smile'),(876,76,0,438,'<div class=\"tab-content active showContent\">\r\n<p>Đầm thun dáng suông cổ tròn, tay dài bo gấu. Độ dài qua đầu gối, 2 bên có 2 túi chéo. Mặt trước đính hình mặt cười ngộ nghĩnh. Chất liệu vải thun mềm mịn, giữ ấm cho bé những ngày se lạnh.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 128 cm</p>\r\n<p><strong>Cân nặng:</strong> 28 kg</p>\r\n<p><strong>Mẫu mặc size 8-9</strong></p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(877,85,0,439,'Đầm thun skateboard'),(878,76,0,439,'<div class=\"tab-content active showContent\">\r\n<p>Đầm thun cổ tròn, tay dài bo gấu. Eo hạ tùng váy xòe rộng ngang đầu gối. Mặt trước thêu hình ngộ nghĩnh. Chất liệu thun dập nổi mềm, có độ dày vừa phải giúp bé giữ ấm hiệu quả.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 128 cm</p>\r\n<p><strong>Cân nặng:</strong> 28 kg</p>\r\n<p><strong>Mẫu mặc size 8-9</strong></p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(879,85,0,440,'áo thun bé trai ngắn tay'),(880,76,0,440,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun được làm từ chất liệu thấm hút, không gây kích ứng cho da bé, giúp bé luôn cảm thấy thoải mái và khô ráo suốt cả ngày.</p>\r\n<p>Ba mẹ có thể dễ dàng kết hợp áo với các loại quần, quần short hoặc jeans để tạo ra nhiều phong cách khác nhau cho bé. Ngoài ra, sản phẩm còn có nhiều màu sắc và họa tiết đa dạng để bạn lựa chọn phù hợp với sở thích và phong cách của bé trai.</p>\r\n</div>'),(881,85,0,441,'Áo thun thêu chữ'),(882,76,0,441,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun tay ngắn với chất liệu thông thoáng là một lựa chọn hoàn hảo cho những ngày hè nóng bức. Thiết kế cổ tròn đơn giản được đính kèm 3 khuy trang trí tạo nên điểm nhấn thú vị cho sản phẩm.</p>\r\n<p>Với thiết kế đơn giản và dễ phối đồ, chiếc áo thun này có thể được kết hợp với nhiều loại quần như jean, short. Nếu bé muốn tạo nên phong cách năng động, hãy chọn quần jean và giày sneakers. Trong khi đó, muốn tạo nên phong cách lịch sự cho bé, hãy kết hợp chiếc áo thun này với quần âu.</p>\r\n<p>Không chỉ là một thiết kế thoải mái và dễ mặc, chiếc áo thun tay ngắn còn là một lựa chọn thời trang đa năng và phù hợp với nhiều phong cách khác nhau.</p>\r\n</div>'),(883,85,0,442,'Áo Polo thêu hình'),(884,76,0,442,'<div class=\"tab-content active showContent\">\r\n<p>Sử dụng chất liệu vải thoáng mát, thông thoáng cho những hoạt động vui chơi học tập của bé. Áo có thêu hình trước ngực tạo nên điểm độc đáo và thu hút, hình ảnh được thêu nổi, tỉ mỉ tới từng chi tiết, không bị phai màu và bền bỉ theo thời gian.</p>\r\n<p>Có thể kết hợp với quần jean, sooc hay quần kaki để mang đến những bộ trang phục phong cách, thoải mái cho bé. Nếu muốn tạo nên phong cách lịch sự hơn cho những buổi đi chơi hay đi học, ba mẹ hãy phối áo polo với quần âu hoặc quần tây.</p>\r\n</div>'),(885,85,0,443,'Áo thun Dinosaurs'),(886,76,0,443,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun Dino Saurs được in hình khủng long phía trước. Áo có kiểu dáng 3 lỗ năng động, phù hợp với các bé trai yêu thích hoạt động ngoài trời và thích thoải mái trong việc vận động.</p>\r\n<p>Chất liệu của áo thun là thoáng mát, giúp bé cảm thấy dễ chịu khi mặc trong những ngày nóng. Ngoài ra, áo còn rất dễ phối đồ với các trang phục khác. Ba mẹ có thể kết hợp áo thun này với quần short hoặc quần jean, tùy thuộc vào hoàn cảnh và sở thích của bé.</p>\r\n</div>'),(887,85,0,444,'Set thun baby shark'),(888,76,0,444,'<div class=\"tab-content active showContent\">\r\n<p>Set thun Baby Shark là một thiết kế tiện ích cho bé trai với chất liệu vải thun thoáng mát, thấm hút mồ hôi, giúp bé thoải mái và dễ chịu khi mặc. Bộ set gồm áo thun cổ tròn tay ngắn và quần sooc, được thiết kế đơn giản nhưng không kém phần nổi bật nhờ chi tiết hình cá mập.</p>\r\n<p>Set đồ sẽ là lựa chọn hoàn hảo cho ba mẹ muốn tạo cho bé sự thoải mái, dễ chịu, năng động và thời trang.</p>\r\n</div>'),(889,85,0,445,'Áo sơ mi bé trai'),(890,76,0,445,'<p>Áo sơ mi dáng suông. Các chi tiết bao gồm: cổ đức, tay ngắn, khuy cài. Chất liệu vải thô được xử lý màu đặc biệt. Mẫu thiết kế đáng yêu và năng động phù hợp cho bé trai diện đi chơi.</p>'),(891,85,0,446,'Set thun trơn không tay'),(892,76,0,446,'<p>Bộ thun trơn với dáng áo không tay phù hợp với những bé hiếu động, ra mồ hôi nhiều. Thiết kế mát mẻ giúp bé hoạt động, vui chơi thoải mái ngay cả trong những ngày nắng nóng.</p>'),(893,85,0,447,'Áo thun sư tử'),(894,76,0,447,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun bé trai trơn, cổ tròn, tay cộc. Phía trước áo được in hình sư tử dễ thương. Kỹ thuật in nổi sắc nét, hút mắt.</p>\r\n<p>Màu sắc: Trắng</p>\r\n<p><strong>Mẫu nhí mặc size 8-9</strong></p>\r\n<p>Chiều cao: 1m37 - Cân nặng: 39kg</p>\r\n</div>'),(895,85,0,448,'Áo thun bé trai vải sợi Modal'),(896,76,0,448,'<div class=\"tab-content active showContent\">\r\n<p>Áo thun cổ tròn, tay ngắn. Mặt trước hình in khác màu. </p>\r\n<p>Chất liệu vải sợi modal là vật liệu vải sinh học được làm từ cellulose tái chế từ cây sồi. Với chiết xuất hoàn toàn tự nhiên, có sự thuần khiết, bền bỉ và đặc biệt thân thiện với sức khỏe của người dùng, dễ dàng phân hủy trong môi trường tự nhiên. Kết cấu sợi vải chắc chắn, thoáng khí, ít vón cục sau khi bị ma sát. Sợi bóng, bề mặt mịn, mát hơn so với các chất liệu tương tự... Bền màu sau nhiều lần giặt và thời gian sử dụng lâu dài.</p>\r\n<p>Màu sắc: Trắng</p>\r\n<p><strong>Mẫu nhí mặc size 8-9</strong></p>\r\n<p>Chiều cao: 1m28 - Cân nặng: 29 kg</p>\r\n</div>'),(897,85,0,449,'Áo Polo Fight'),(898,76,0,449,'<div class=\"tab-content active showContent\">\r\n<p>Polo Day Fight cho bé diện đi học, đi chơi đều phù hợp. Thiết kế sử dụng chất liệu vải thun thoáng mát, thông thoáng cho những hoạt động vui chơi học tập của bé.</p>\r\n<p>Áo được thêu hình trước ngực tạo nên điểm độc đáo và thu hút. Áo có nhiều màu khác nhau để ba mẹ tha hồ lựa chọn cho con. Gợi ý ba mẹ hãy kết hợp áo với quần jean, sooc hay quần kaki để mang đến những bộ trang phục phong cách, thoải mái cho bé.</p>\r\n</div>'),(899,85,0,450,'Quần dài khaki bé trai'),(900,76,0,450,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài khaki cạp chun co giãn, 2 túi chéo 2 bên - 2 viền túi giả phía sau. Gấu bo chun co giãn.</p>\r\n<p>Màu sắc: Xanh Tím Than - Đen</p>\r\n<p><strong>Mẫu nhí mặc size 8-9:</strong> <strong>1m33 - 25kg</strong></p>\r\n</div>'),(901,85,0,451,'Quần dài khaki in hình'),(902,76,0,451,'<div class=\"tab-content active showContent\">\r\n<p>Quần dài khaki bé trai. Cạp chun co giãn có dây kéo rút. Gấu quần bo chun co giãn. 2 túi có nắp bên ống quần. Mix cùng áo polo, áo sơ mi cho bé!</p>\r\n<p>Màu sắc: Họa tiết Xanh Rêu - Họa tiết Ghi Khói</p>\r\n</div>\r\n<div class=\"show-more\"> </div>'),(903,85,0,452,'Quần sooc rằn ri'),(904,76,0,452,'<div class=\"tab-content active showContent\">\r\n<p>Quần sooc được làm từ chất liệu thun mềm. Cạp quần chun được may giả khóa. Họa tiết rằn ri xanh quân đội mang đến vẻ nghịch ngợm, nam tính cho các cậu nhóc.</p>\r\n<p>Màu sắc: Họa tiết Xanh oliu</p>\r\n<p><strong>Mẫu nhí mặc size 8-9</strong></p>\r\n<p>Chiều cao: 1m37 - Cân nặng: 39kg</p>\r\n</div>'),(905,85,0,453,'Quần Thun dài bo gấu'),(906,76,0,453,'<div class=\"tab-content active showContent\">\r\n<p>Tủ đồ bé yêu trong tiết trời giao mùa như hiện tại chắc chắn không thế thiếu mẫu quần thun dài. Quần sử dụng chất liệu thun nhẹ cao cấp vừa thoáng mát ngày hè vừa giữ ấm ngày đông.</p>\r\n<p>Quần cạp chụn, bo gấu chân và có túi sườn. Quần kết hợp được với nhiều kiểu áo khác nhau, thích hợp để bé diện đi học hay đi chơi. </p>\r\n</div>'),(907,85,0,454,'Quần dài thun hoạ tiết'),(908,76,0,454,'<p>Thiết kế quần dài hoạ tiết ngỗ nghĩnh dành tặng bé yêu. Quần chất liệu thun cao cấp, mang đến sự thoáng mát mà còn rất an toàn với làn da nhạy cảm của bé.</p>'),(909,85,0,455,'Quần sooc kaki bé trai'),(910,76,0,455,'<p>Với độ dài ngang đùi, quần sooc kaki sẽ giúp bé trai thoải mái vận động và tránh bị nóng trong những ngày nắng nóng. Chất liệu kaki bền bỉ và dễ giặt làm cho sản phẩm này trở thành lựa chọn ưu tiên hàng đầu cho các bậc cha mẹ.</p>\r\n<p>Ba mẹ cũng có thể phối món đồ trên với nhiều loại áo khác nhau cho bé mặc, từ áo thun, áo sơ mi hoặc áo khoác để tạo ra nhiều phong cách thời trang. Với một đôi giày thể thao, bé trai sẽ trông thật sành điệu và thoải mái. Sản phẩm quần sooc cho bé trai chắc chắn sẽ là một lựa chọn tuyệt vời để diện cho bé trong mùa hè.</p>'),(911,85,0,456,'Quần thun dài dáng ôm'),(912,76,0,456,'<div class=\"tab-content active showContent\">\r\n<p>Quần thun bé trai dáng dài, bo gấu, cạp chun, 2 bên có 2 túi chéo. Chất liệu vải thun mềm mịn, thoải mái, giữ ấm tốt phù hợp cho bé mặc ở nhà, đi chơi. <br />Quần diện cùng áo đồng bộ 58K1531</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 138 cm</p>\r\n<p><strong>Cân nặng:</strong> 38 kg</p>\r\n<p><strong>Mẫu mặc size 8-9</strong></p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(913,85,0,457,'Quần dài kaki eo chun'),(914,76,0,457,'<div class=\"tab-content active showContent\">\r\n<p>Quần bé trai dáng dài, gấu gấp tạo kiểu, cạp chun co giãn thoải mái, 2 bên có 2 túi chéo. Chất liệu vải khaki dày dặn, mềm mịn tạo phom dáng khỏe khoắn. Quần dễ dàng mix cùng nhiều kiểu áo khác nhau, phù hợp cho bé diện đi học hay đi chơi.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 138 cm</p>\r\n<p><strong>Cân nặng:</strong> 38 kg</p>\r\n<p><strong>Mẫu mặc size 8-9</strong></p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(915,85,0,458,'Quần khaki jogger bé trai'),(916,76,0,458,'<div class=\"tab-content active showContent\">\r\n<p>Quần jogger bé trai dáng dài, bo chun gấu, cạp chun co giãn thoải mái, 2 bên có 2 túi chéo, quần phối túi hộp 1 bên tạo điêm nhấn. Chất liệu vải khaki dày dặn, mềm mịn tạo phom dáng khỏe khoắn. Quần dễ dàng mix cùng nhiều kiểu áo khác nhau, phù hợp cho bé diện đi học hay đi chơi.</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 138 cm</p>\r\n<p><strong>Cân nặng:</strong> 38 kg</p>\r\n<p><strong>Mẫu mặc size 8-9</strong></p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>'),(917,85,0,459,'Quần thun dài bo gấu II'),(918,76,0,459,'<div class=\"tab-content active showContent\">\r\n<p>Quần thun bé trai dáng dài, bo gấu, cạp chun, 2 bên có 2 túi chéo. Chất liệu vải thun mềm mịn, giữ ấm tốt phù hợp cho bé mặc ở nhà, đi chơi. Quần mặc cùng áo thun MS 58K1512</p>\r\n<p><strong>Thông tin mẫu:</strong></p>\r\n<p><strong>Chiều cao:</strong> 138 cm</p>\r\n<p><strong>Cân nặng:</strong> 38 kg</p>\r\n<p><strong>Mẫu mặc size 8-9</strong></p>\r\n<p>Lưu ý: Màu sắc sản phẩm thực tế sẽ có sự chênh lệch nhỏ so với ảnh do điều kiện ánh sáng khi chụp và màu sắc hiển thị qua mản hình máy tính/ điện thoại.</p>\r\n</div>');
